INSERT INTO "casa" ("id","id_ciu_id","id_usu_id","id_prop_id","m2","precio","direccion","cp","tipo_venta","tipo_casa","titulo","descripcion","habitaciones","banos","coordenadas","especificaciones","prioridad","extra1","extra2","activo") VALUES (1,1,NULL,1,126,696000,'Calle Isla de Zanzibar, 59','28048','venta','dúplex','Dúplex en venta en calle Isla de Zanzibar, 59','Dos plazas de garaje.<br><br>El conjunto conforma una pequeña comunidad de ocho viviendas en una tranquila zona residencial de Peñagrande configurada bajo la tipología de dúplex apilados en dos niveles disponiendo todas ellas de dos orientaciones en esquina. Las cuatro viviendas inferiores disfrutan de un jardín privado al nivel del suelo mientras que cada una de las superiores disfruta de una cubierta ajardinada igualmente privada. Además, todas las viviendas comparten un jardín con zona de juegos infantiles, una piscina con solárium y un garaje comunitario que incluye plazas de motos y trasteros.<br><br>El acceso peatonal por la calle Isla de Zanzíbar atraviesa el jardín protegido por una marquesina vegetal y desembarca en un portal de madera. Desde aquí se distribuyen las viviendas que diferencian sus zonas estanciales de la de dormitorios por plantas. El ascensor y las escaleras tienen parada únicamente en las dos plantas públicas de los dúplex, la baja para las viviendas a nivel de parcela y la tercera para las superiores. Con esta organización se dota de gran privacidad a las viviendas que se convierten en pequeñas casas unifamiliares con jardín. Este efecto se consigue en las plantas bajas rodeando las dos fachadas de cada vivienda de un jardín con zonas diferenciadas de estancia, comida y barbacoa que se relaciona con el interior mediante grandes ventanales correderos y que se aísla de los vecinos y las calles mediante altas paredes de frondosa vegetación. Por su parte, las plantas superiores extienden su salón en vertical mediante una cómoda escalera-claraboya que accede a una azotea ajardinada que constituye un verdadero privilegio en esta zona de Madrid.<br><br>Cada vivienda cuenta en la planta de acceso con vestíbulo, aseo y gabanero a la entrada, y a continuación con una cocina y un salón-comedor conformando un espacio en ele con abundante luz natural. Una cómoda escalera de madera estratégicamente colocada conecta con la planta de dormitorios evitando cruces de circulaciones para desembarcar en un distribuidor que da acceso a dos dormitorios individuales que comparten un baño y un dormitorio principal con vestidor y baño privado. Un sistema de terrazas voladas de generosas proporciones prolongan lo salones, dormitorios y cocina en auténticas estancias al aire libre protegidas por cálidos cerramientos de madera. Los amplios ventanales de suelo a techo de todas las estancias tamizan la luz del sol mediante persianas enrollables orientables de lamas de aluminio.',3,3,'40.4748576,-3.7235515',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>126 m² construidos</li> <li>3 habitaciones</li> <li>3 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Promoción de obra nueva</li> <li>Trastero</li> <li>Certificación energética de proyecto: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo exterior con ascensor','Garaje incluido',NULL),
