n abundante luz natural. Una cómoda escalera de madera estratégicamente colocada conecta con la planta de dormitorios evitando cruces de circulaciones para desembarcar en un distribuidor que da acceso a dos dormitorios individuales que comparten un baño y un dormitorio principal con vestidor y baño privado. Un sistema de terrazas voladas de generosas proporciones prolongan lo salones, dormitorios y cocina en auténticas estancias al aire libre protegidas por cálidos cerramientos de madera. Los amplios ventanales de suelo a techo de todas las estancias tamizan la luz del sol mediante persianas enrollables orientables de lamas de aluminio.',3,3,'40.4748576,-3.7235515',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>126 m² construidos</li> <li>3 habitaciones</li> <li>3 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Promoción de obra nueva</li> <li>Trastero</li> <li>Certificación energética de proyecto: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo exterior con ascensor','Garaje incluido',NULL),
 (4,1,NULL,4,250,1200000,'Calle del Príncipe de Vergara','28015','venta','piso','Piso en venta en calle del Príncipe de Vergara','Promora Madrid vende piso en barrio Chamartín-Viso de 250 m2. 3 dormitorios más 1 de servicio, todos en suite. Portero Piso con una muy buena reforma y magnífica distribución en zona muy activa y comercial del barrio de El Viso cercana al barrio de Salamanca. La vivienda se distribuye en dos zonas muy diferenciadas. Por un lado la zona de recibo con salón comedor muy amplio y dormitorio principal en suite, exterior, con vestidor y dos cuartos de baño. Uno completo con bañera y el otro con plato de ducha y lavabo. La otra zona de la vivienda consta de dos dormitorios dobles en suite, sala de estar y zona de cocina con dormitorio de servicio también en suite. Resalta la luminosidad de estos dos dormitorios ya que tienen orientación oeste a un gran patio de manzana. La finca cuenta con portero físico y el portal se está reformando totalmente.<br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>“El distrito de Chamartín se encuentra situado en la zona noreste de Madrid. Distrito muy dinámico que discurre a lo largo del Paseo de la Castellana, eje central y centro neurálgico de la actividad empresarial de la capital madrileña en el que conviven diferentes estilos de vida y en el que destacan sus grandes avenidas, zonas residenciales, edificios oficiales, ministerios, embajadas, museos, auditorios de música, etc.<br>El distrito se divide en seis barrios con características muy diferentes entre ellos, desde las zonas residenciales de lujo más exclusivas como El Viso o Nueva España hasta configuración típica de barrio como Prosperidad o Ciudad Jardín. Castilla e Hispanoamérica son el resto de barrios que conforman este emblemático distrito madrileño.<br>En definitiva, se trata de un distrito ideal para aquellas personas que demandan vivienda de calidad sumada a una amplia gama de servicios, comercios, colegios, instalaciones deportivas, hoteles, oferta gastronómica y de ocio, hospitales, clínicas y una amplia red de transporte público.<br>Lejos de quedarse anclado en el tiempo, el desarrollo empresarial e inmobiliario en la zona de la estación de Chamartín con la futura Operación Chamartín, auguran un futuro prometedor para inversores y particulares que quieran establecerse en esta zona de la capital. ”.',4,4,'40.4395623,-3.680454',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>250 m² construidos</li> <li>4 habitaciones</li> <li>4 baños</li> <li>Segunda mano/buen estado</li> <li>Construido en 1968</li> <li>Calefacción central</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor',NULL,NULL),
 (5,1,NULL,4,236,1950000,'Calle de Alcalá','28017','venta','piso','Piso en venta en calle de Alcalá','Promora Madrid vende piso en el Barrio de Salamanca-Recoletos de 236m2,4 dormitorios el principal en suite más 2 baños completos. La vivienda se encuentra para reformar. En pleno Barrio de Salamanca-Recoletos, nos encontramos esta magnífica vivienda para reformar. Situada cerca del Parque del Buen Retiro en una finca de 1930 y una cuarta planta exterior. La vivienda se distribuye en un hall con acceso a un amplio salón de tres ambientes con techos altos y molduras, con cuatro balcones a la calle. La cocina independiente y amueblada y por último la zona de descanso compuesta por 4 dormitorios el principal en suite más 2 baños completos.<br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Sin duda, el distrito selecto por excelencia de Madrid. Pasear por las calles del barrio de Salamanca es contemplar los edificios más elegantes y codiciados de la capital: construcciones históricas de portales señoriales e interiores amplios y altos. Concebido en las últimas décadas del siglo XIX por D. José de Salamanca y Mayol, Marqués de Salamanca, este ensanche de la ciudad conserva intacto su aire aristocrático, que podemos ver en palacetes como el de la Embajada de Italia, por ejemplo.<br>En este epicentro del lujo se localiza la conocida “Milla de Oro”: un área comercial donde tienen su sede marcas prestigiosas como Dior, Chanel, Prada o Tiffany y Promora. Tiendas como Gallery, BD o Vitra y restaurantes como Ramsés o No, responden a los gustos de un life style moderno y sofisticado. Hablamos de una zona dinámica y segura, de grandes aceras, con un parking casi ilimitado y con una interesante vida nocturna: Nxt Club, Déjate Besar o Le Boutique Club.<br>No faltan las galerías de arte y los espacios dedicados a la cultura como la Fundación March o el museo Lázaro Galdiano. Sin olvidar sus árboles frondosos y la cercanía al parque del Retiro, el gran pulmón verde del centro de Madrid.',4,3,'40.4210438,-3.6827532',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>236 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Segunda mano/para reformar</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 4ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'4ª planta exterior con ascensor',NULL,NULL),
 (6,1,NULL,6,102,465000,'Avenida DE BURGOS','28024','venta','piso','Piso en venta en avenida DE BURGOS',NULL,3,2,'40.4814046,-3.6741663',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>102 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación oeste</li> <li>Construido en 1986</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 10ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'10ª planta exterior con ascensor','Garaje incluido',NULL),
 (7,1,NULL,7,160,940000,'Calle de la Montera','28018','venta','piso','Piso en venta en calle de la Montera','GILMAR CONSULTING INMOBILIARIO vende espectacular vivienda completamente reformada con vistas a la Puerta del Sol, es un precioso inmueble en pleno centro de Madrid. <br><br>Con una superficie de 166 m2, está distribuido en hall de entrada, luminoso salón comedor, cocina abierta, 3 dormitorios, 2 de ellos en suite y un tercer baño completo que da servicio a la otra habitación. Las altas calidades de los materiales utilizados en la reforma hacen que el inmueble tenga un valor añadido.<br><br>Ideal como vivienda o como inversión por su inigualable ubicación en la zona más céntrica de todo Madrid, a sólo 2 minutos andando de la estación de Sol (líneas 1, 2 y 3 de metro y C3, C4 e Intercity de Renfe) con perfectas comunicaciones y una oferta comercial, cultural y de ocio que no se puede comparar con ninguna otra.<br>Actualmente la vivienda se esta explotando como vivienda turistica y dispone de licencia uso turistico. El inmueble tiene una rentabilidad de mas 8% y eso hace que sea una oportunidad unica de inversion.<br><br>En Gilmar trabajamos para ofrecer a nuestros clientes los mejores inmuebles de Madrid, con equipos especializados en cada zona para proporcionarles la mejor opción a su necesidad, con todas las excelencias y cuidando al máximo los detalles.',3,3,'40.4193813,-3.7032859',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>160 m² construidos</li> <li>3 habitaciones</li> <li>3 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Construido en 2014</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 4ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'4ª planta exterior con ascensor',NULL,NULL),
 (8,1,NULL,4,270,2700000,'Recoletos','28001','venta','piso','Piso en venta en Recoletos','Promora Madrid vende piso en el barrio de Salamanca-Recoletos de 270m, 4 dormitorios dos de ellos en suite, 3 baños. La vivienda se encuentra para reformar. En pleno barrio de Salamanca- Recoletos a un paso del Retiro nos encontramos esta fantástica vivienda situada en una finca de primeros de siglo en una primera planta, a destacar los siete balcones a la calle.<br>La vivienda se caracteriza por su techos de gran altura y sus suelos de pino melis. Se distribuye en un hall con acceso a un gran salón con chimenes y comedor independiente, a continuación los dormitorios dos de ellos en suite y otro dos dormitorios uno actualmente funciona como despacho. Por último la cocina-office totalmente independiente amueblada y equipada. La vivienda dispone de calefacción central y servicio de portería <br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Sin duda, el distrito selecto por excelencia de Madrid. Pasear por las calles del barrio de Salamanca es contemplar los edificios más elegantes y codiciados de la capital: construcciones históricas de portales señoriales e interiores amplios y altos. Concebido en las últimas décadas del siglo XIX por D. José de Salamanca y Mayol, Marqués de Salamanca, este ensanche de la ciudad conserva intacto su aire aristocrático, que podemos ver en palacetes como el de la Embajada de Italia, por ejemplo.<br>En este epicentro del lujo se localiza la conocida “Milla de Oro”: un área comercial donde tienen su sede marcas prestigiosas como Dior, Chanel, Prada o Tiffany y Promora. Tiendas como Gallery, BD o Vitra y restaurantes como Ramsés o No, responden a los gustos de un life style moderno y sofisticado. Hablamos de una zona dinámica y segura, de grandes aceras, con un parking casi ilimitado y con una interesante vida nocturna: Nxt Club, Déjate Besar o Le Boutique Club.<br>No faltan las galerías de arte y los espacios dedicados a la cultura como la Fundación March o el museo Lázaro Galdiano. Sin olvidar sus árboles frondosos y la cercanía al parque del Retiro, el gran pulmón verde del centro de Madrid.',4,3,'40.4198902,-3.6873553',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>270 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Segunda mano/para reformar</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior',NULL,NULL),
 (9,1,NULL,4,219,1530000,'Almagro','28043','venta','piso','Piso en venta en Almagro','Promora Madrid vende piso de 219 metros reformado en Almagro(Chamberí). Hall de entrada, salón, comedor, 3 dormitorios, 2 cuartos de baño, cuarto de juegos, cocina con office, dormitorio y cuarto de baño de servicio. Precioso piso ubicado en una de las principales calles del barrio de Almagro. Espectacular reforma realizada en este inmueble de 219 metros que nos distribuye la vivienda en un amplio hall de entrada que nos da paso a un luminoso salón, muy amplio y con grandes ventanales que dan a la calle principal. La zona de descanso consta de tres dormitorios y se distribuye de la siguiente manera. Dos de los dormitorios, amplios, muy luminosos y bien equipados de armarios, comparten un baño y un family room o zona de estar. El dormitorio principal, también de buen tamaño y luminoso, dispone de cuarto de baño en suite y dos vestidores. La cocina tiene un office perfectamente integrado a la zona de salón, por lo que podría ser el comedor. Cuenta también la vivienda con un dormitorio de servicio con su cuarto de baño. Debemos destacar la magnífica reforma que se realizó y el gran aprovechamiento de los espacios que han generado una estupenda distribución y una inmejorable calidad de materiales y acabados. El propio piso en sí aporta una altura de techos de más de tres metros, una luminosidad muy buena y una fantástica ubicación.<br><br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Dicen sus vecinos que Chamberí es uno de los barrios más castizos de Madrid. Y nos les falta razón, aunque también es unos de los más elegantes. Un paseo por sus calles nos hace disfrutar de hermosísimos arbolados, de plazas acogedoras como la de Olavide y de edificios emblemáticos como el Hospital de Maudes, la Casa de las Flores o los palacetes del conocido “Triángulo de Oro”: un área donde se instaló a finales del siglo XIX y principios del XX gran parte de la aristocracia madrileña y que va desde el paseo de la Castellana hasta a las calles Génova, Almagro y Miguel Ángel.<br>Hablamos de un barrio muy abierto donde se mezclan sin prejuicio restaurantes sofisticados (Sergi Arola Gastro, La Caña o Atelier Belge) con tabernas populares. Hablamos de un barrio poblado de galerías de arte (Astarté, Elvira González, Marlborough), de salas de exposiciones como la del Canal de Isabel II (construida dentro de una inmensa cisterna), o de museos como el de Sorolla o el de la antigua estación de Metro de Chamberí. Sin dejar de lado la diversión nocturna en clubes y locales. Por nombrar solo algunos: la mítica Sala Clamores, el Moma Fifty Six o el ya clásico Club Fortuny.',4,3,'40.4349704,-3.6958394',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>219 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'5ª planta exterior con ascensor',NULL,NULL),
 (10,1,NULL,10,120,520000,'Calle José Donoso','28023','venta','piso','Piso en venta en Sanchinarro','Promora ofrece amplio piso de 3 dormitorios en la zona más exclusica de Sanchinarro. La comunidad cuenta con piscina de verano y de invierno (365 días), gimnasio, sauna, pista padel, sala común, parque infantil y seguridad 24 h. La vivienda consta de hall de entrada, coccina con tendedero acristalado, salón comedor con amplios ventanales, tres dormitorios dobles y dos cuartos de baño (uno de ellos en suite). Es totalmente exterior y cuarto de baño con ventana.<br>Posibilidad de habilitar despacho en el dormitorio principal.<br>Destacan las altas calidades de esta promoción tales como, persianas motorizadas, cristal climalit, baño principal de mármol travertino y con jacuzzi, paredes lisas, puertas de roble y tarima flotante en suelos.<br>Aire acondicionadop por conductos, calefacción individual de gas natural por radiadores con caldera de Saunier Duval. Centralita de alarma de incendio e inundación.<br>En el precio están incluidas 2 plazas de garaje y trastero. <br>Al lado de. metro ligero y paradas de autobuses, de colegios concertados, públicos y privados, del Corte Inglés de Sanchinarro, del Centro de Salud y Hospitales. <br><br>Sanchinarro es uno de los barrios más jóvenes de Madrid y se comenzó a construir a principios del siglo XXI. Situado entre la A-1, la M-11 y la M-40, tiene una superficie de poco más de 400 hectáreas. Su excelente ubicación y sus conexiones facilitan el día a día de sus habitantes. Como referencias geográficas, Sanchinarro linda al oeste con Las Tablas, al norte con El Encinar de los Reyes, al este con el parque de Valdebebas, y al sur con la Colonia Virgen del Cortijo y Manoteras.<br>Para terminar de situarlo, decir que el barrio cuenta con un Corte Inglés, dos hospitales privados, un centro de salud público, una oficina de Línea Madrid del Ayuntamiento, un centro cultural, el anillo verde ciclista, varios colegios públicos y concertados y la residencia de mayores Artevida Sanchinarro.<br><br>En Idealista sólo podrá ver algunos de nuestros inmuebles, entre en nuestra web y conozca toda nuestra oferta.',3,2,'40.4985432,-3.6514931',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>120 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor','Garaje incluido',NULL),
 (11,1,NULL,4,100,640000,'Castellana','28054','venta','piso','Piso en venta en Castellana','Promora Madrid vende piso en barrio Salamanca zona Castellana, de 100 m², a reformar. Originariamente, 3 dormitorios, 1 baño, cocina y salón independientes. El precio incluye trastero. La finca cuenta con portero físico. En la mejor zona del barrio de Salamanca se encuentra este piso en un edificio de los años 30 recientemente rehabilitado. Elegante portal con portero físico y ascensor de jaula, amplio, señorial y con montacargas y escaleras para el acceso del servicio doméstico.<br>Es una vivienda para reforma integral, pero con una configuración idónea para transformarlo en una acogedora vivienda adaptada a los gustos y necesidades del futuro propietario.<br>En origen se trataba de una vivienda de tres dormitorios con un baño, pero en la actualidad, dos de los dormitorios se han transformado en una confortable y tranquila sala de estar. <br>El piso disfruta de la tranquilidad y la luz natural que le proporcionan, en parte la orientación Este y los grandes ventanales del salón, y en parte por las vistas a un amplísimo patio interior de manzana con abundante vegetación.<br>Un valor seguro a la hora de adquirir un inmueble con una localización inmejorable y transformarlo en un piso exclusivo y funcional tanto para inversión como para vivienda propia.<br><br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Sin duda, el distrito selecto por excelencia de Madrid. Pasear por las calles del barrio de Salamanca es contemplar los edificios más elegantes y codiciados de la capital: construcciones históricas de portales señoriales e interiores amplios y altos. Concebido en las últimas décadas del siglo XIX por D. José de Salamanca y Mayol, Marqués de Salamanca, este ensanche de la ciudad conserva intacto su aire aristocrático, que podemos ver en palacetes como el de la Embajada de Italia, por ejemplo.<br>En este epicentro del lujo se localiza la conocida “Milla de Oro”: un área comercial donde tienen su sede marcas prestigiosas como Dior, Chanel, Prada o Tiffany y Promora. Tiendas como Gallery, BD o Vitra y restaurantes como Ramsés o No, responden a los gustos de un life style moderno y sofisticado. Hablamos de una zona dinámica y segura, de grandes aceras, con un parking casi ilimitado y con una interesante vida nocturna: Nxt Club, Déjate Besar o Le Boutique Club.<br>No faltan las galerías de arte y los espacios dedicados a la cultura como la Fundación March o el museo Lázaro Galdiano. Sin olvidar sus árboles frondosos y la cercanía al parque del Retiro, el gran pulmón verde del centro de Madrid.',3,1,'40.4302525,-3.6824447',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>100 m² construidos</li> <li>3 habitaciones</li> <li>1 baño</li> <li>Segunda mano/para reformar</li> <li>Trastero</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª interior </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta interior',NULL,NULL),
 (12,1,NULL,4,315,2200000,'Recoletos','28009','venta','piso','Piso en venta en Recoletos','Promora Madrid vende piso en el barrio de Salamanca-Recoletos de 315m², 3 dormitorios los tres de en suite más dormitorio de servicio y baño, aseo de cortesía. La vivienda, reformada en 2016, dispone de buenos acabados, servicio de conserje, aire acondicionado por conductos. En pleno barrio de Recoletos en una finca de mediados de siglo nos encontramos esta vivienda situada en una segunda planta exterior.<br>La vivienda se distribuye en un hall con acceso a un amplio salón-comedor de unos 70m² con tres ventanales a la calle. A continuación nos encontramos la cocina independiente totalmente amueblada y equipada. La zona de descanso compuesta por tres dormitorios los tres en suite el dormitorio principal con vestidor, más aseo de cortesía. <br>La vivienda cuenta con servicio de portería, aire acondicionado y calefacción individual.<br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Sin duda, el distrito selecto por excelencia de Madrid. Pasear por las calles del barrio de Salamanca es contemplar los edificios más elegantes y codiciados de la capital: construcciones históricas de portales señoriales e interiores amplios y altos. Concebido en las últimas décadas del siglo XIX por D. José de Salamanca y Mayol, Marqués de Salamanca, este ensanche de la ciudad conserva intacto su aire aristocrático, que podemos ver en palacetes como el de la Embajada de Italia, por ejemplo.<br>En este epicentro del lujo se localiza la conocida “Milla de Oro”: un área comercial donde tienen su sede marcas prestigiosas como Dior, Chanel, Prada o Tiffany y Promora. Tiendas como Gallery, BD o Vitra y restaurantes como Ramsés o No, responden a los gustos de un life style moderno y sofisticado. Hablamos de una zona dinámica y segura, de grandes aceras, con un parking casi ilimitado y con una interesante vida nocturna: Nxt Club, Déjate Besar o Le Boutique Club.<br>No faltan las galerías de arte y los espacios dedicados a la cultura como la Fundación March o el museo Lázaro Galdiano. Sin olvidar sus árboles frondosos y la cercanía al parque del Retiro, el gran pulmón verde del centro de Madrid.',4,5,'40.4257119,-3.6868673',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>315 m² construidos</li> <li>4 habitaciones</li> <li>5 baños</li> <li>Segunda mano/buen estado</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor',NULL,NULL),
 (13,1,NULL,13,161,590000,'Prosperidad','28027','venta','piso','Piso en venta en Prosperidad','Fabulosa vivienda con terraza y dos plazas de garaje en prosperidad.<br><br>GILMAR CONSULTING INMOBILIARIO- AVENIDA AMERICA (Tlf. 917717799) les ofrece en venta, en el distrito de Chamartín, en la mejor zona del barrio de Prosperidad y rodeado de parques, este inmueble en la calle Puenteareas junto a las calles Clara del Rey y Corazón de María. <br><br>La finca tiene portero físico, con servicios centralizados de calefacción y agua caliente y sin barreras arquitectónicas.<br><br> La vivienda es exterior y tiene entrada de servicio; actualmente está distribuida de la siguiente manera, hall de entrada, gran salón -comedor en dos ambientes con amplia terraza, cocina con terraza tendedero, cuatro dormitorios y tres cuartos de baño, el dormitorio principal con vestidor y en suite. La vivienda necesita reforma total por lo que usted se puede hacer el hogar de sus sueños ya que tiene grandes posibilidades.<br><br>Dispone de dos plazas de garaje en la misma finca con acceso directo y trastero. <br><br>En el barrio de Prosperidad podemos encontrar todos los servicios como comercios tradicionales, grandes superficies, oferta de restaurantes, colegios públicos y privados así como centros universitarios como la escuela universitaria de diseño, innovación y tecnología ESNE y centros de deporte como el polideportivo municipal Pradillo, con excelentes comunicaciones como la líneas 4 y 7 de metro a 5 minutos, varias líneas de autobuses 40, 43, 72, 9 y a un paseo del intercambiador de Avenida de América. <br><br>Comercializa Consulting Inmobiliario Gilmar Avenida América 91 771 77 99.<br><br>Estaremos encantados de proporcionarle más información.',4,3,'40.4422495,-3.6727942',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>161 m² construidos</li> <li>4 habitaciones</li> <li>3 