 (14,1,NULL,7,383,3200000,'Via Gran, 68','28012','venta','piso','Piso en venta en via Gran, 68','Gilmar pone a su disposición este magnífico ático/dúplex en uno de los edificios de lujo más representativos de la zona centro. De obra nueva, en plena Gran Vía con vistas panorámicas a la misma, en pleno centro de la ciudad.<br><br>La vivienda consta de 383 metros cuadrados aproximadamente, distribuidos en un amplio salón - comedor, cocina con barra americana equipada con todos los electrodomésticos, tres dormitorios con baño en suite con espacio para cama doble y otro cuarto de baño auxiliar para dar servicio a la zona del salón, así como una cocina adicional para la planta más alta y una serie de terrazas que rodean por completo la vivienda en ambos niveles.<br><br>La vivienda cuenta con numerosos balcones con terraza corrida así como otras más amplias y goza de espectaculares vistas panorámicas a toda la ciudad, haciéndola muy luminosa.<br><br>Dentro del mismo precio cuenta con dos plazas de garaje.<br><br>Esta exclusiva vivienda dispone de aire acondicionado, calefacción por conductos y suelo radiante.<br><br>En plena Gran Via, una oportunidad única de vivir en el centro de la ciudad y aprovechar al máximo todo lo que ofrece: ocio, los mejores centros comerciales, restaurantes, comercios, teatros, cines, etc. Y aun paso de todos los lugares turísticos y de interés de la capital,<br><br>La finca cuenta con piscina, gimnasio y gran terraza solarium con vistas panorámicas a todo Madrid, <br><br>Ademas cuenta con seguiridad y porteria 24H, plazas de parking de acceso directo desde la vivienda y ascensor. <br><br>Excelente ubicación y conexión con línea de metro Plaza de España en la puerta (líneas 2,3 y 10) Sol (lineas 1, 2, 3) y cercanías renfe. Y numerosas lineas de autobuses que comunican con toda la ciudad.<br><br>Es sin duda, una oportunidad única de vivir en una de las mejores zonas del centro de Madrid.<br><br>En Gilmar trabajamos para ofrecer a nuestros clientes los mejores inmuebles desde hace 37 años. Cubrimos todas las necesidades inmobiliarias: viviendas, oficinas, locales comerciales, solares, fincas rústicas, terrenos para construir.. .<br><br>Disponemos de más de 30 equipos especializados en distintas zonas al servicio de más de 90.000 clientes nacionales e internacionales, que cuentan con asesoramiento necesario para garantizar su seguridad, eficacia jurídica y la mejor rentabilidad financiero-fiscal.',3,4,'40.4226391,-3.7092923',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>383 m² construidos</li> <li>3 habitaciones</li> <li>4 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación norte, sur, este, oeste</li> <li>Construido en 2019</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="f" class="icon-energy-c-7"></span> (IPE no indicado)</li> <li>Acceso adaptado a personas con movilidad reducida</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 10ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'10ª planta exterior con ascensor','Garaje incluido',NULL),
 (15,1,NULL,15,104,850000,'Calle de Claudio Coello','28037','venta','ático','Ático en venta en calle de Claudio Coello','DIZA Consultores les presenta luminoso ático con terraza con orientación sur, en la calle Claudio Coello con plaza de garaje en el edificio de acceso directo.<br><br>En la sexta planta de un edificio construido a mediados de los años 70, encontramos este luminoso ático de 88 metros cuadrados aproximadamente de vivienda con una terraza de 16 metros.<br>Se distribuye en salón-comedor con acceso a la terraza, un dormitorio tipo suite y cocina independiente. En la distribución original contaba con dos dormitorios. <br><br>Todas las estancias tienen ventana, por lo que se trata de una vivienda muy luminosa. Aire acondicionado por bomba de calor y calefacción central. Además cuenta con plaza de garaje en el edificio de acceso directo. <br><br>El edificio cuenta con servicio de portería de lunes a domingo y el acceso no tiene barreras arquitectónicas.<br><br>El barrio Salamanca se trata de una de las zonas más lujosas y con mejor calidad de vida de Europa. Gracias a la amplia oferta gastronómica, cultural y comercial, se trata de una formidable zona donde vivir e invertir.<br><br>Estaremos encantados de atenderle.<br><br>Contáctenos al (+34) 91 563 49 01 o por WhatsApp (+34) 608 467 714<br><br>DIZA Consultores Inmobiliarios<br><br>Inmobiliaria de lujo en Madrid especializada en comprar, vender y alquilar pisos en las zonas premium de Madrid: Barrio de Salamanca, Almagro, Chamartín, Retiro, Pozuelo, Aravaca, Boadilla.<br>Convertimos Sueños en Hogares<br>Encuentra más en.',1,1,'40.4364227,-3.6869881',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>104 m² construidos</li> <li>1 habitación</li> <li>1 baño</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orien