 (23,1,NULL,21,175,640000,'Calle de la Bahía de Cádiz','28053','venta','piso','Piso en venta en calle de la Bahía de Cádiz','DE SALAS CONDE ORGAZ REF: MAV02347<br><br>De Salas Consultores Inmobiliarios presenta EN EXCLUSIVA este piso situado en Bahía de Cádiz 65 en planta baja con 4 dormitorios y un gran jardín.<br><br>El hall de entrada, con un aseo para invitados, separa perfectamente la zona de día de los dormitorios. El salón-comedor de casi 26 m2 es alargado y con salida directa al jardín de 59m2. Desde el jardín se puede acceder a la piscina comunitaria. Es un piso ideal para familias con niños. La cocina tiene dos frentes de trabajo y una zona office al final. Al otro lado del hall nos encontramos un pasillo que da acceso a los dormitorios. El principal mide casi 12m2 y tiene el baño en suite. Los otros 3 dormitorios comparten 1 baño. Todos tienen armarios empotrados. Además el pasillo cuenta con otro armario empotrado de gran utilidad.<br><br>El suelo de la vivienda es de mármol en el hall y salón-comedor y parqué en el resto. La calefacción es por gas natural mediante radiadores y tiene aire acondicionado frío-calor por splits en el salón y en 3 dormitorios.<br><br>Todas las habitaciones, así como el salón, dan a la terraza, que es muy amplia, alargada, perfecta para decorarla con varias zonas de estar creando diferentes ambientes.<br><br>Este piso se vende con 1 plaza de garaje y trastero.<br><br>Zonas comunes con jardín y piscina.',4,2,'40.4630129,-3.5953485',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>175 m² construidos</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 2002</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-