 (25,1,NULL,4,404,4350000,'Calle de Ayala','28043','venta','piso','Piso en venta en calle de Ayala','Promora Madrid vende piso en el Barrio de Salamanca-Recoletos de 404m2, 4 dormitorios más servicio todos ellos en suite más baño de servicio y aseo de cortesía. La vivienda está totalmente reformada a estrenar. Espectacular vivienda situada en una finca de 1959 en pleno Barrio de Salamanca-Recoletos. La vivienda de 404m2 cuenta con un hall de entrada con acceso a un amplio salón dividido en tres ambientes con comedor independiente. A continuación la zona de descanso compuesta por cuatro dormitorios todos ellos en suite. Zona de servicio con cocina independiente amueblada y equipada más dormitorio y baño de servicio, al final una gran terraza de 152m2. Calefacción central, aire acondicionado por conductos y trastero<br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Sin duda, el distrito selecto por excelencia de Madrid. Pasear por las calles del barrio de Salamanca es contemplar los edificios más elegantes y codiciados de la capital: construcciones históricas de portales señoriales e interiores amplios y altos. Concebido en las últimas décadas del siglo XIX por D. José de Salamanca y Mayol, Marqués de Salamanca, este ensanche de la ciudad conserva intacto su aire aristocrático, que podemos ver en palacetes como el de la Embajada de Italia, por ejemplo.<br>En este epicentro del lujo se localiza la conocida “Milla de Oro”: un área comercial donde tienen su sede marcas prestigiosas como Dior, Chanel, Prada o Tiffany y Promora. Tiendas como Gallery, BD o Vitra y restaurantes como Ramsés o No, responden a los gustos de un life style moderno y sofisticado. Hablamos de una zona dinámica y segura, de grandes aceras, con un parking casi ilimitado y con una interesante vida nocturna: Nxt Club, Déjate Besar o Le Boutique Club.<br>No faltan las galerías de arte y los espacios dedicados a la cultura como la Fundación March o el museo Lázaro Galdiano. Sin olvidar sus árboles frondosos y la cercanía al parque del Retiro, el gran pulmón verde del centro de Madrid.',5,6,'40.4276216,-3.685095',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>404 m² construidos</li> <li>5 habitaciones</li> <li>6 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Orientación sur</li> <li>Construido en 1959</li> <li>Calefacción central</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor','Garaje incluido',NULL),
 (26,1,NULL,19,391,4350000,'AYALA','28039','venta','piso','Piso en venta en AYALA','AMBASSADOR VELÁZQUEZ Ofrece espectacular piso completamente reformado en pleno barrio de Salamanca y a escasos metros de la calle Velázquez.<br><br>En la reforma se han utilizado los mejores materiales del mercado, cuidando hasta el último detalle todas las terminaciones, utilizando mármoles, materiales italianos y lámparas de cristal de Murano. También se ha incorporado suelos radiantes en baños y cerramiento aislantes de temperatura y sonido.<br><br>La distribución es la siguiente; hall de entrada con acceso a la zona de salón, dividida en tres ambientes, uno de ellos con pantalla de cine profesional. Comedor completamente independiente. Baño de invitados.<br><br>Por un pasillo accedemos a la zona de dormitorios, cuatro en total, todos ellos con su cuarto de baño en suite. El dormitorio principal, además, con zona de estar y vestidor.<br><br>La zona de servicio, compuesta por amplia cocina completamente amueblada y equipada con los mejores electrodomésticos, dormitorio, baño de servicio y entrada independiente.<br><br>Al fondo de la vivienda se encuentra ubicada una estupenda terraza/jardín de 156m2.<br><br>La vivienda cuenta con servicio de portería, calefacción central, aire acondicionado por conductos y trastero. Cabe la posibilidad de alquiler o comprar plazas de garaje muy cerca de la finca.<br><br>Aproximadamente un 30 % de los inmuebles que tenemos en esta zona solo están anunciados en nuestra web por expreso deseo de los propietarios. Para verlos pinche por favor en el enlace adicional ubicado en la parte final del anuncio.',5,4,'40.4285216,-3.683895',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>391 m² construidos</li> <li>5 habitaciones</li> <li>4 baños</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Construido en 1959</li> <li>Calefacción central</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor',NULL,NULL),
 (27,1,NULL,17,300,1650000,'Calle de Hermosilla','28019','venta','piso','Piso en venta en calle de Hermosilla','Promora Madrid vende piso en Salamanca-Recoletos. Inmejorable ubicación. En finca clásica de los años 20. Consta de cinco habitaciones y tres baños. Para reformar. Trastero. En la mejor zona de Recoletos, encontramos este magnífico piso para reformar. Se trata de una tercera planta exterior. Magnífica distribución. Consta de 300 metros en catastro de los que 260 corresponden a la vivienda. La distribución actual es la siguiente: Hall de entrada que nos lleva a la zona de recibo compuesta por tres estancias diferenciadas con tres balcones a la calle, que proporcionan una gran luminosidad. Distribuidor donde encontramos un gran comedor indepediente, habitación que actualmente se utiliza como office o comedor de diario. Zona de descanso compuesta por cinco amplias habitaciones, la principal con su baño incorporado y vestidor y dos baños completos adicionales. Amplia cocina con despensa y puerta de servicio. Preciosa finca clásica representativa, con portero físico, portal señorial. Amplio trastero. Inmejorables servicios y comunicaciones, rodeado de las tiendas y restaurantes más exclusivos de Madrid.<br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Sin duda, el distrito selecto por excelencia de Madrid. Pasear por las calles del barrio de Salamanca es contemplar los edificios más elegantes y codiciados de la capital: construcciones históricas de portales señoriales e interiores amplios y altos. Concebido en las últimas décadas del siglo XIX por D. José de Salamanca y Mayol, Marqués de Salamanca, este ensanche de la ciudad conserva intacto su aire aristocrático, que podemos ver en palacetes como el de la Embajada de Italia, por ejemplo.<br>En este epicentro del lujo se localiza la conocida “Milla de Oro”: un área comercial donde tienen su sede marcas prestigiosas como Dior, Chanel, Prada o Tiffany y Promora. Tiendas como Gallery, BD o Vitra y restaurantes como Ramsés o No, responden a los gustos de un life style moderno y sofisticado. Hablamos de una zona dinámica y segura, de grandes aceras, con un parking casi ilimitado y con una interesante vida nocturna: Nxt Club, Déjate Besar o Le Boutique Club.<br>No faltan las galerías de arte y los espacios dedicados a la cultura como la Fundación March o el museo Lázaro Galdiano. Sin olvidar sus árboles frondosos y la cercanía al parque del Retiro, el gran pulmón verde del centro de Madrid.',5,3,'40.4247055,-3.6826002',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>300 m² construidos</li> <li>5 habitaciones</li> <li>3 baños</li> <li>Segunda mano/para reformar</li> <li>Trastero</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor',NULL,NULL),
 (28,1,NULL,17,193,1599000,'Calle de José Abascal','28015','venta','piso','Piso en venta en calle de José Abascal','Promora Madrid vende piso de 193 metros, a estrenar, en Almagro. Hall de entrada, aseo de cortesía, salón, 3 dormitorios principales, 2 cuartos de baño, cocina, office y zona de servicio completa. Espectacular piso, a estrenar, recién reformado con unas magníficas calidades y una reforma excepcional. Hall de entrada que nos da paso al estupendo salón, completamente exterior, a continuación, un aseo de cortesía, tres dormitorios, el principal con el baño en suite y un gran vestidor, todos son muy amplios y luminosos y bien equipados de armarios, un segundo cuarto de baño para dar servicio a los otros dormitorios. La cocina, espectacular tanto en diseño como en tamaño, con una zona de office, se encuentra completamente equipada y dispone de una habitación de servicio con el baño en suite y que puede ser el cuarto dormitorio. De este piso no solamente hay que destacar la estupenda ubicación, tanto por zona como por la finca, sino también las calidades, la cuidada reforma y la magnífica distribución de los espacios.<br>PROMORA ADEMÁS CUENTA CON UNA AMPLIA CARTERA DE VIVIENDAS QUE POR EXPRESO DESEO DE LOS PROPIETARIOS NO SE PUEDEN PUBLICAR. LES RECOMENDAMOS QUE ENTREN EN LA WEB DE PROMORA.<br><br>Dicen sus vecinos que Chamberí es uno de los barrios más castizos de Madrid. Y nos les falta razón, aunque también es unos de los más elegantes. Un paseo por sus calles nos hace disfrutar de hermosísimos arbolados, de plazas acogedoras como la de Olavide y de edificios emblemáticos como el Hospital de Maudes, la Casa de las Flores o los palacetes del conocido “Triángulo de Oro”: un área donde se instaló a finales del siglo XIX y principios del XX gran parte de la aristocracia madrileña y que va desde el paseo de la Castellana hasta a las calles Génova, Almagro y Miguel Ángel.<br>Hablamos de un barrio muy abierto donde se mezclan sin prejuicio restaurantes sofisticados (Sergi Arola Gastro, La Caña o Atelier Belge) con tabernas populares. Hablamos de un barrio poblado de galerías de arte (Astarté, Elvira González, Marlborough), de salas de exposiciones como la del Canal de Isabel II (construida dentro de una inmensa cisterna), o de museos como el de Sorolla o el de la antigua estación de Metro de Chamberí. Sin dejar de lado la diversión nocturna en clubes y locales. Por nombrar solo algunos: la mítica Sala Clamores, el Moma Fifty Six o el ya clásico Club Fortuny.',3,4,'40.4365526,-3.6925992',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>193 m² construidos</li> <li>3 habitaciones</li> <li>4 baños</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor',NULL,NULL),
