 (45,1,NULL,45,79,1200,'Calle del Marqués de Cubas, 6','28044','alquiler','piso','Alquiler de Piso en calle del Marqués de Cubas, 6','DISPONIBLE EN FEBRERO DE 2021<br>Se alquila moderna vivienda en pleno centro de Madrid.<br>Situación inmejorable, en el Madrid de los Austrias, donde se encuentran la mayoría de los monumentos y sitios históricos de Madrid, además del Triángulo del Arte (Museo del Prado, el Museo Thyssen-Bornemisza y el Museo Reina Sofía).<br>Acceso rápido y cómodo a todos los medios de transporte (Bus Exprés Aeropuerto (24h); salida de Metro Banco de España en la misma calle; AVE / RENFE en la cercana Estación de Atocha; e intercambiador de autobuses, incluyendo Madrid City Tour y líneas nocturnas, en la Plaza de Cibeles).<br>Situado a escasos minutos andando de zonas comerciales y de ocio (Gran Vía, Preciados, Centro Canalejas, Parque del Retiro).<br>La vivienda consta de dos habitaciones, salón comedor, cocina, baño y aseo. Además, cuenta con un pequeño patio de uso y disfrute exclusivo de la vivienda.<br>Se trata de un bajo interior con grandes ventanales a distintos patios dejando entrar la luz y ventilación a la vivienda. Cuenta con calefacción (gas natural) por suelo radiante y aire acondicionado. Todo el perímetro de la vivienda está aislado.<br>La vivienda ha sido totalmente renovada hace pocos años con terminación de diseño muy cuidadas. El suelo es de microcemento y zonas de la pared con ladrillo visto. Cocina está panelada. Electrodomésticos de primeras marcas.<br>La vivienda es muy cómoda y aunque está en pleno centro, está muy bien aislada del ruido exterior.<br>El dormitorio principal cuenta con cama doble y baño en suite. El segundo dormitorio tiene dos camas individuales (cama nido). Las dos habitaciones cuentan con grandes armarios.<br>También tiene un aseo independiente.<br>La zona de salón-comedor es amplia y cuenta con una gran estantería y un sofá esquinero hecho a medida.<br>La cocina tiene todos los electrodomésticos y dispone de todo lo necesario para cocinar. Tiene bonitas paredes de ladrillo visto y comunica con un agradable patio interior de uso privativo.<br>Está totalmente amueblada y lista para entrar a vivir (tiene todo el menaje de casa).<br>Disponible para larga y cortas estancias.<br>Precio del alquiler negociable en función del número de meses de ocupación.',2,2,'40.4172511,-3.6956785',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>79 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (164 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo interior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo interior con ascensor',NULL,NULL),
 (46,1,NULL,44,149,2400,'Calle de Fuencarral','28042','alquiler','piso','Alquiler de Piso en calle de Fuencarral','Se alquila también amueblado. Fantástico piso a estrenar con terraza de 20 m2, dando a un jardín interior, en edificio de obra nueva de super lujo con piscina comunitaria en la azotea y trastero. Disponible desde ahora mismo.<br><br>El piso se alquila preferiblemente vacío, aunque cabe la posibilidad de entregarlo amueblado y decorado con un incremento de renta. Se ubica en la segunda planta del edificio y consta de un amplio salón comedor con cocina americana completamente equipada con electrodomésticos Siemens. El salón tiene salida a una amplia terraza de 20 m2, desde la que se puede salir, a su vez, al jardín comunitario interior.<br><br>Dispone de dos amplios dormitorios, igualmente con salida a la terraza, con armarios empotrados y vestidos, uno de ellos con el baño en suite. Además, hay otro cuarto de baño con bañera para uso del segundo dormitorio y de las visitas.<br><br>El edificio ha sido completamente rehabilitado con los más altos estándares de calidad, aislamiento y eficiencia energética, con calificación energética A. Se han mantenido algunos elementos originales, como su preciosa escalera interior estilo art deco y cuenta con dos ascensores. Servicio de portería y video portero. Carece completamente de barres arquitectónicas, por lo que es apto para personas con movilidad reducida.<br><br>La vivienda dispone de sistema de climatización y agua caliente mediante geotermia con conductos por suelo radiante y refrescante, lo que conlleva un gran ahorro en el consumo de energía y confort en el uso. Termostato individual en cada estancia, sistema de auto ventilación y renovación de aire con recuperación de calor. <br><br>Sin duda uno de los puntos fuertes de este edificio es que en la última planta cuenta con una piscina comunitaria espectacular, algo prácticamente inexistente en esta zona, desde donde se divisa todo Madrid, con una gran terraza solarium alrededor para poder subir, incluso cuando la piscina esté cerrada. Además, el edificio dispone de un parking para bicicletas eléctricas. Se alquila con un trastero incluido en el precio.<br><br>En definitiva, un edificio de super lujo con vecinos de alto nivel, que cuenta con todas las comodidades, situado en una de las zonas más de moda de la capital, en la calle Fuencarral, junto a la plaza de Barceló, rodeado de todo tipo de comercios, tiendas de moda y restaurantes y con el metro casi en la puerta. <br><br>Se piden 1 mes de fianza, garantías de pago o aval bancario, y el mes de honorarios de la agencia.',2,2,'40.4266809,-3.7029701',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>149 m² construidos, 88 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur</li> <li>Construido en 2019</li> <li>Cocina equipada y casa sin amueblar</li> <li>Se admiten mascotas</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="a" class="icon-energy-c-2"></span> (36 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor',NULL,NULL),
