 (50,1,NULL,50,54,950,'Calle de Pelayo','28024','alquiler','piso','Alquiler de Piso en calle de Pelayo','MODUS HOME PONE A TU DISPOSICIÓN SEGUNDA PLANTA, AMUEBLADO, EN LA ZONA DE CHUECA CON A/C. <br><br>Se trata de una 2ª planta interior de 54 metros construidos y 50 metros útiles.<br><br>Distribución: <br>- Salón. <br>- 1 Dormitorio. <br>- 1 Sala-Habitación<br>- 1 Baño.<br>- Cocina.<br><br>Todas las estancias independientes.<br><br>Se encuentra situado en una de las zonas mejor ubicadas del Centro de Madrid, a escasos metros de la Gran Vía. Zona con todos los servicios: supermercados, centro médico, zona de ocio y comercial. Paradas de Metro: Gran Vía y Chueca.<br><br>El piso está amueblado.<br><br>Descripción detallada:<br>- Salón muy luminoso con split de aire acondicionado, ventana, sofá, televisión, mesa comedor, mueble para el televisor.<br>- 1 Dormitorio. Split de aire acondicionado, armario empotrado totalmente vestido, cama doble con arcón.<br>- 1 Sala-habitación: Sala que se puede utilizar de despacho o para las visitas.<br>- 1 Baño con ducha, inodoro, lavabo, mueble de almacenaje y espejo.<br>- Cocina equipada con los electrodomésticos: lavadora, frigorífico, lavavajillas, horno eléctrico, microondas, vitrocerámica, campana extractora, muebles altos y bajos para almacenamiento.<br><br>Equipamiento: <br>- Ventanas de doble acristalamiento. <br>- Aire acondicionado con bomba de calor.<br>- Suelos de gres.<br>- Paredes lisas.<br>- Equipado con menaje.<br><br>Disponibilidad inmediata. <br><br>El alquiler incluye la Comunidad e IBI.<br><br>Finca:<br>En perfecto estado, con buenas calidades.<br><br>Condiciones económicas: <br>2 meses de fianza, 1 mes en curso, 1 mes de honorarios más IVA.<br>Necesario demostrar solvencia económica. Contrato de alquiler de mínimo 1 año.',2,1,'40.426029,-3.699268',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>54 m² construidos, 50 m² útiles</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual: Bomba de frío/calor</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª interior </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta interior sin ascensor',NULL,NULL),
 (51,1,NULL,51,90,1400,'Ibiza','28052','alquiler','piso','Alquiler de Piso en Ibiza','" DISEÑO, VANGUARDIA, LUZ Y EXCLUSIVIDAD A ESCASOS METROS DEL RETIRO "<br><br>Es un espacio ambientado según los parámetros de decoración vanguardista. Utilizando como color clave el blanco creando visualmente amplitud y luminosidad, al mas puro estilo neoyorquino. Comodidad, modernidad y diseño definen el estilo vanguardista de la decoración de este apartamento. <br>La propietaria ha dejado el sello de su verdadera vocación, la decoración de interiores, ha eliminado tabiques, creando espacios grandes y abiertos. Todos los materiales han sido elegidos con sumo cuidado, buscando siempre las mas novedosas y altas calidades. Ha buscado piezas y elementos decorativos de distintos estilos, mezclándolos a la perfección.<br><br>Desde la puerta de entrada accedemos a un espacio abierto, diáfano y muy luminoso. En este espacio es donde está ubicado la zona de recibo con un práctico armario recibidor lacado en verde agua y el amplio "salón"de 22 metros cuadrados. En el que nos encontramos con un cómodo sofá-cama doble, mesa de centro de diseño en cristal, bancos corridos de madera lacada con cajones para almacenaje, estantería-librería, butaca y colgada en la pared una televisión de plasma smart TV de 50'' pulgadas, que puede usarse como pantalla de ordenador. <br><br>"El dormitorio" tiene varios armarios empotrados con gran capacidad de almacenaje, una zona de trabajo y televisión de 22'' pulgadas. La cama es de 1,50 con colchón viscoleástico y canapé con arcón. Tiene baño en suite, con sanitario colgado y cisterna encastrada en la pared, lavabo encastrado en encimera silestone, plato de ducha y dos armarios empotrados, en uno de ellos es donde está la columna de lavado, lavadora y secadora. <br><br>"La cocina" está presidida por una mesa redonda de diseño con banco esquinero tapizado en piel. Está totalmente amueblada, la encimera es silestone y está equipada con placa de inducción, campana extractora, horno, microondas, lavavajillas y frigorífico,. Incluye pequeños electrodomésticos: aspirador, plancha, tabla de plancha, batidora, exprimidor, cafetera Nespresso y tostadora. <br><br>"Todas las habitaciones gozan de luz natural, incluido el baño" y aire acondicionado.<br><br>"La calefacción está incluida en los gastos de la comunidad, que son a cargo de la propiedad".<br><br>El parque del Retiro o parque del Buen Retiro, popularmente conocido como El Retiro, es un jardín histórico y parque público situado en Madrid (España). Considerado como una de las principales atracciones turísticas de la ciudad, alberga numerosos conjuntos arquitectónicos, escultóricos y paisajísticos de los siglos XVII a XXI, entre los que destacan el Monumento a Alfonso XII, el Palacio de Cristal, el Estanque Grande, el Parterre, laPuerta de Felipe IV, el Real Observatorio Astronómico y la fuente de la Alcachofa; e incluso anteriores, como la ermita románica de San Pelayo y San Isidoro.<br>Fue construido en la primera mitad del siglo XVII dentro del proyecto paisajístico desarrollado para el Palacio del Buen Retiro, una antigua posesión real creada por el conde-duque de Olivares (1587-1645)1 para disfrute de Felipe IV (1605-1665),2 de quien era su valido. Su uso como parque urbano se remonta a 1767, año en el que Carlos III (1716-1788) permitió la entrada del público a efectos recreativos3y, ya definitivamente, a partir de 1868, cuando quedó bajo la titularidad del Ayuntamiento de Madrid.<br>Debido a los destrozos provocados por la Guerra de la Independencia, su aspecto actual es resultado de las intervenciones realizadas en los siglos XIX y XX, si bien perviven trazados y elementos originales de los siglos XVII y XVIII.',1,1,'40.4188903,-3.678323',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>90 m² construidos</li> <li>1 habitación</li> <li>1 baño</li> <li>Segu