 (58,1,NULL,50,60,925,'Calle de Santa Ana','28052','alquiler','piso','Alquiler de Piso en calle de Santa Ana','MODUS HOME PONE A TU DISPOSICIÓN PISO EXTERIOR, CON ASCENSOR, EN LA ZONA DE LAVAPIÉS-EMBAJADORES, AMUEBLADO. <br><br>Se trata de una tercera planta exterior de 60 metros construidos y 50 metros útiles.<br><br>NO SE ADMITEN ANIMALES.<br><br>Distribución: <br>- Hall.<br>- Cocina.<br>- Salón comedor.<br>- Habitación.<br>- 1 baño.<br><br>Todas las estancias son independientes.<br><br>Se encuentra situado en una de las zonas mejor ubicadas de Lavapiés-Embajadores, cerca de El Rastro.<br>Cerca de las estaciones de La Latina (L5) y Tirso de Molina (L1). <br>Zona con supermercados, centro médico, zona de ocio y comercial.<br><br>El piso está amueblado.<br><br>Descripción detallada:<br>- Hall con repisa de cristal y espejo.<br>- Cocina equipada completamente nueva con vitrocerámica, horno eléctrico, lavadora, frigorífico, caldera de condensación, armarios altos y bajos de almacenamiento, campana extractora, ventana exterior a suelo, lavaplatos.<br>- Salón con sofá, mesa auxiliar, mueble para televisión con baldas, mesa comedor con cuatro sillas, lámpara con ventilador, gran ventanal exterior.<br>- Habitación con cama doble, armario empotrado completamente vestido, cómoda, mesillas de noche, ventana exterior a suelo.<br>- Baño con inodoro, bidé, bañera con ducha, mampara, mueble almacenamiento, lavabo y espejo. <br><br>Equipamiento: <br>- Calefacción por gas natural.<br>- Suelos de parqué recién acuchillado y gres en cocina y baño.<br>- Recién pintado.<br>- Electrodomésticos a estrenar.<br><br>Disponibilidad inmediata.<br><br>El alquiler incluye la Comunidad.<br><br>Finca:<br>En perfecto estado, con buenas calidades.<br><br>Condiciones económicas: <br>2 meses de fianza, 1 mes en curso, 1 mes de honorarios más IVA. <br>Necesario demostrar solvencia económica. Contrato de alquiler de mínimo 1 año.',1,1,'40.4118924,-3.7068248',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>60 m² construidos, 50 m² útiles</li> <li>1 habitación</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor',NULL,NULL),
