 (60,2,NULL,60,115,495000,'Plaza Guinardó, 10','08015','venta','piso','Piso en venta en plaza Guinardó, 10','Te imaginas unas viviendas diseñados para disfrutar viviendo con todos los servicios, con energía eficiente, con mucha luz, pisos espaciosos y muy tranquilos sin salir de casa?<br>Lo estamos haciendo para ti y dotados de piscina y espacioso solárium.<br>Todo lo que necesitas!<br><br>Estamos haciendo unas viviendas donde podrás vivir y respirar tranquilidad y donde compartir con la familia y amigos en su amplio salón y sus terrazas individuales.<br>Pisos totalmente exteriores: los dormitorios, el salón y la cocina dan a la terraza.<br>Dotado para disfrutar de zona comunitaria y piscina.<br><br>El edificio, eco eficiente y accesible, cuenta con una cubierta comunitaria con piscina y vistas espectaculares, una entrada desde la misma plaza Guinardó. para persona y coches, 3 plantas bajas dúplex (dos con patio), 8 viviendas distribuidas en cuatro plantas de altura todas ellas con 3 dormitorios y dos baños, cocina independiente, salón comedor y doble balcón exterior, además de16 plazas de aparcamiento para coche y 9 trasteros en las plantas sótano del edificio.<br>En la cubierta se encuentra la piscina de 13 m2 de lamina de agua rodeada de una zona entarimada y adaptada para disfrutar del exterior a modo de solárium y de las vistas, se accede a ella directamente con ascensor.<br><br>Las viviendas contarán con generosos espacios exteriores;<br>• Prácticamente todas las viviendas tienen accesos exteriores privados, ya sean balcones con vistas o jardines a pie de casa.<br>• Viviendas dúplex con patio / jardín privado para las familias y tipo loft para urbanitas.<br>• Todos los pisos son totalmente exteriores, de 3 habitaciones, con dos terrazas, especialmente pensados para respirar el exterior desde el salón y las habitaciones.<br><br>Las viviendas tendrán una Certificación Energética A (la más verde), con todas las comodidades de modo eco eficiente;<br>• Sistema de aerotermia integrando; aire acondicionado, calefacción y agua caliente sanitaria.<br>• Ventanas de doble acristalamiento tipo “climalit” con aislamiento termo acústico.<br>• Se ha realizado el máximo esfuerzo para combinar la estética y funcionalidad en nuestras cocinas, equipadas con muebles a medida, horno, encimera y campana extractora.<br>• Pavimentos de parquet y gres porcelánico.<br>• Armarios empotrados con revestimiento, altillo y cajoneras.<br>• Iluminación tipo LED en toda la vivienda.<br>• Acabados de máxima calidad.',3,2,'41.4212712,2.1752265',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>115 m² construidos, 98 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Promoción de obra nueva</li> <li>Certificación energética de proyecto: <span title="a" class="icon-energy-c-2"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor',NULL,NULL),
