 (64,2,NULL,64,351,2300000,'La Dreta de l''Eixample','08025','venta','piso','Piso en venta en La Dreta de l''Eixample','Espectacular piso de finales del siglo XIX de estilo modernista completamente reformado, ubicado a pocos pasos de lugares emblemáticos de Barcelona como La Pedrera, Paseo de Gracia o La Casa de les Punxes. Cuenta con una superficie de 351 m2 distribuidos desde un recibidor hacia un amplio comedor, un salón con acceso a galería y terraza, cocina independiente totalmente equipada (con horno, nevera, lavavajillas y microondas), un dormitorio doble con salida a patio, uno en suite con baño, gran vestidor y acceso a galería acristalada y balcón. Además, dispone de una habitación para invitados con baño independiente. Existe la posibilidad de hacer una cuarta habitación. Cuenta con un total 3 baños completos (uno en suite) y zona de aguas independiente. Cabe destacar la espectacular zona exterior de la propiedad, balcones, una galería y una terraza a patio interior de 170m2. <br><br>Se entrega sin amueblar, ofreciendo un sinfín de posibilidades. Íntegramente reformado, conservando acabados originales como suelos hidráulicos o techos abovedados y combinándolos con la modernidad y la sofisticación de una reforma reciente. Materiales de primerísima calidad para garantizar acabados inmejorables. Acristalamiento doble. Gas Natural y aire frío/calor por conductos. Vidrieras modernistas. Orientación doble. Luminoso, exclusivo y en la mejor zona de la ciudad. ZONA: Eixample - La Dreta de l''Eixample. TRANSPORTE: Diagonal (L3 y L5), Bicing y bus.<br><br>En ATIPIKA contamos con una dilatada experiencia en la gestión de operaciones inmobiliarias de compraventa y alquiler dirigidas a particulares y empresas. La exitosa trayectoria de ATIPIKA en el mercado inmobiliario permite poner a su disposición una amplia y atractiva cartera de productos inmobiliarios, a través de información comercial veraz y permanentemente actualizada, que se adaptará con el máximo rigor a sus expectativas. Nuestro equipo de profesionales está capacitado para ofrecerle las mejores propiedades, tanto en el ámbito nacional como en el internacional, mediante un trato discreto, personalizado y multilingüe. Más de 20 años ofreciendo el mejor servicio inmobiliario en Barcelona, la Costa Catalana e Islas Baleares.',3,3,'41.3948131,2.163417',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>351 m² construidos</li> <li>3 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Construido en 1900</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor',NULL,NULL),
 (65,2,NULL,65,174,299000,'La Font d''En Fargues','08022','venta','chalet adosado','Chalet adosado en venta en La Font d''En Fargues','Propiedad a reformar en Font d''en Fargues<br>Ubicada en la zona más residencial de Horta-Guinardó, encontramos esta magnifica casa de 174m2 mas 50 de terraza en segunda planta. Se trata de dos entidades registrales diferentes unidas de manera física internamente, para crear un fantástico espacio lleno de posibilidades. <br><br>En la planta baja encontramos una habitación doble, un baño y la escalera que conduce a la zona de noche, también un amplio comedor y una espaciosa cocina con salida a un pequeño patio y desde la cocina encontramos otro gran salón.<br><br>En la planta superior hallamos otro baño y cuatro grandes habitaciones exteriores, dos con ventanas a la calle y orientadas al nor-este y dos con ventanas al patio orientado al sur, todas con magnifica luz.<br><br>Desde este nivel a través de una pequeña escalera podemos acceder al terrado, un espacio de 50 metros con vistas al barrio de Font d’en Fargues en donde se ubica un trastero.<br><br>En estos momento está para reformar, sus divisiones actuales podrían convertirse en espacios abiertos y diáfanos así como en varias estancias separadas.<br><br>No dude en visitar esta vivienda, se sorprenderá y dará rienda a la creación de un hogar en una de las mejores zona de Barcelona.<br>La propiedad se encuentra en la calle Llobregós, dentro del apacible barrio residencial de Font d’en Fargas, muy bien comunicada por diferentes líneas de Buses, a tan sólo 6 minutos caminando del metro y pocos metros del túnel de la Rovira.<br><br>Font d’ en Fargas es uno de los barrios ajardinados de Barcelona, caminando por su calles, llenas de historia, no podrá dejar de sentirse cercano a la montaña, sin lugar a duda un sitio tranquilo para disfrutar de Barcelona.',6,3,'41.4267344,2.1593383',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Chalet adosado</li> <li>2 plantas</li> <li>174 m² construidos</li> <li>6 habitaciones</li> <li>2 baños</li> <li>Parcela de 50 m²</li> <li>Terraza</li> <li>Segunda mano/para reformar</li> <li>Construido en 1984</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (190 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
 (66,2,NULL,66,92,460000,'Calle de Viladomat','08028','venta','piso','Piso en venta en calle de Viladomat',NULL,4,2,'41.3861479,2.1454184',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>92 m² construidos</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/para reformar</li> <li>Armarios empotrados</li> <li>Orientación sur</li> <li>Construido en 1974</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (135 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor',NULL,NULL),
 (67,2,NULL,17,90,590000,'Calle d''Entença','08031','venta','ático','Ático en venta en calle d''Entença','ÁTICO CON TERRAZA: SOL, AIRE Y LUZ TODO EL DÍA!<br><br>Espectacular ático recién reformado a estrenar en Sant Antoni con vistas del Montjuic con mucho sol y luz todo el día.<br>El ático de 78 m² construidos más 24 m² de terraza, ha sido recientemente reformado con un diseño elegante y acabados de primeras marcas.<br>Se distribuye en un gran salón comedor con salida directa a la fabulosa terraza, una cocina de concepto abierto, 2 habitaciones (una suite principal con vestidor, baño completo y salida a la terraza, y otra individual), 2 baños y un lavadero. La terraza de 24 m² tiene vistas abiertas al verde del Montjuïc y recibe sol casi todo el día por su orientación Sur. Es el sitio ideal para disfrutar del sol del Mediterráneo y el skyline barcelonés.<br>La renovación ha sido diseñada teniendo en cuenta las necesidades actuales de espacio y confort plasmadas en un estilo contemporáneo que aporta calidez y que es fácilmente personalizable. La cocina se encuentra completamente equipada, hay armarios empotrados en la habitación individual y en una zona de distribución y un vestidor estilo "walking closet" en la habitación en suite. El piso dispone de aire acondicionado y calefacción a través de conductos, iluminación LED en todas las estancias, parquet de madera hidrófugo y carpinterías con aislamiento acústico-térmico. Toda ha sido pensado y diseñado al detalle.<br>El barrio de Sant Antoni es sin dudas uno de los barrios con mayor revalorización de los últimos años, y destino preferido para quienes buscan tranquilidad, ambiente residencial sin perder lo mejor de estar en una zona céntrica con claro acceso a transportes y servicios. La zona cuenta con las novedosas "superilles" de Barcelona: manzanas en las que se ha reducido el transporte automotor, el ruido y contaminación en todos sus aspectos para favorecer y mejorar el espacio público y la calidad de vida de los vecinos.<br>Un ático en perfecto equilibrio entre confort y elegancia.',2,2,'41.3759669,2.1567394',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>90 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (210 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 7ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'7ª planta exterior con ascensor',NULL,NULL),
 (68,2,NULL,68,130,450000,'Avenida Diagonal','08026','venta','piso','Piso en venta en avenida Diagonal',NULL,2,2,'41.3996667,2.1722377',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>130 m² construidos, 117 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación oeste</li> <li>Construido en 1954</li> <li>Calefacción central</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (120 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor',NULL,NULL),
 (69,2,NULL,69,105,475000,'L''Antiga Esquerra de l''Eixample','08007','venta','piso','Piso en venta en L''Antiga Esquerra de l''Eixample','Piso funcional con opción a parking en Eixample<br>En una finca de los años 70, al lado de Plaça Universitat, se encuentra este práctico piso, listo para entrar a vivir, que destaca por su funcionalidad y su privilegiada ubicación en el corazón del barrio del Eixample. <br>La vivienda se distribuye en una planta cuadrada de 105m2 construidos con única orientación a la calle y una distribución que aprovecha al máximo el espacio sin perder superficie en largos pasillos. <br>Al entrar al piso un recibidor-distribuidor articula las estancias de la zona de día. Frontalmente se accede al amplio salón-comedor con grandes ventanales y vistas a la calle, a la izquierda se encuentra la cocina con salida a un lavadero semiexterior al patio de luces y a la derecha un baño completo con ducha. El salón-comedor conecta lateralmente con la zona de noche en la que un pequeño distribuidor permite la entrada a un segundo baño con bañera, y a ambos lados a dos habitaciones dobles, una interior a patio de luces y otra exterior a calle a través de una agradable tribuna que también tiene acceso desde el salón.<br>Un pequeño armario en la entrada completa la propiedad que dispone de calefacción por radiadores y aire acondicionado por splits en las estancias principales. <br>La finca es del reconocido arquitecto Antoni de Moragas; cuenta con conserje, video portero y una amplia terraza comunitaria cuyas vistas permiten apreciar toda Barcelona. <br>En el mismo edificio hay opción de una plaza de aparcamiento con ascensor directo (no incluida en el precio). <br>Todas estas cualidades convierten a este apartamento en una opción ideal para parejas, familias, inversores, o quienes desean un pied-à-terre para disfrutar del centro de Barcelona.<br>Esta propiedad se encuentra en el corazón del Eixample Esquerra, en la calle Diputació, muy bien comunicada con el transporte público y a pocos minutos andando de Plaça Universitat y de la estación de metro Universitat (L1/L2) o de diversas paradas de autobús.<br>El distrito del Eixample Esquerra combina a la perfección su función residencial con la mejor oferta de ocio, cultura y comercio (cines, restaurantes, museos, Universidad de Barcelona y diversidad de tiendas comerciales y supermercados).<br>Con un agradable paseo se llega a Plaça Catalunya o Passeig de Gràcia, o bien en sentido contrario a Plaça Espanya, centros neurálgicos de la ciudad con una comunicación inmejorable.',2,2,'41.3847224,2.1608534',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>105 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Construido en 1973</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (98 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta con ascensor','Garaje incluido',NULL),
 (70,2,NULL,65,178,535000,'Sant Andreu','08036','venta','piso','Piso en venta en Sant Andreu','Joya arquitectónica en Sant Andreu<br>Se trata de un piso en un magnífico edificio señorial, patrimonio arquitectónico de Sant Andreu.<br><br>El piso tiene un amplio salón comedor, cocina, baño, tres habitaciones, estudio y trastero.<br><br>Accedemos a la vivienda a través de un precioso recibidor con pasillo, hacia la izquierda tenemos el trastero, el salón comedor y una gran habitación de casi 20 metros que dan a la fachada principal, con salida al balcón. A un lado del recibidor tenemos el estudio. Si tomamos el pasillo hacia el lado derecho, encontraremos dos grandes habitaciones y la preciosa galería de grandes ventanales, a la derecha de la galería tenemos el baño y a la izquierda la cocina, al fondo de la cocina tenemos un área de lavado independiente.<br><br>Los suelos hidráulicos la, carpintería original y los techos más de cuatro metros de altura, hacen de esta vivienda una maravillosa joya arquitectónica que vale la pena visitar.<br>El piso está en la calle principal del barrio de Sant Andreu. Rodeado de centros deportivos, comercios, colegios, zonas peatonales, bares y restaurantes, lo que hace de este piso un sitio ideal para disfrutar del barrio y desplazarse a cualquier parte de Barcelona gracias a su excelente comunicación a través del transporte público.',3,1,'41.4316635,2.1900479',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>178 m² construidos</li> <li>3 habitaciones</li> <li>1 baño</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Construido en 1900</li> <li>No dispone de calefacción</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (167 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª </li> <li> sin ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta sin ascensor',NULL,NULL),
 (71,2,NULL,71,234,1100000,'Sant Gervasi - La Bonanova','08020','venta','piso','Piso en venta en Sant Gervasi - La Bonanova',NULL,3,3,'41.4130985,2.1310214',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>234 m² construidos</li> <li>3 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 2007</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="c" class="icon-energy-c-4"></span> (51 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta sin ascensor','Garaje incluido',NULL),
 (72,2,NULL,71,236,1250000,'Pedralbes','08038','venta','piso','Piso en venta en Pedralbes','Piso con piscina cerca del Tenis Barcelona<br>¿Busca usted un piso elegante, muy amplio, con muchísima luz y posibilidades de reformarlo a su gusto? Entones lo ha encontrado. Este precioso piso es un tercero de altura, a tres vientos con grandes ventanas de techo a suelo en todas sus estancias y con vistas entre fincas al Real Club de Tenis Barcelona y a Montjuic desde su majestuoso salón y terraza de 21m2. Esta terraza se puede cubrir para aumentar, aún más, el salón. <br>Actualmente, dispone de 6 dormitorios muy amplios con tres baños completos, de los cuales uno es en suite, pero fácilmente se pueden realizar tres suites. Además, uno de los dormitorios dispone de una galería, la cual la mayoría de los vecinos han cubierto, ampliando así su amplitud y luminosidad. Todos los dormitorios dan a zonas comunitarias verdes con árboles, haciendo que las vistas sean muy agradables. Además de estos 6 dormitorios, nos encontramos con otra zona de servicio con un gran dormitorio y baño completo, además de zona de aguas y su propia entrada a la propiedad. Una cocina muy amplia con posibilidad de zona de office y gran ventana a un amplio patio completan este piso, el cual se merece toda su atención. <br>Además, dispone de un trastero muy amplio de unos 12m2 y dos plazas de parking en finca. La finca dispone de una cuidada zona comunitaria con piscina, zona de juegos y conserje. <br>No deje de visitar esta gran oportunidad en Pedralbes, pero en la zona más colindante a Sarria, donde dispondrá de todos los comercios y servicios que pueda desear.<br>El privilegiado barrio de Pedralbes es una zona residencial muy demandada para quién busca seguridad y tranquilidad, y estar rodeado de zonas verdes, con todo tipo de transporte público. Encontramos aquí todos los colegios de reconocido prestigio internacional como St. Peter ́s, St. Paul ́s, Benjamin Franklin, Zurich Schule, y el Liceo Francés entre otros y del mismo modo las universidades públicas y privadas como son la UB, UPC, ESADE e IESE. Paralelamente, a nivel de ocio están aquí ubicados los exclusivos Real Club del Polo y el Real Club de Tenis Barcelona. <br>La proximidad del casco antiguo de Sarrià y la buena comunicación con transporte público ofrecen a esta zona residencial un fácil acceso a comercios y servicios. La cercanía de colegios de prestigio nacional e internacional, así como la oferta universitaria de la zona, ofrecen un valor añadido.',7,4,'41.3942899,2.1176046',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>236 m² construidos</li> <li>7 habitaciones</li> <li>4 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1968</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (121 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta con ascensor','Garaje incluido',NULL),
 (73,2,NULL,73,110,395000,'La Sagrada Família','08034','venta','dúplex','Dúplex en venta en La Sagrada Família','Exclusivo ático-dúplex junto a la Sagrada Familia.<br><br>Excelente oportunidad de compra de un ático dúplex totalmente reformado y en perfecto estado para entrar a vivir, con mucha luz natural y excelentes vistas a la cúpula de la Sagrada Familia.<br>La vivienda se encuentra en un pasaje tranquilo, por lo que nos propone una oportunidad única de vivir en el centro de la ciudad rodeado de ofertas comerciales de todo tipo sin renunciar a la tranquilidad y a amplios espacios exteriores gracias a su gran terraza. <br>Este ático dúplex está compuesto por 3 dormitorios, salón con cocina americana y salida directa a amplia terraza. Un baño completo y un aseo. <br>La finca está en perfecto estado de conservación a pesar de ser de 1980 ya que al contar con pocos vecinos siempre se llevaron al día todo tipo de reparación de mantenimiento necesaria.<br>Entra las tantas características y acabados que se podrían destacar de esta propiedad mencionaremos sus excelente carpintería, trabajada en aluminio y con doble acristalamiento climalit, calefacción de gas natural con la caldera cambiada hace 5 años y radiadores independientes en todas sus estancias, suelos de parquet de madera, barbacoa, cercanía al transporte público y a puntos turísticos de alto interés cultural. <br>No dude en contactarnos para concertar una visita.',3,2,'41.4024422,2.1765257',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>110 m² construidos, 95 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Construido en 1980</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (146 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior sin ascensor',NULL,NULL),
 (74,2,NULL,74,78,199000,'Sants - Badal','08005','venta','piso','Piso en venta en Sants - Badal','Magnífica vivienda de 5 habitaciones en el Barrio de Sants. Piso amplio que da a calle y a patio de manzana, muy bien situado en el corazón de Sants. Cerca del Mercado y del Club Esportiu Mediterrani de la calle Begur. Zona aparcamiento en la Plaza de la Olivereta. Fachada con valor arquitectónico y bien conservada. Entrando a mano izquierda hay dos habitaciones dobles que dan a calle, una de ellas con salida a balcón. Recorriendo el pasillo hay tres habitaciones más con la opción de habilitarlas como estudio o vestidor. Al final del pasillo se accede a un amplio salón comedor, . muy luminoso por tener luz directa del patio de manzana, sin edificaciones enfrente. Desde el salón se accede a la cocina, reformada recientemente y completamente equipada. También desde el salón se accede al baño, con plato de ducha y en el que hay posibilidad de instalar lavadora. El piso tiene dos splits de frío y calor, uno situado en el salón y el otro en la entrada. Pavimentos de gres y puertas de madera maciza. Los techos están bajados con pladur, aunque de origen son techos altos con bovedilla catalana. Piso muy bien comunicado y perfecto para entrar a vivir. Muchas posibilidades. No dudes en venir a verlo. ( El PVP indicado no incluye impuestos ni gastos de Escritura ).',5,1,'41.3715767,2.1281105',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>78 m² construidos, 72 m² útiles</li> <li>5 habitaciones</li> <li>1 baño</li> <li>Balcón</li> <li>Orientación norte, sur, este</li> <li>Construido en 1886</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (182 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior sin ascensor',NULL,NULL),
 (75,2,NULL,64,250,1050000,'Sant Gervasi - Galvany','08040','venta','piso','Piso en venta en Sant Gervasi - Galvany','Vivienda a reformar de 250m2 con terraza de 50m2 ubicada en una finca señorial de 1940 rehabilitada y con ascensor. El edificio se encuentra en plena ‘Avinguda Diagonal’, cerca de Vía Augusta y cerca de ‘Plaça Gal·la Placídia’ y del Círculo Ecuestre, en Galvany. La zona de día alberga un espectacular salón-comedor, muy amplio y exterior a calle y una cocina antigua de fogones con zona de lavadero y patio interior. La zona de noche cuenta con 4 dormitorios dobles y con una habitación de servicio. La vivienda cuenta con un total de 5 dormitorios, 2 baños completos y un aseo. También ofrece una zona de aguas independiente y otro patio interior. Cabe destacar la magnífica terraza de la vivienda, de 50m2, rodeada de vegetación e ideal como comedor de verano para disfrutar del buen tiempo de la ciudad.<br><br>Se entrega a reformar y con la posibilidad de dividir la propiedad en dos viviendas. Estilo señorial-colonial, cuidado hasta el más mínimo detalle. Suelos de parqué y carpintería de madera noble. Ascensor y montacargas en la misma finca. Trastero incluido. Puerta de servicio con acceso directo a montacargas. Servicio de portería. Terrado comunitario. Calefacción de Gas Natural. Orientación este y vistas a patio de manzana. Muy soleada, amplia y en la zona alta. ZONA: Sarrià - Sant Gervasi - Sant Gervasi – Galvany. TRANSPORTE: FGC-Provença, Metro-Diagonal (L5 y L3), bus y Bicing.<br><br>ATIPIKA cuenta con la experiencia y eficacia para encontrar lo que busca, tanto en el caso de particulares como de empresas. Somos una corporación inmobiliaria dinámica, con sede central en Barcelona, en constante evolución y cambio. Ofrecemos una amplia gama de servicios y productos: asesoramiento financiero personalizado, estudio de viabilidad económica para préstamos hipotecarios, comercialización de alquileres, etc. Contamos con convenios con las principales entidades bancarias a nivel nacional y disponemos de los mejores medios para gestionar cualquier operación inmobiliaria. Acompañamos a nuestros clientes en todo el proceso de comercialización, priorizando sus necesidades a través de un método transparente y comprometido. Avalan nuestra profesionalidad y crecimiento más de veinte años y miles de operaciones en las Islas Baleares, Barcelona y la Costa Catalana.',5,3,'41.3956444,2.1549884',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>250 m² construidos, 222 m² útiles</li> <li>5 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/para reformar</li> <li>Trastero</li> <li>Orientación este</li> <li>Construido en 1940</li> <li>Calefacción individual: Bomba de frío/calor</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'exterior con ascensor',NULL,NULL),
 (76,2,NULL,73,81,225000,'Urb. vall d''hebron','08040','venta','piso','Piso en venta en Urb. vall d''hebron, La Teixonera',NULL,3,2,'41.4252488,2.1473378',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>81 m² construidos, 77 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje por 100 € adicionales</li> <li>Segunda mano/buen estado</li> <li>Orientación oeste</li> <li>Construido en 1992</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (166 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> sin ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior sin ascensor','opc. 100 €/mes',NULL),
 (77,2,NULL,77,97,350000,'El Parc i la Llacuna del Poblou','08031','venta','piso','Piso en venta en El Parc i la Llacuna del Poblenou','Amplio piso a reformar en el Parc i la Llacuna<br>Entrando en la vivienda gozamos de un gran recibidor y un amplio trastero ideal para guardar todo tipo de material deportivo, de playa, limpieza, ropa etc. Desde el pasillo se accede a la espaciosa cocina y lavadero. También desde el pasillo accedemos a la primera habitación. Saliendo de ésta se encuentran los dos baños. Uno de ellos actualmente tiene bañera y el otro ducha. Ambos baños tienen ventilación por galería pequeña.<br>Al final del pasillo está el amplio y luminoso salón que destaca por su amplitud y gran entrada de luz natural. Desde el salón y desde la habitación principal se divisan unas bonitas y amplias vistas a la zona verde del patio interior y de parte del recinto de la Ciutadella.<br>Desde el salón accedemos a las otras dos habitaciones. Actualmente el piso tiene tres habitaciones, pero originalmente tenía cuatro. El piso es en su mayoría tabique, por lo que hay la posibilidad de cambiar la distribución del mismo fácilmente.<br>La zona se encuentra bien comunicada por autobús y metro (líneas 1 y 4), y tiene conexión inmediata con Ronda litoral y autopistas. El Parque de la Ciudadela y la proximidad al centro de la ciudad son también alicientes importantes en su ubicación. A nivel servicios, su proximidad con el corazón de Poblenou a todos los niveles, tiendas, comercios, supermercados, escuelas le otorga ese ambiente de barrio clásico, de pequeño pueblo dentro de una gran metrópolis.',4,2,'41.390269,2.1844339',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>97 m² construidos</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/para reformar</li> <li>Construido en 1970</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (132 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'con ascensor',NULL,NULL),
 (78,2,NULL,71,165,800000,'El Putxet i el Farró','08038','venta','piso','Piso en venta en El Putxet i el Farró','Moderno dúplex reformado en el Putxet<br>Les presentamos este fenomenal piso dúplex junto los Jardines del Turó del Putxet, en un edificio moderno con conserje, gran vestíbulo de acceso con escalera y ascensores.<br>El piso fue elegantemente rediseñado hace pocos años con materiales de muchísima calidad. En la planta de acceso encontramos un amplio recibidor separado mediante una corredera del gran estar-comedor, muy cálido, moderno y soleado gracias la magnífica orientación de sus tres grandes ventanales. La cocina es muy moderna, completamente equipada con armarios Bulthaup y electrodomésticos Gaggenau, y está conectada tanto con el recibidor con una estancia contigua que hace las funciones de office, ahora abierta al salón pero fácilmente reconvertidle en un dormitorio con salida a un patio interior. Esta planta dispone además de un aseo de cortesía con acceso desde el recibidor, desde el cual subimos a la planta superior mediante una elegante escalera de madera de Iroko, pavimento igual al resto del piso. En esta segunda planta se distribuye el resto del programa de esta maravillosa propiedad, organizado en un completísimo dormitorio de matrimonio con vestidor y baño con ducha y dos dormitorios dobles, todos ellos exteriores y soleados, con armarios empotrados incorporados. Estos dos dormitorios comparten un baño amplio y moderno con bañera de hidromasaje.<br>La propiedad cuenta además con armarios de madera hechos a medida, carpintería exterior de aluminio, calefacción a gas con radiadores y aire acondicionado por conductos .Completa esta propiedad dos plazas de aparcamiento grandes no incluidas en el precio, situadas en el sótano del mismo edificio.<br>En el barrio del Putxet con todo tipo de servicios: comercios, restaurantes, alimentación, colegios, cines, etc. El Putxet es una pequeña montaña en Sant Gervasi. Este barrio, en sus orígenes, fue un núcleo principal de vegetación, pero con la llegada del Ferrocarril de Sarriá, el metro y el tranvía se convirtieron en un lugar de residencia habitual. Muy cerca de los jardines del Turó del Putxet, el complejo deportivo municipal Putxet Sport, la Escuela bressol Putxet, el Mercado Municipal de Sant Gervasi. También se encuentra cerca del Tenis Barcino y el Multicines Balmes Club.<br>Muy bien comunicado con el centro de Barcelona con el metro a la parada de Vallcarca y de los ferrocarriles de la Generalitat de Cataluña con la línea de la Avda. Tibidabo y muy conectado con líneas de autobús urbano, el Tranvía Azul, que nos lleva al Funicular del Tibidabo. A tanto sólo 6 minutos de la Ronda de Dalt, donde podremos ir fácilmente a todas las direcciones.',4,3,'41.4077268,2.1456862',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>165 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Construido en 1992</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="g" class="icon-energy-c-8"></span> (460 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta con ascensor','Garaje incluido',NULL),
 (79,2,NULL,77,70,249000,'El Raval','08029','venta','piso','Piso en venta en El Raval','Maravilloso piso de diseño en Raval<br>En el corazón del centro histórico de Barcelona en la misma Rambla del Raval se halla este magnífico apartamento de dos habitaciones dobles y dos baños con reforma de alta calidad. Máxima comodidad para este piso esquinero todo exterior con techos altos y vista despejada. <br>Al entrar nos encontramos primero con la zona de día de las más agradables: un salón comedor amplio con su cocina moderna perfectamente integrada. La estancia destaca directamente por la amplitud de sus techos altos combinada con la doble orientación que ofrece este piso esquinero. Vista abierta impresionante a la Rambla del Raval y sus palmeras, ventanas altas y dos balcones grandes. Aparte de la calidad de los acabados notable apreciamos sin duda el gusto dado la decoración y la perfecta integración de los <br> elementos originales como las vigas de madera, las paredes de ladrillo y ventanas originales. Una verdadera sensación de bienestar.<br>Desde ahí accedemos vía un corredor a la zona de noche. Nos encontramos entonces a dos habitaciones dobles y también a dos baños completos para una máxima comodidad. Los dos dormitorios disponen de armarios empotrados, aire acondicionado y elementos originales. También nos encontramos a un local para lavadora.<br>Un sistema innovador de alarma ha sido instalado recientemente y se acaban de cambiar los suelos.<br>Máxima comodidad, seguridad y tecnología actual en un edificio histórico. <br>Se trata sin duda del producto céntrico ideal para inversores que buscan las rentabilidades más altas, solteros o parejas que buscan una compra lista en una zona en pleno crecimiento. El Pied-à-terre perfecto para los amantes del centro de Barcelona.<br>Excelente ubicación en el centro de la ciudad cerca del mar y del puerto en la avenida más grande del Raval de la Ciutat Vella. <br>El Raval, barrio más antiguo de la ciudad es y quedará el barrio más emblemático de la ciudad. Zona histórica muy atractiva para el turismo por su amplia oferta cultural, artística y de gastronomía. Jardines, museos, monumentos históricos combinados con mezclas de culturas, bares alternativos y restaurantes a la moda. La zona cuenta también con todos los servicios: centros educativos, supermercados, hospital y multitud de comercios. <br>Hoy en día el barrio se encuentra en pleno crecimiento y las posibilidades de revalorización son grandes. Los últimos años se llevaron a cabo muchos proyectos de primer plano (Reforma de la Rambla del Raval, Hôtel Barceló con su terraza 360º, filmoteca, entre otros). <br>La comunicación es óptima (cuatro paradas de metro a menos de 500 m y varios autobuses, bicing justo a bajo). Cerca de Plaza Cataluña el punto central de la ciudad donde llega el bus del aeropuerto y salen trenes para toda la región y las mejores playas.<br>Cerca de las Ramblas, a unos diez minutos caminando del puerto y unos veinte de la playa.<br>Una ubicación perfecta para los que quieren estar en el centro de la ciudad y quieren disfrutar todo lo bonito que ofrece Barcelona.',2,2,'41.3775227,2.169766',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>70 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Construido en 1850</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (153 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'sin ascensor',NULL,NULL),
 (80,2,NULL,71,150,850000,'Sant Gervasi - Galvany','08030','venta','piso','Piso en venta en Sant Gervasi - Galvany','Elegante y señorial piso en Sant Gervasi<br>En el barrio de Sant Gervasi, a un paso de la Avenida Diagonal y Rambla Catalunya, encontramos esta vivienda completamente reformada con acabados de alta calidad, ubicada en una finca regia. <br>Esta propiedad nos ofrece un diseño elegante y señorial manteniendo elementos Modernistas como los rosetones en los techos, los artesonados y las molduras en las paredes. Tiene suelos de madera de roble macizo en todo el piso, encolados pieza a pieza, sanitarios italianos Kerasan, cocina Smeg y un sinfín de detalles que le dan un aire distinguido. <br>La vivienda tiene una superficie de 150m2 y una distribución de doble orientación, separando la zona de día y de noche. <br>En la zona de día encontramos el salón comedor con sus ventanales de madera de suelo a techo orientado a noreste y una cocina medio abierta al salón que permite crear una conexión muy funcional. En el otro lado de la propiedad encontramos una master suite, una habitación doble y una individual que comparten un baño completo. La master suite está compuesta por un vestidor de gran tamaño, un baño con ducha y bañera y un pequeño salón orientado a sureste. <br>Presenta amplitud y luminosidad al tener los techos altos y grandes ventanales. Presenta todas las comodidades de una reforma integral de alto standing, aire acondicionado por conductos y separando zona de día y de noche y con control por domótica. Una zona de lavandería y un trastero completan esta preciosa vivienda.<br>Esta magnífica pieza, se encuentra en una de las mejores zonas de Barcelona, el prestigioso barrio de Galvany, próximo a todo tipo de servicio, transporte público y gran variedad de comercios, así como mucha oferta gastronómica. Un hecho especialmente importante, es la proximidad a la Avenida Diagonal, una de las principales vías de la ciudad, que al mismo tiempo define la separación natural y el inicio del emblemático Eixample. Desde el inmueble, podemos llegar a pie en menos de 10 minutos caminando al Passeig de Gràcia donde se encuentran las principales boutiques de lujo de la ciudad.',4,2,'41.3964793,2.1517862',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>150 m² construidos</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1925</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="f" class="icon-energy-c-7"></span> (189 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta con ascensor',NULL,NULL),
 (81,2,NULL,65,80,375000,'Vila de Gràcia','08014','venta','piso','Piso en venta en Vila de Gràcia','Bonito piso con perfecta ubicación en Gràcia<br>En una bonita finca de obra vista, en una tranquila calle que forma justo el punto medio entre Vila de Gràcia, Sant Gervasi y Eixample Esquerra se encuentra esta coqueta vivienda. Al cruzar la puerta de entrada, nos encontramos a lado izquierdo una habitación que podrá adaptar totalmente a sus necesidades y le podrá servir como dormitorio, despacho o vestidor. Siguiendo el pasillo cubierto con un bonito suelo de madera, se encontrará en la amplia y equipada cocina que se instaló hace pocos años y está en perfectas condiciones con acabados de calidad como la encimera de mármol. Dicha estancia tiene acceso directo a un patio que ofrece suficiente espacio para usarlo como zona de aguas, instalando la lavadora y secadora y si lo desea, también podrá crear una despensa. A continuación, se ubica el amplio y acogedor salón que goza de un gran diseño con una moderna chimenea de gas que separa la zona de día de la zona de noche. También hay acceso a un balcón de buen tamaño. Esa misma estancia está conectada con otro dormitorio y un baño completo. En resumen, es una propiedad en muy buenas condiciones, con acabados de calidad como la carpintería de PVC en el salón, nuevos radiadores eléctricos, suelos y puertas de madera y una chimenea de gran diseño y calidad. El piso está listo para entrar a vivir y al mismo tiempo da mucho juego en cuanto a distribución, ya que existe la posibilidad de crear un segundo baño o cerrar el dormitorio que está integrado en el salón. El equipo de E&amp;V invita a visitar esta magnífica propiedad.<br>El piso se sitúa en una de las mejores zonas de la Vila de Gracia, cerca de Vía Augusta, la Av. Diagonal, a pocos minutos de Passeig de Gràcia y junto a Plaza Narcís Oller y Gala Placídia. La zona tiene todo tipo de servicios desde restaurantes con ofertas gastronómicas de todos los rincones del mundo, a supermercados, centros deportivos, entidades bancarias, tiendas de ropa de diseñadores nombrados, galerías de arte e instituciones educativas y deportivas a pocos pasos. Con inmediata conexión con las arterias viales de la ciudad, Metro, Bus y Ferrocarriles.',3,1,'41.3968278,2.1544956',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>80 m² construidos</li> <li>3 habitaciones</li> <li>1 baño</li> <li>Balcón</li> <li>Armarios empotrados</li> <li>Construido en 1978</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (191 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta con ascensor',NULL,NULL),
 (82,2,NULL,65,110,430000,'Can Baró','08034','venta','chalet adosado','Chalet adosado en venta en Can Baró','Magnífica y soleada casa en Can Baró<br>Soleada casa con mucho encanto en el corazón del tranquilo barrio residencial de Can Baró. Sus acogedores espacios distribuidos en 2 plantas, con todas las estancias exteriores, disfrutan de magnífica luz durante todo el día gracias a la doble orientación, Este y Oeste. Muy bien conservada, esta propiedad está situada en una de las calles más tranquilas y valoradas de la zona.<br>Al entrar nos encontramos en un acogedor recibidor desde el cual accedemos a un amplio salón comedor con salida a un fabuloso patio de unos 20 m2. Conjuntamente al salón, encontramos una cómoda cocina, y al lado del recibidor, un precioso aseo.<br>Subiendo a la segunda planta, vemos una luminosa habitación doble exterior. A la derecha encontramos otra habitación doble, y cruzando el pasillo, una tercera habitación doble, ambas exteriores y muy luminosas. A la izquierda vemos un bonito baño completo con plato de ducha. <br>Siguiendo la escalera accedemos a una espectacular terraza de 34 m2 que permite disfrutar del sol durante todo el año. <br>La vivienda tiene calefacción por radiadores de gas, carpintería de aluminio y cuenta con acabados de calidad.<br>Una propiedad única y acogedora que lo tiene todo, ¡venga a verla!<br>Esta fantástica propiedad se encuentra en Can Baró, hoy en día considerado como una de las mejores zonas residenciales de Barcelona. Rodeada de 3 pulmones verdes, el famoso Parc Güell, Parc del Guinardó y Parc de les Aigües, la zona que respira paz y tranquilidad, estando a la vez perfectamente comunicada con varias líneas de autobuses y Metro (parada Alfons X de la línea 4 y próxima parada de la línea 9 en la Plaza Sanllehy). <br>El área cuenta con todo tipo de servicios, comercios, cafeterías y restaurantes, así como guarderías y colegios, ofreciendo un ambiente familiar y acogedor inmejorable donde no falte de nada. Complementa la propuesta una amplia y variada oferta deportiva con centros de nivel internacional como Club Natació Catalunya y Club de Tenis La Salut.',3,1,'41.4157407,2.1638352',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Chalet adosado</li> <li>2 plantas</li> <li>110 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Construido en 1936</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="f" class="icon-energy-c-7"></span> (224 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
 (83,2,NULL,71,129,685000,'Sant Gervasi - Galvany','08008','venta','piso','Piso en venta en Sant Gervasi - Galvany','Piso reformado cerca de Plaza Adriano<br>Precioso apartamento, totalmente reformado con las mejores calidades en la zona de Sant Gervasi Galvany, cerca de Plaza Adriano.<br>Este piso luminoso dispone de un recibidor que da acceso a las habitaciones y al salón-comedor que dispone de una zona despacho.<br>Entrando por el recibidor, encontramos dos habitaciones a la izquierda. Si se sigue recto nos encontramos el salón, y a la derecha tenemos el aseo de cortesía, la habitación principal y la cocina.<br>El apartamento dispone de aire acondicionado por conductos y calefacción por gas individualizada. En el salón se ha rescatado la bóveda catalana que nos da más altura y calidez a la estancia. En los techos hay un sistema de alumbrado moderno y sofisticado a la vez que indirecto.<br>Los acabados de las carpinterías, así como los materiales empleados en la reforma son de primera calidad.<br>La zona donde se ubica es familiar y tranquila, además de tener muy buena conexión con los transportes metropolitanos, y una amplia oferta de restauración, jardines y parques.<br>Sant Gervasi-Galvany es un barrio del distrito de Sarriá-Sant Gervasi de la ciudad de Barcelona. El nombre del barrio hace referencia a San Gervasio, puesto que era la parte baja de éste municipio al que perteneció hasta la anexión a Barcelona, y al Camp d''en Galvany, la urbanización de la cual empezó en 1866 su propietario, Josep Castelló y Galvany, que con su otro apellido dio nombre también a la Plaza de Castelló. El nombre de Galvany se popularizó cuando los adoptó el Mercado de Galvany. <br>Galvany es uno de los barrios más codiciados de la ciudad. Su comunicación con el transporte público (bus, metro y FGC) es excelente. Destaca por su mercado municipal de prestigio, gran diversidad de comercios y servicios, supermercados y restaurantes para todos los gustos.',4,3,'41.4038703,2.1378445',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>129 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Construido en 1951</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="g" class="icon-energy-c-8"></span> (237 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta con ascensor',NULL,NULL),
 (84,2,NULL,69,161,690000,'El Fort Pic','08029','venta','ático','Ático en venta en El Fort Pienc','Amplio ático a reformar en Fort Pienc<br>Nos encontramos con una fantástica propiedad ubicada en una finca del año 1947. Accedemos a la propiedad con una elegante portería que nos lleva directos al ascensor. <br>Una vez en la planta nos encontramos con un recibidor que nos ubica a la parte central del piso. A mano izquierda nos dirigimos a la zona de día. Nos encontramos con la cocina, desde donde tenemos acceso a una galería que nos da en los patios interiores del edificio. Si seguimos adelante nos encontramos en una pequeña sala, un lugar acogedor donde poder leer o tomar una taza de café. Más adelante nos encontramos con el salón, espacio agradable con una salida al balcón. Dentro de este espacio encontramos otro ambiente con un agradable hogar. Desde aquí podemos encontrar una pequeña sala, que anteriormente era la terraza de la propiedad, así pues le podrían recuperar el uso. <br>Desde esta parte de la propiedad podemos disfrutar de las magníficas vistas de la ciudad a la majestuosa Sagrada Família, la sierra de Collserola, la montaña de Montjuic, y hasta todo el mar. <br>Si nos dirigimos a la zona por la noche encontraremos 4 habitaciones y dos baños completos. Los aposentos, que son 4, dos de ellas son dobles y dos individuales. Todas tienen ventanas, incluso la principal dispone de una galería con unas vistas en la ciudad. <br>Dicha propiedad nos da grandes posibilidades de reforma puesto que tenemos dos patios interiores que nos ayudarán a poder jugar con la nueva distribución puesto que tienen los bajantes. Los áticos de la propiedad son dos en toda la planta. <br>A la parte de arriba tenemos una azotea comunitaria donde disponemos de un trastero.<br>Inmejorable ubicación en la calle Marina al lado de la Diagonal y de la famosa Plaça Monumental, cerca de la Sagrada Família en una zona dinámica y comercial muy bien comunicada con diversas paradas de bus y metro cercanas. Excelente tanto para vivir como para invertir.',5,2,'41.4018979,2.1788341',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>161 m² construidos</li> <li>5 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Construido en 1947</li> <li>No dispone de calefacción</li> <li>Certificación energética: <span title="f" class="icon-energy-c-7"></span> (237 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 7ª </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'7ª planta con ascensor',NULL,NULL),
 (85,2,NULL,71,256,1295000,'Sant Gervasi - La Bonanova','08041','venta','piso','Piso en venta en Sant Gervasi - La Bonanova','Fantástico piso dúplex con piscina en Av. Tibidabo<br>Fantástico piso dúplex amplio, esquinero, muy luminoso y con vistas. Por su cómoda distribución es ideal para familias. Se trata de un piso seminuevo en excelente estado de conservación, en una finca con zona ajardinada y piscina, que cuenta con servicio de conserjería y vigilancia 24h.<br>La vivienda cuenta con una superficie construida de 218m2 más dos terrazas de 36m2 y 40m2, una en cada planta.<br>En la planta superior encontramos un gran salón comedor muy luminoso con acceso a terraza disfrutable con vistas panorámicas sobre Barcelona, la cocina con office completamente equipada, una coqueta despensa y un aseo de cortesía.<br>En la planta inferior están ubicados los cuatro dormitorios dobles, uno de ellos con un amplio baño en suite y acceso a la soleada terraza inferior, un baño completo y lavadero. Las dos plantas tienen puerta de acceso directo. La puerta de la planta inferior conecta directamente con la zona de garaje lo cual hace muy cómoda la carga y descarga de equipajes.<br>La propiedad incluye una gran plaza de aparcamiento (y otra plaza opcional) y un cuarto trastero.<br>En la zona alta de Sant Gervasi esta propiedad está situado junto a la Avenida Tibidabo, una de las zonas más emblemáticas y elegantes de Barcelona. La ubicación permite rápido acceso tanto a la Ronda de Dalt como a los barrios de Sant Gervasi y la Bonanova. Por otro lado, el cercano Parque Natural de Collserola, que es fácilmente accesible tanto a pie como en bicicleta.',4,3,'41.4158985,2.1311214',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>256 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Construido en 2007</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (88 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo con ascensor','Garaje incluido',NULL),
 (86,2,NULL,69,118,510000,'Sant Antoni','08009','venta','piso','Piso en venta en Sant Antoni','Piso exterior con balcón en Sant Antoni<br>En Sant Antoni, encontramos esta propiedad completamente exterior, reformada y esquinera de 105m2 útiles con un balcón. Este piso disfruta de muchísima luz natural y está situado en una planta muy alta del edificio. Al entrar en el recibidor a mano izquierda, nos encontramos con la zona de día compuesta por una gran cocina totalmente equipada y moderna. También nos encontramos un salón amplio en frente con un balcón. Entrando a mano derecha nos encontramos con la zona de noche con una distribución extremadamente funcional; con tres habitaciones dobles, un baño completo y un aseo de cortesía. Cuenta con un total de 7 ventanales grandes este piso disfruta de mucha luz y en cada estancia disponemos de espacios amplios y con una reforma moderna. Dispone de aire acondicionado con bomba de calor, calefacción por radiadores y radiante. Parking opcional no incluido en el precio y no en misma finca.<br>Una propiedad perfecta para los que buscan pisos amplios y con mucha luz.<br>Situada en l’Avinguda del Paral·lel, esta propiedad está situada a cuatro cuadras del mercado del Sant Antoni y cuenta con 3 paradas de metro a 3 minutos andando: Paral·lel (L2, L3) Poble Sec (L2), Sant Antoni (L2 ) y una a 8 minutos: Rocafort (L1). Y a 7 minutos andando de la parada del Aerobús que lleva al aeropuerto en tal solo 15 minutos. Esta zona dispone de una amplia oferta de restaurantes gastronómicos, zonas de ocio y de interés turístico.',3,2,'41.3747547,2.1618591',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>118 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Construido en 1965</li> <li>No dispone de calefacción</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (94 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 6ª </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'6ª planta con ascensor',NULL,NULL),
 (87,2,NULL,71,184,830000,'Sant Gervasi - La Bonanova','08002','venta','ático','Ático en venta en Sant Gervasi - La Bonanova','Ático dúplex con tres terrazas en Bonanova<br>Ático dúplex con 3 terrazas grandes y un balcón con una superficie total construida de 185 m2.<br>Se compone de cinco habitaciones dobles y dos baños. Encontramos 3 habitaciones en la planta ático y 2 en la última planta. Esta propiedad es luminosa y todas las habitaciones excepto una son exteriores. El salón comedor tiene orientación suroeste y da a una de las terrazas. Las otras 2 terrazas están en la planta superior con doble orientación.<br>Dispone de parquet, aire acondicionado y calefacción en toda la vivienda así como carpintería exterior de aluminio.<br>Piso con ascensor. La finca no tiene parking aunque hay disponibilidad en la zona.<br>El barrio donde se ubica te cautiva por su elegancia y buena comunicación. Situado en una prestigiosa zona residencial. En Sant Gervasi, Balmes y la Bonanova, donde se encuentra la Biblioteca de Sant Gervasi de Cassoles, cerca de los Jardines de la Tamarita y el Parque del Putxet. Perfectamente comunicado mediante el autobús y FGC en Avenida Tibidabo y El Putxet. Encontramos en la zona variedad de negocios, tiendas, los cines Balmes, supermercados, mercado municipal, Tenis Barcino y el Hospital Quirón. Acceso rápido a la Ronda de Dalt y a los colegios internacionales.',5,2,'41.4055359,2.1364713',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>184 m² construidos</li> <li>5 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1961</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (202,84 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'con ascensor',NULL,NULL),
 (88,2,NULL,71,130,1290000,'Sant Gervasi - La Bonanova','08030','venta','piso','Piso en venta en Sant Gervasi - La Bonanova','Fantástico piso en Torre Vilana<br>En la falda del Parque Natural de Collserola, divisando toda la panorámica de Barcelona, rodeado de naturaleza y disfrutando de la más absoluta tranquilidad, situamos este fantástico piso el cual se encuentra a pocos minutos de las mejores escuelas y clubes deportivos de la zona alta de la ciudad. La propiedad se emplaza en la privilegiada urbanización de Torre Vilana, con una espectacular zona verde comunitaria abierta a la montaña, con sus piscinas y zona deportiva. <br>Se trata de una vivienda alegre y muy luminosa a todas horas del día, gracias a su doble orientación, de superficie aproximada de 115m2 construidos más dos terrazas. Tiene un espacioso salón comedor con acceso a terraza de aproximadamente 15m2 junto a la cocina office totalmente equipada, ambas estancias con la inmejorable orientación suroeste. La zona de noche se compone de tres dormitorios exteriores con acceso asimismo a una terraza de aproximadamente 15m2. Uno de ellos en suite con armarios empotrados, y los otros dos dormitorios que comparten otro baño completo. Dispone asimismo de un cuarto lavadero independiente. Suelos de parquet, calefacción individual y aire acondicionado por conductos. La propiedad incluye un gran trastero de unos 30m2 con aseo (con posibilidad de uso como despacho, sala polivalente) y de tres plazas de parking en box cerrado en la propia finca. Este fantástico recinto dispone de servicio de conserjería y vigilancia 24 horas.<br>Torre Vilana es una de las mejores urbanizaciones jamás construidas en Barcelona. Un entorno privilegiado, con una zona ajardinada de 17.438m2, una zona deportiva equipada con pistas de pádel, fútbol y baloncesto, piscinas para adultos y niños, y parque infantil. El resort dispone del más alto nivel de seguridad, con presencia de cámaras de vigilancia, personal de vigilancia las 24h del día todo el año, videoportero y alarmas.',3,2,'41.4093987,2.1278007',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>130 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Construido en 2007</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (77 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta con ascensor','Garaje incluido',NULL),
 (89,2,NULL,65,202,750000,'Vila de Gràcia','08028','venta','piso','Piso en venta en Vila de Gràcia','Precioso loft cerca de Passeig de Gràcia<br>En una bonita finca regia rehabilitada se encuentra esta extraordinaria propiedad 202m2 en una planta baja. Desde el primer momento uno se queda impresionado por los amplios espacios, los techos altos, elementos originales como el ladrillo de la pared y la volta catalana, el gran diseño y las calidades de la vivienda. Al cruzar la puerta de entrada, se encuentra en una amplia estancia a la que pueda asignar el uso que desea, sea recibidor, parking, taller, despacho, etc. <br>Abriendo la bonita puerta corredera pasara al amplio comedor con cocina abierta al estilo americano, equipada con los mejores electrodomésticos como una campana industrial, horno, microondas y estufa de las reconocidas marcas Bosch y Smeg. A continuación, encontramos un espacio abierto con armarios integrados. En esa zona, se instalaron la zona de aguas y dos baños completos de diseño. Subiendo los tres escalones con luces leds integrados, llegamos a un espacio fabuloso con el dormitorio principal y la amplia y luminosa zona de día que da un patio de unos 8m2 donde puede crear un pequeño oasis verde con plantas, ya que recibe mucha luz. A parte del gran diseño ofrece también acabados de gran calidad como el parque de roble y el A/C y la calefacción por conductos de estilo industrial y una gran puerta automática que puede dar acceso a vehículos. Es una propiedad maravillosa que se puede adaptar a sus necesidades, sea mantenerlo tal cual y disfrutar de los amplios espacios, combinar su vida privada con la laboral o llevar una vida familiar, ya que existe la posibilidad de crear fácilmente tres dormitorios. No dude en contactar con nosotros, el equipo de E&amp;V estará encantado en presentarle este único inmueble.<br>El piso se sitúa en una de las mejores zonas de la Vila de Gràcia, cerca de Vía Augusta, la Av. Diagonal, a pocos minutos de Passeig de Gràcia y junto a Plaza Narcís Oller, Riera Sant Miquel y Gala Placídia. La zona tiene todo tipo de servicios desde restaurantes con ofertas gastronómicas de todos los rincones del mundo, a supermercados, el mercado de la libertad, centros deportivos, entidades bancarias, tiendas de ropa de diseñadores nombrados, galerías de arte e instituciones educativas y deportivas a pocos pasos. Con inmediata conexión con las arterias viales de la ciudad, Metro, Bus y Ferrocarriles.',1,2,'41.4005828,2.1558008',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>202 m² construidos</li> <li>1 habitación</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1936</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (134 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo sin ascensor','Garaje incluido',NULL),
