 (91,2,NULL,91,128,1500,'Avenida de Xile','08021','alquiler','piso','Alquiler de Piso en avenida de Xile','Doma Real Estate presenta este fantástico piso con piscina comunitaria. <br> <br>Entrando en la vivienda nos da la bienvenida un bonito recibidor que tiene acceso tanto al salón/comedor como a la habitación, actualmente utilizada como despacho. El salón tiene unas fantásticas vistas despejadas que dan al Real Club de Polo de Barcelona y a la preciosa zona comunitaria con 2 piscinas y grandes zonas ajardinadas. Desde el mismo salón accedemos al pasillo que sirve de distribuidor de la zona de noche. El piso dispone de 2 baños completamente reformados, ambos con ducha. Este pasillo también da acceso a la cocina y a las 3 habitaciones, 2 dobles y 1 individual. &nbsp; Destacar la fantástica zona comunitaria ya que no solamente dispone de las piscinas mencionadas, también tiene 2 parques infantiles, otra zona de recreo (patinaje, para bicicletas, etc... ). Finca con conserje mañana y tarde y retirada de basuras, plaza de aparcamiento doble no incluida en el precio, vigilancia nocturna de Parking (12 horas-365 días al año). Sin duda una espectacular vivienda en una de las zonas más privilegiadas de Barcelona. No dude en ponerse en contacto con nosotros para concertar una visita.<br>A nivel confort, la vivienda se entrega con los dormitorios completamente amueblados y la cocina equipada, aire acondicionado y calefacción por conductos.',4,2,'41.3806489,2.1123505',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>128 m² construidos, 113 m² útiles</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación norte, oeste</li> <li>Construido en 1973</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual</li> <li>Certificación energética: en trámite</li> <li>Acceso adaptado a personas con movilidad reducida</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'5ª planta exterior con ascensor','Garaje incluido',NULL),
