 (93,2,NULL,91,186,1900,'Calle d''Aribau','08034','alquiler','piso','Alquiler de Piso en calle d''Aribau','DOMA REAL ESTATE presenta en exclusiva este fantástico piso reformado en ubicación premium.<br>Entramos en la vivienda y nos da la bienvenida un cómodo recibidor dado su tamaño y numerosos armarios, la vivienda divide perfectamente la zona de noche con la de día. Accedemos al gran salón/comedor de grandes dimensiones con vistas despejadas ya que es una calle amplia, desde ahí podemos acceder a la cocina que tiene acceso a un gran lavadero y a un patio. Esta zona dispone de una habitación de servicio con su respectivo baño completo, el cual nos puede dar utilidad como aseo de cortesía para las visitas. Esta zona tiene entrada de servicio con montacargas.<br>En la zona de noche tenemos 4 amplias habitaciones dobles y dos baños, dos de las habitaciones son exteriores y dan a un agradable parque y una de ellas tiene una pequeña terraza disfrutable. Dos de las habitaciones tienen armarios empotrados y en el pasillo dispone de un segundo patio que puede servir como trastero, para guardar bicicletas, etc.<br>La entrada en la finca es muy señorial, con varios accesos (uno de ellos al agradable parque) y dispone de una zona para poder cargar y descargar equipaje, 2 ascensores, un montacargas y servicio de conserjería.<br>Plaza de aparcamiento incluida en el precio en finca cercana.<br>No pierda la oportunidad de visitar esta espectacular vivienda.',5,3,'41.4008659,2.1466917',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>186 m² construidos, 156 m² útiles</li> <li>5 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur, este</li> <li>Construido en 1966</li> <li>Cocina equipada y casa sin amueblar</li> <li>Calefacción individual</li> <li>Certificación energética