 (98,2,NULL,98,162,1338,'Calle de Muntaner','08028','alquiler','piso','Alquiler de Piso en calle de Muntaner','"Yo viviría en este piso. "<br> Eso es lo primero que he pensado al visitarlo. Cuesta encontrar un piso tan amplio en viviendas de esta superficie, está muy bien distribuido en todas sus estancias, y eso optimiza nuestra captación de luz y de amplitud. Si además tenemos en cuenta el buen estado en el que está y que el piso respira a un amplio y tranquilo patio de manzana, la sensación de bienestar que te aporta este hogar te hace estar seguro de que es un buen comienzo.<br> <br> Además si analizamos lo que nos ofrece, nos encontramos con: ubicación ideal ( muntaner entre c/ Platón y c/Descartes), con PLAZA DE PARKING OPCIONAL en la misma finca por 130 €/mes.<br> Especialmente tranquilo al dar a un amplio patio de manzana.<br> Dispone de 4 habitaciones ( 3 de ellas exteriores y una interior ), 3 de ellas son dobles (una es en suite), 2 baños ( uno con bañera y otro con ducha), cocina amplia en buen estado con lavadero y amplio salón que además culmina en un agradable balcón-terraza, ideal para comidas y cenas al aire libre.<br> Buenos acabados en todo el piso además de calefacción, aire acondicionado y suelos de parquet. <br> <br> Si el sol y la luz te interesan este piso no te decepcionará, ya que es una tercera planta orientada a este, que proporciona sol durante toda la mañana.<br> <br> Si estás buscando un buen piso en una buena zona que tenga luz sea tranquilo y espacios coherentes contacta con nosotros, este es tu piso.<br> <br> * Las condiciones mínimas para este arrendamiento es de 2 meses de fianza + 10% la anualidad + IVA de honorarios de intermediación. <br> * El Precio Medio para esta vivienda según el Index de Referencia de la Agència del Habitatge es de 15,08 €/m2. Además del alquiler habrá que pagar 132 € mensuales de Gastos comunitarios e IBI.',5,2,'41.3991345,2.1430922',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>104 m² construidos, 89 m² útiles</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Orientación este</li> <li>Construido en 1985</li> <li>Cocina equipada y casa sin amueblar</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (142 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
