 (100,2,NULL,100,98,1500,'L''Antiga Esquerra de l''Eixample','08027','alquiler','piso','Alquiler de Piso en L''Antiga Esquerra de l''Eixample','REF. MCB2691ML<br> <br> Piso totalmente nuevo a estrenar en zona inmejorable de l''Antiga Esquerra del Eixample entre París y Córcega con parking público debajo y espectacular terraza.<br> <br> DISTRIBUCIÓN: (95m2, exterior)<br> <br> - Gran salon comedor.<br> - Terraza<br> - Cocina independiente totalmente nueva con placa de inducción y horno con raíles telescópicos, microondas y campana extractora. <br> - Galería<br> - 3 habitaciones (una de ella tipo suitte)<br> - 2 baños con mamparas de cristal<br> <br> CALIDADES:<br> - Finca con 2 ascensores<br> - Carpintería exterior de aluminio con vidrios de cámara climalit<br> - Carpinteria interior de gran calidad<br> - Suelo de kronosuisse de 12 mm de grueso tipo AC-5 de máxima dureza en madera clara.<br> - Puerta corredera en el salón<br> - Persianas con motor eléctrico<br> - Calefacción a gas natural<br> - Instalación de aire acondicionado. <br> - El granito para la encimera que bordea toda la cocina es de 2 cm de grueso tipo warvick. <br> - Incluye la instalación para fregaplatos de 60 cm muebles blanco brillante. <br> - Instalación de luces de leds en estancias <br> - Todo pintado en blanco.<br> <br> ZONA Y TRANSPORTE PÚBLICO:<br> Este espectacular inmueble se encuentra situado en l''Antiga Esquerra de L''Eixample. Por su centralidad el barrio asume grandes equipamientos de ciudad como el Hospital Clínico, el Cuartel de Bomberos y la Universidad de Barcelona. Otro punto de atracción es el Mercado del Ninot, en fase de remodelación, y la calle Enrique Granados llena de establecimientos de restauración.<br> <br> El inmueble se encuentra muy bien comunicado a través de las líneas L5 y L1 de metro y líneas V11 y 59 de autobuses.<br> <br> Índex R. P. LL. Àrea inferior 9.86€/m2 – Índex 11.67€/m2 - Àrea superior 15.91€/m2<br> <br> El precio anunciado incluye: renta alquiler según l''índex de referència de preus de lloguer + otros gastos asociados al inmueble.',3,2,'41.3892813,2.1496406',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>98 m² construidos, 95 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Cocina equipada y casa sin amueblar</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (120 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'5ª planta exterior con ascensor',NULL,NULL),
