 (131,3,NULL,123,73,1200,'El Mercat','46018','alquiler','piso','Alquiler de Piso en El Mercat','Ático para corta estancia en El Carmen<br>Corte estancia. Magnífico ático loft con encanto en el barrio medieval de "Ciutat Vella". Mantiene todos los detalles típicos de los edificios con historia del barrio del Carmen. El loft está compuesto por un salón luminoso con un baño completo y con cocina abierta, totalmente equipada. En la planta superior se ubica la habitación principal con un baño completo. También, este ático tiene una terraza donde disfrutar de las vistas de la ciudad. Esta vivienda con encanto dispone de todas las características que hacen de ella una joya en el centro de la ciudad para disfrutar de la vida del Carmen.<br>El Carmen se encuentra oficialmente en el noreste de la ciudad vieja, detrás de Plaza de la Virgen y cerca de Torres de Serranos y Torres de Quart. Esta parte de la antigua ciudad medieval es famosa por la gran cantidad de cafés, bares y restaurantes. Hay muchos puntos de interés de esta zona del casco antiguo y también muy cerca de los hermosos Jardines del antiguo cauce del río Turia. Dominada por la iglesia medieval del Carmen y lleno de fuentes y naranjos, este es un lugar idílico para dedicar tiempo a explorar los lugares históricos y artísticos de interés. La zona es de fácil acceso desde la Calle Serranos y por el otro lado a través de los Jardines del Turia.',4,2,'39.4767932,-0.3820778',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>74 m² construidos</li> <li>1 habitación</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Amueblado y cocina equipada</li> <li>No dispone de calefacción</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 4ª </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
