 (146,3,NULL,123,132,1400,'La Seu','46010','alquiler','piso','Alquiler de Piso en La Seu','Singular ático dúplex ideal junto Plaza Reina<br>Este luminoso apartamento junto a Plaza de la Reina reúne todo lo necesario para para establecerse cómodamente en una vivienda con un mix ideal de zona, características y precio de alquiler. Tras acceder al bonito edificio de la Ciutat Vella, subimos a nuestra planta en ascensor y accedemos a la vivienda cuyo recibidor distribuye lan zona de día a un lado y la zona de noche al otro. La zona de día está integrada por un salón y un comedor y una cocina perfectamente equipados. La zona de noche cuenta con dos dormitorios uno más pequeño con cama nido y otro más grande con cama doble. También hay dos cuartos de baño con ducha. A la siguiente planta se sube también en ascensor accediendo por una magnífica terraza de uso comunitario donde está el estudio o cuarto de estar con aseo de uso exclusivo del arrendatario de este apartamento. Si le gusta esta propiedad no dude en consultarnos, estaremos encantados de atenderle.<br>Este luminoso apartamento junto a Plaza de la Reina está situado en un edificio reformado integralmente en el barrio de El Mercat de Ciutat Vella el distrito número 1 de la ciudad de Valencia (España) junto al Miguelet y la Plaza de la Reina. El distrito limita al norte con La Zaidía, al este con El Pla del Real, al sudeste con Eixample y al sudoeste con Extramurs. Está compuesto por seis barrios: La Seu, La Xerea, El Carmen, El Pilar (antiguamente Velluters), El Mercat y Sant Francesc. Está delimitado por la muralla del siglo XIV, esto es, las calles de Colón, Játiva y Guillem de Castro, la margen derecha del río Turia desde esta calle hasta la calle de la Justicia, la Puerta del Mar y de nuevo, Colón. El barrio de El Mercat además de su alto interés histórico y cultural cuenta con todos los servicios públicos y privados para disfrutar de una agradable vida urbana; comercios, centros de salud, centros educativos, servicios profesionales y administraciones públicas. La conexión por transporte público o privado con el resto de la ciudad, las playas y el aeropuerto es muy eficiente. No dude en visitarlo. Estaremos encantados de atenderle.',4,2,'39.4768379,-0.3777809',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>89 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Construido en 1927</li> <li>Amueblado y cocina equipada</li> <li>No dispone de calefacción</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 4ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
