 (151,3,NULL,151,100,279995,'Plaza de Joan de Vila-rasa','46007','venta','piso','Piso en venta en plaza de Joan de Vila-rasa','Magnífica vivienda con elegante reforma y muchísimo encanto, junto al Mercado Central y proxima a la Plaza del Ayuntamiento, en pleno barrio del Mercat.<br><br>Se trata de una vivienda con vistas a la plaza Juan de Villarrasa, la cual es un pequeño oasis dentro del barrio del Mercat, debido a su jardín central con abundante vegetación.<br><br>Al estar envuelta de edificios de poca altura, esta vivienda en 3ª planta tiene mucha luz natural. <br><br>La vivienda esta distribuida en:<br><br>- Elegante recibidor<br>- Comedor/Salon con acceso a balcon orientado a la Plaza<br>- 3 habitaciones:<br>· 2 habitaciones dobles. Espectacular suite con vestidor y baño completo<br>- 1 baño adicional<br>- Cocina independiente, completamente<br>equipada<br><br>Calidades:<br><br>- Reforma integral en buen estado.<br>- Parquet de madera noble en toda la casa, excepto en zonas humedas (baños, cocina)<br>- Carpinteria exterior de PVC de alta calidad y cristales climalit<br>- Sistema de aire acondicionado <br>- Vestidor<br>- Ascensor<br><br>El Mercat<br>Este barrio perteneciente al distrito de Ciutat Vella, cuenta con el espectacular edificio modernista del Mercado Central, con puestos de comida y productos alimentarios, de toda clase, incluyendo productos gourmet. <br><br>En la parte norte del Mercado Central nos encontramos la Lonja de la Seda, de estilo gótico tardío y en su fachada oeste nos encontramos la impresionante Iglesia de los Santos Juanes.<br><br>Sin duda es uno de los barrios mas concurridos de la ciudad, por su gran oferta gastronómica, incluyendo las mejores barras de Valencia donde degustar desde unas maravillosas tapas, hasta los restaurantes mas chic de la ciudad.<br><br>También ofrece una gran oferta de ocio nocturno como bares y discotecas.<br><br>En este barrio también tiene cabida la oferta académica, encontrándose en el la Universidad Católica.<br>Además, su cercanía con el centro de la ciudad hace que se pueda disfrutar de todo tipo de oferta cultural como teatros y salas de cine.<br><br>Servicio integral de inmobiliaria especializada en medio y alto standing en Valencia<br>Somos expertos en tú hogar en Valencia<br>Encuentra más en.',2,2,'39.4755357,-0.3804233',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>100 m² construidos, 88 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Calefacción individual: Bomba de frío/calor</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (120 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor',NULL,NULL),
