 (154,3,NULL,150,300,890000,'Plaza de Cánovas del Castillo','46019','venta','piso','Piso en venta en plaza de Cánovas del Castillo','Espectacular y luminosa propiedad totalmente reformada con acabados de alta calidad y diseño. <br>Ubicada en pleno corazón del emblemático barrio del L''Eixample de Valencia, nos proporciona una situación privilegiada en una zona que cuenta con todos los servicios necesarios para el día a día.<br><br>Se encuentra a cinco minutos andando del centro de valencia, el cause del rio turia o diferentes puntos de interés turísticos y culturales, teniendo también a su alcance cafeterías, restaurantes, colegios, bancos, supermercados y todo lo que puedas necesitar.<br><br>La vivienda dispone de 300 metros cuadrados distribuidos en seis Habitaciones dobles y tres cuartos de baño, su dormitorio principal cuenta con su propio cuarto de baño completo y un vestidor, mención especial a su salón comedor de 50 metros cuadrados presidido por sus 12 ventanales dobles que le proporcionan a la estancia toda la luz natural necesaria. <br><br>Este piso cuenta con suelos de parque, calefacción de caldera individual, aire por conductos frió-calor, chimenea, cocina abierta al salón con su isla central y con todos sus electrodomésticos integrados. <br><br>Dos de sus habitaciones recaen a fachada y una tercera a patio de manzanas por lo que también disponen de luz natural propia. <br><br>Finca señorial con dos ascensores construida en 1932. <br><br>Para mas información y VISITA INMEDIATA contacte con nosotros.',6,3,'39.46977,-0.3635',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>300 m² construidos, 277 m² útiles</li> <li>6 habitaciones</li> <li>3 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Construido en 1932</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="g" class="icon-