 (157,3,NULL,157,200,675000,'Paseo alameda','46005','venta','dúplex','Dúplex en venta en paseo alameda','Monserrate Inmobiliaria les ofrece este magnífico ático dúplex en Paseo Alameda. Una gran oportunidad de inversión por sus magníficas vistas al Oceanográfico y a la Ciudad de las Ciencias y por la presente y futura consolidación de la prolongación de "Camins al Grau" hacia el mar. Su privilegiada terraza de 30m2 la convierten en una de las viviendas más exclusivas de esta zona de la ciudad.<br><br>La vivienda se distribuye en 2 plantas, con acceso independiente a cada una de ellas desde los zaguanes de las plantas 10º y 11º. El edificio tiene solamente dos viviendas por planta. La vivienda, se ofrece con una plaza de parking y un trastero.<br><br>La planta superior, donde se encuentra la zona de día, tiene un salón de 40 metros con chimenea y salida a una amplia terraza, una cocina independiente con cuarto-lavadero y un aseo de cortesía. La planta inferior, es la de las habitaciones, 4. Todas ellas con amplios ventanales con vistas al río. La principal con gran cantidad de armarios y baño en suite con bañera y ducha. Además, un segundo baño para el resto de dormitorios. <br><br>De entre las calidades destacamos: suelos de parquet, armarios empotrados en todas las habitaciones, aire acondicionado frío-calor por conductos, calefacción por radiadores en ambas plantas, chimenea de diseño, carpintería exterior de aluminio climalit, persianas eléctricas, etc.<br><br>La ubicación de esta propiedad le permite unos rápidos accesos al las principales Autovías. Además se encuentra en plena zona comercial con "Aqua" y el "Corte Inglés" a pocos pasos y el centro comercial "El Saler" con hipermercado a muy poca distancia. Los jardines del antiguo cauce del río le quedan en la puerta de su casa, y nuevas instalaciones deportivas y educativas están abriendo sus puertas, como el polideportivo "Juan Antonio Samaranch".<br><br>Si desea saber más, llámenos, y será un placer atenderle.',4,3,'39.455684,-0.3416083',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>200 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación norte, sur</li> <li>Construido en 2001</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 11ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'11ª planta exterior con ascensor','Garaje incluido',NULL),
