 (161,3,NULL,161,170,485000,'Paseo de les Facultats','46006','venta','piso','Piso en venta en paseo de les Facultats','Junto a las universidades encontramos este fantástico ático esquinero de 170 metros construidos y 60 metros de terraza rodeando toda la vivienda. Perfectamente distribuido con un espacioso y soleado salón-comedor en dos ambientes, provisto de amplios ventanales que dan acceso a la terraza, gran cocina con office de 28 metros, completamente equipada, integrada en el salón con una barra americana y con acceso a la terraza, tres dormitorios equipados con prácticos armarios empotrados y dos baños completos con bañera (el principal in suite). Además incluidos en el precio de venta, cuenta con una amplia plaza de garaje y un trastero.<br> <br> Destacar de la vivienda la amplitud de sus estancias, su fantástica orientación sureste, que la dota de gran luminosidad, su increible terraza con despejadas vistas, así como su perfecto estado de conservación siguiendo un estilo rústico, con suelos de barro cocido, paredes de ladrillo visto, cocina con mobiliario de roble, carpintería exterior de aluminio con doble acristalamiento, proporcionándole aislamiento térmico-acústico, calefacción de gas natural y un gran split de aire acondicionado en el techo del salón dotado de bomba de calor.<br> <br> Situado junto a las universidades, en un paseo peatonal con abundantes zonas verdes, donde reina la tranquilidad. Rodeado de todo tipo de servicios y comercios, a diez minutos andando de la playa y muy próximo a paradas de metro y tranvía.',4,2,'39.4768341,-0.3494571',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>170 m² construidos, 151 m² útiles</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur, este</li> <li>Const