 (164,3,NULL,123,134,335000,'Camino Vell d''Alboraia','46009','venta','piso','Piso en venta en camino Vell d''Alboraia','Luminosa y amplia vivienda en residencial<br>Esta luminosa vivienda está ubicada en un residencial con piscina del año 2004, en una tranquila calle paralela a la Avenida de Alfahuir. Todas las estancias son exteriores, amplias y luminosas. <br><br>Desde el recibidor, donde encontramos un práctico armario, accedemos a la cocina independiente con bonitas vistas al residencial. Tiene espacio para una mesa para desayunos o comidas informales y galería con zona de lavado y de almacenaje extra. Los electrodomésticos han sido recientemente renovados, así como la caldera. A continuación está el luminoso salón comedor con salida a la terraza y la primera de las cuatro habitaciones dobles, que también tiene acceso a la terraza y en este momento se utiliza como despacho. A partir de aquí comienza la zona de noche, con el amplio dormitorio principal, con un gran armario empotrado y baño en suite con bañera. Dos dormitorios dobles más con armarios empotrados y un cuarto de baño completo con bañera completan el conjunto. La vivienda tiene buenas calidades, pavimento de mármol marfil, paredes lisas, ventanas con Climalit, aire acondicionado por conductos y calefacción por gas natural. Una plaza de garaje grande para un coche y dos motos, y un trastero están incluidos en el precio. Una vivienda ideal para una agradable vida familiar, póngase en contacto con nosotros para más información, estaremos encantados de atenderle.<br>La zona de Alfahuir está consolidada con amplia oferta de centros educativos, deportivos y sanitarios tanto públicos como privados, así como supermercados y comercio local. El centro comercial Arena está a pocos minutos a pie y cuenta con las tiendas de marcas más conocidas así como con restaurantes. Es un barrio perfectamente comunicado por transporte público y tiene acceso rápido en coche al bulevar periférico norte. La conexión con el aeropuerto es fácil tanto en coche como en metro. La línea 6 del tranvía tiene parada a escasos metros y llega hasta la playa en sólo 20 minutos y a la Universidad en 14. En resumen, es una de las mejores zonas de Valencia para una vida tranquila y agradable.',4,2,'39.4889237,-0.3664916',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>134 m² construidos</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Construido en 2004</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: no indicado</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta con ascensor','Garaje incluido',NULL),
 (165,3,NULL,165,85,259500,'Calle del Poeta Liern','46019','venta','ático','Ático en venta en calle del Poeta Liern','OC HABITAT con la garantía de Olivares Consultores tiene a la venta este exclusivo atico ubicado en el céntrico histórico de Valencia, en el barrio de La Xerea, Plaza Tetuán y junto a los fabulosos Jardines del Turia. Considerado un barrio privilegiado donde se encuentran las lujosas tiendas de la calle Poeta Querol y los majestuosos edificios modernistas de la calle de la Paz. Su excelente oferta gastronómica, la disponibilidad de todos los servicios, así como las mejores opciones de transporte y comunicación, convierten el barrio en uno de los más exclusivos de la ciudad.<br><br>La vivienda, actualmente se distribuye, en salón comedor con cocina office totalmente equipada, dos habitaciones, baño completo y terraza privada con una superficie aproximada de 15m2 y trastero. <br>Existe la posibilidad de anexsionar una planta superior con una superficie aproximada de 50m2 pendientes de acondicionar, pudiendo ampliar la vivienda con una tercera habitación suite con cuarto de baño u otras dos habitaciones.<br><br>Se trata de un inmueble exterior muy luminoso, con orientación sureste, suelo de parque, calefacción por radiadores eléctricos, aire acondicionado y ventanas con sistema climalit. <br>El edificio de estilo clásico, cuenta con ascensor y se encuentra ubicado en zona céntrica, pero con mucha tranquilidad.<br><br>Para más información y VISITA INMEDIATA contacte con nosotros.',2,1,'39.4762391,-0.3720896',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>85 m² construidos</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur, este</li> <li>Construido en 1900</li> <li>Calefacción individual: Eléctrica</li> <li>Certificación energétic