de valor añadido del Personal Seller Inmobiliario. Con más de 20 años de experiencia y una metodología que integra la consultoría tradicional y las herramientas digitales más avanzadas, CALLAGHAN inmobiliaria le asegura la venta de su casa en el menor tiempo posible y al mejor precio. Contáctenos, le visitaremos en menos de 24 horas y tasaremos su casa de forma gratuita. Integrada en el HUB de Inversión Inmobiliaria de Valencia, el equipo de CALLAGHAN inmobiliaria cuenta con los expertos inmobiliarios que venderán con éxito su propiedad.<br><br>                 .',3,2,'39.476035,-0.3306343',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>100 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Construido en 2005</li> <li>Calefacción individual: Bomba de frío/calor</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (71 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor','Garaje incluido',NULL),
 (177,14,NULL,177,113,379700,'Avenida Torneo s/n','41010','venta','dúplex','Dúplex en venta en avenida Torneo s/n','Plaza de garaje y trastero opcional<br><br>En ACCIONA estamos prestando una cuidadosa atención a la evolución del brote de coronavirus (COVID-19) en España y hemos tomado todas las medidas de seguridad necesarias para prestarte el mejor servicio.<br><br>Se desarrolla sobre un edificio residencial con carácter histórico situado en un vértice del centro histórico y en un punto emblemático de la transformación que supuso para la ciudad la Exposición Universal de 1992. Su entorno inmediato lo componen la Alameda, espacio rehabilitado para Sevilla en los últimos años, la Basílica y muralla de la Macarena, el antiguo Hospital de las Cinco Llagas actual sede del Parlamento Andaluz y todo el casco antiguo al que desde hace siglos se accede a través de la Puerta de la Barqueta. Al otro lado de la calle Torneo se encuentra el recinto de la Expo transformado hoy en Parque Tecnológico, Campus Universitario y Parque Temático, con elementos singulares como la Torre Sevilla o la nueva Escuela de Ingenieros.<br><br>Además de todo ello la avenida que configura el rio Guadalquivir ofrece una amplísima zona verde de esparcimiento y con instalaciones deportivas de primer nivel.<br><br>Comunicaciones directas hacía la vía de circunvalación SE-30, acceso rápido al Aeropuerto y a la Estación de Santa Justa. Además esta circundada por el carril bici, lo que posibilita un desplazamiento cómodo y sostenible.<br><br>El edificio que respetará la fachada original, dotando así de protagonismo al caserío tradicional del entorno, se organiza en torno a un patio central desde donde se distribuyen los accesos a las viviendas configurando un elemento de contraste con la tradición, desde la nueva concepción de la habitabilidad urbana.<br><br>Puerta Barqueta se compone de 30 exclusivas viviendas, con programas de 1 a 4 dormitorios, con distintas configuraciones, encontrando viviendas desarrolladas en una planta, otras configuradas como dúplex en dos plantas y viviendas muy versátiles en forma de Lofts. <br> <br>El diseño de las viviendas responde a las máximas exigencias de confort y calidad, desde la climatización hasta las cocinas amuebladas y equipadas, pasando por una cuidada elección de acabados.<br><br>Los importes deberán incrementarse con el IVA vigente en cada momento.',2,3,'37.403373,-5.9947928',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>113 m² construidos</li> <li>2 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Promoción de obra nueva</li> <li>Armarios empotrados</li> <li>Certificación energética de proyecto: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Dúplex exterior con ascensor',NULL,NULL),
