vas viviendas, con programas de 1 a 4 dormitorios, con distintas configuraciones, encontrando viviendas desarrolladas en una planta, otras configuradas como dúplex en dos plantas y viviendas muy versátiles en forma de Lofts. <br> <br>El diseño de las viviendas responde a las máximas exigencias de confort y calidad, desde la climatización hasta las cocinas amuebladas y equipadas, pasando por una cuidada elección de acabados.<br><br>Los importes deberán incrementarse con el IVA vigente en cada momento.',1,2,'37.403373,-5.9947928',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>102 m² construidos</li> <li>1 habitación</li> <li>2 baños</li> <li>Promoción de obra nueva</li> <li>Armarios empotrados</li> <li>Certificación energética de proyecto: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Estudio exterior con ascensor',NULL,NULL),
 (179,14,NULL,179,180,495000,'Calle Asunción, 73','41005','venta','piso','Piso en venta en calle Asunción, 73','housin inmobiliaria presenta en exclusiva esta vivienda completamente nueva a estrenar en C/ Asunción 73 junto a la Portada de la Feria. Proyecto de reforma integral con nº de licencia OF2-EXP878/2020, finalizado 16/09/2020.<br> <br> Diseño moderno y funcional, primeras calidades, confort y acabados de primera calidad.<br> <br> LAS IMÁGENES QUE APARECEN EN EL ANUNCIO SON IMÁGENES REALES DEL ESTADO ACTUAL DE LA VIVIENDA. <br> <br> Piso exterior de 180 m2 construidos, (150 m2 útiles) en cuarta planta con terraza frente a edificio Presidente y junto a portada de la Feria. Amplio salón-comedor, 4 dormitorios, 2 baños completos, 1 aseo, cocina completa, terraza y lavadero. Orientación oeste (salón) y este (dormitorios principales).<br> <br> CALIDADES<br> <br> - Carpintería exterior de PVC de máxima eficiencia energética, marca Veka, con doble acristalamiento 4/16/4, oscilobatientes y con persianas de aluminio térmicas.<br> <br> - Carpintería interior compuesta por puertas y frentes de armario de madera maciza lacadas en blanco y ralladas (4 líneas en horizontal). Interior de armarios revestidos con lino habana y herrajes de acero inoxidable.<br> <br> - Suelo laminado de AC5, 8 mm, marca DISFLOOR roble aceitado.<br> <br> - Revestimientos verticales de toda la vivienda (excepto baños y cocina), aplicados mediante capa de mortero y acabado con tres capas de enlucido de perlita.<br> <br> - Baños revestidos de gres porcelánico rectificado de gran formato.<br> <br> - Instalación eléctrica según REBT. Mecanismos color blanco, marca Panasonic.<br> <br> - Instalación de fontanería con tubería multiplaca, grifería de diseño embutida serie italiana Martelli, sanitarios compactos, platos de ducha de diseño, muebles de lavabos suspendidos y sobre encimera de roble tipo bol.<br> <br> - Sistema de climatización por splits en todas las estancias, marca Hisense.<br> <br> - Cocina de lujo con isla, con mobiliario de diseño alemán, laminado alta presión color roble, canteados con cola PUR aportando hidrofugación superior siendo impermeable al agua, canteados con láser, tiradores de perfilería oculta, herrajes bloom con cierre amortiguado. Todos los electrodomésticos son integrados, salvo lavadora y secadora que se encuentran en la zona de lavandero, gama alta y campana de isla embutida en techo marca Faber. Frigorífico y congelador side by side. Encimera de porcelánico con inducción invisible con mando a distancia (Cooking Rak).<br> <br> - Armarios empotrados en todas las habitaciones, lacados en blanco y revestidos en textil en su interior similar a lino habana. Incluye vestidor abierto en el dormitorio principal.<br> <br> EDIFICIO Y ZONAS COMUNES<br> <br> El edificio dispone de ascensor. Rampa de acceso para personas con movilidad reducida. <br> <br> UBICACIÓN<br> <br> En la calle Asunción 73, frente a Edificio Presidente y junto a la Portada de la Feria. Zona de fácil acceso con rápida salida a SE-30 y excelentes comunicaciones: metro, varias líneas de autobuses y a 10 minutos andando del centro. Barrio residencial y comercial con tiendas, supermercados, un gran parque (Parque de los Príncipes). Colegios de gran reputación como Padres Blancos o Santa Ana. Cuenta con tres conocidos clubs sociales: Labradores, Mercantil y Náutico, ideales para la práctica de deportes acuáticos.<br> <br> OTRO CONCEPTO INMOBILIARIO: Viviendas con Estilo<br> <br> Ahora puedes vivir en un piso completamente nuevo en cualquier zona de la ciudad. Transformamos viviendas antiguas en casas modernas, confortables y de diseño. Vive con estilo y olvídate de las complejidades de una reforma. El precio indicado corresponde a la vivienda completamente nueva: Llave en mano. Solo seleccionamos viviendas de alto potencial para ofrecer la mejor calidad de vida de nuestros clientes.',4,3,'37.3722237,-5.9972687',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>180 m² construidos, 150 m² útiles</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación este, oeste</li> <li>Construido en 1962</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="f" class="icon-energy-c-7"></span> (134 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 4ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'4ª planta exterior con ascensor',NULL,NULL),
 (180,14,NULL,180,496,960000,'Calle Montevideo, 34','41009','venta','casa o chalet','Casa o chalet en venta en calle Montevideo, 34','Esta casa bautizada Villa Tenerife fue diseñada por Pedro Fernández de Heredia, uno de los arquitectos precursores del estilo regionalista que más huella dejó en El Porvenir cuando se construyó en el primer tercio del siglo XX. La casa fue construida por Jesús Yanguas Santafé, responsable de algunos de los edificios más emblemáticos del centro de Sevilla.<br> <br> Es una casa que cuenta con 496 m2 construidos sobre una parcela de 142 m2. La casa se distribuye en sótano + 3 plantas adicionales. Tiene una orientación sureste por la parte de atrás y noroeste por la fachada. Con una gran ventilación gracias a sus numerosos ventanales. Cuenta con posibilidad de instalación de ascensor.<br> <br> La planta sótano de la vivienda cuenta con diversas dependencias, actualmente cuenta con barra, gimnasio, bodega, taller y baño.<br> En la planta baja de la vivienda encontramos un bonito recibidor, salón, comedor, cocina totalmente amueblada y equipada, baño y patio ajardinado.<br> En la primera planta tenemos 3 dormitorios y 2 baños.<br> En la segunda planta dispone de una gran sala de cine, amplio dormitorio principal y baño. <br> <br> Cabe destacar los bonitos portones y cerramientos originales de las ventanas así como la calidad de los suelos de mármoly par.<br> <br> La última reforma de la casa fue en el año 2000.<br> <br> La vivienda se encuentra rodeada de vegetación y de arboleda adulta lo que es muy agradable.<br> <br> housin<br> <br> OTRO CONCEPTO INMOBILIARIO: Casas con Estilo<br> <br> Para más información puede contactar con nosotros o consultar en nuestra web También podemos atenderle personalmente en nuestras oficinas sitas en Sevilla, en calle Felipe II, nº7 y Virgen de Luján nº49.',5,2,'37.3738886,-5.9814943',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class