 (181,14,NULL,181,132,575000,'Calle Pagés del Corro','41005','venta','dúplex','Dúplex en venta en calle Pagés del Corro','housin presenta en exclusiva este magnífico ático - dúplex con terraza de 70 m2 en Triana. Orientación este, muy luminoso, con ascensor. 5 habitaciones y 4 baños. Garaje y trastero opcional.<br> <br> La vivienda se distribuye en dos plantas, consta de 132 m2 construidos (nota simple):<br> <br> PLANTA BAJA: Consta de hall de entrada, salón - comedor haciendo esquina con acceso al balcón, baño de cortesía, cocina amueblada con habitación de plancha y lavadero. Dormitorio principal con baño en suite y pequeño vestidor. Dos dormitorios con armarios empotrados y baño completo.<br> <br> PLANTA ALTA: Se accede mediante escalera de caracol. Dormitorio con baño en suite, despacho abuhardillado y amplia terraza de 70 m2.<br> <br> CALIDADES: <br> - Suelo de tarima de madera natural.<br> - Carpintería exterior oscilobatiente PVC / Climalit.<br> - Carpintería interior madera.<br> - Armarios empotrados.<br> - Gas ciudad.<br> - Aire acondicionado centralizado frío/calor.<br> <br> ZONAS COMUNES:<br> El edificio tiene ascensor y cuenta con rampa de acceso para personas con movilidad reducida. Comunidad: 80 €.<br> <br> UBICACIÓN:<br> Pagés del Corro junto a zona peatonal de C/ San Jacinto. Próximo a colegios (Protectorado, Nuestra Señora del Rosario, San Jacinto). Mercado de Triana, supermercados y a 3 minutos andando del Puente de Triana y centro de Sevilla.<br> <br> housin<br> <br> OTRO CONCEPTO INMOBILIARIO: Casas con Estilo<br> <br> Para más información puede contactar con nosotros o consultar en nuestra web También podemos atenderle personalmente en nuestras oficinas sitas en Sevilla, en calle Felipe II, nº7 y Virgen de Luján nº49.',5,4,'37.3842358,-6.0046719',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>132 m² construidos</li> <li>5 habitaci