 (185,14,NULL,185,112,310000,'Calle Alfarería','41007','venta','ático','Ático en venta en calle Alfarería','En una de las zonas más exclusivas de Sevilla, a escasos metros del puente de Triana, a menos de 5 minutos de monumentos como La plaza de Toros, la Torre del Oro etc. Con gran oferta gastronómica y de ocio, cercano a supermercados y comercios en una calle de mucha vida y gran luz natural nos encontramos con esta exclusiva vivienda.<br><br>El edificio donde se encuentra es piso es de reciente construcción con buenas calidades, un pequeño jardín y varios patios centrales con columnas típicas sevillanas, cuenta también con ascensor y zonas comunes para guardas bicis y otros.<br><br>La vivienda se distribuye en 2 plantas unidas por una bonita escalera de caracol; En la primera planta nos encontramos con un gran salón de mucha luz y grandes ventanales, un dormitorio de mas de 18 metros cuadrados, una cocina semi-independiente totalmente reformada y de diseño y un cuarto de baño completo.<br><br>En la segunda planta cuenta con un dormitorio de matrimonio, un aseo con posibilidad de ampliarlo a cuarto de baño completo y terraza privativa de 19 metros cuadrados con su mobiliario correspondiente de desahogo. Unido a este dormitorio, existe una segunda estancia con grandes armarios empotrados que se usa como despacho y vestidor y que es fácilmente separable si se desea un tercer dormitorio independiente.<br><br>La vivienda esta totalmente reformada con calidades de primera y cuenta con aire centralizado en todas las estancias, radiadores y armarios empotrados por toda la casa para optimizar todos los espacios al máximo.<br><br>La vivienda tiene una plaza de garaje para coche y moto, con fácil acceso de entrada y salida no está incluida en el precio.<br><br>Para más información no dude en ponerse en contacto con nosotros.<br><br>NO COBRAMOS COMISIÓN AL COMPRADOR<br>GILMAR Horario de lunes a viernes de 9.30 H a 20.00 H y sábado de 10.00 H a 14.00 H.<br>En GILMAR trabajamos para ofrecer a nuestros clientes los mejores inmuebles, con equipos especializados en cada zona para proporcionarles la mejor opción a su necesidad, con todas las excelencias y cuidando al máximo los detalles. <br>En más de 30 años de andadura, Gilmar ha logrado alcanzar un espacio de privilegio dentro del Sector Inmobiliario de alto standing. Cubrimos todas las necesidades inmobiliarias: viviendas, oficinas, locales comerciales, solares, fincas rústicas, terrenos para construir. y cualquier tipo de operaciones: compraventa y alquiler.<br>Nuestros clientes cuentan con el asesoramiento necesario desde el inicio, para garantizar su seguridad, eficacia jurídica y la mejor rentabilidad financiero-fiscal.<br>Estupenda oportunidad, para conseguir un piso a la medida de sus sueños.<br>La vivienda se encuentra en uno de los mejores barrios de la capital, muy conocido ya que en el nacieron varios artistas del flamenco. Muy fácil acceso a la S-30, cuenta con varias paradas de autobuses y parada de metro a escasos minutos. Sólo hay que cruzar el puente de Triana para llegar al centro. Cuenta con mercado de abastos, calle peatonal de tiendas y ocio y una gran cantidad de bares típicos de tapas y restaurantes. Típico barrio donde todo lo tienes a mano, ideal para vivir, con parques, colegios, y tiene un paseo de varios kilómetros para andar o correr por el paseo del rio, con un colorido especial y mucha luz, barrio lleno de vida.',2,2,'37.3874584,-6.0068802',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>112 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje por 31.000 € adicionales</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación oeste</li> <li>Construido en 1994</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor','opc. 31.000 €',NULL),
