 (187,14,NULL,181,340,1090000,'Santa Cruz - Alfalfa','41004','venta','casa o chalet','Casa o chalet en venta en Santa Cruz - Alfalfa','Exclusiva casa de diseño en el centro de Sevilla, con ascensor.<br> <br> La vivienda se encuentra completamente reformada con altas calidades, ubicada en el centro de Sevilla, junto a C/ Águilas, cuenta con una superficie construida de 340 m2. Distribuidos en tres plantas:<br> <br> Dispone de un total de 4 habitaciones, salón, cocina, 4 baños completos, 1 aseo, azotea y patio inglés. Posibilidad de parking muy cerca de la vivienda.<br> <br> PLANTA BAJA: <br> Vestíbulo con ascensor, patio inglés, cocina completa con muebles y electrodomésticos y vinoteca, despensa, salón y aseo.<br> <br> PLANTA PRIMERA: <br> 3 dormitorios con baño tipo suite, uno de ellos cuenta además con vestidor.<br> <br> PLANTA SEGUNDA:<br> 1 dormitorio, más 1 estudio, lavadero, y azotea.<br> <br> CALIDADES:<br> - Ascensor.<br> - Suelo de piedra natural en planta primera y baño, resto de la casa bambú<br> - Ventanas oscilobatientes de primera calidad con rotura de puente térmico.<br> - Sanitarios Duravit y grifería hasngrohe.<br> - Puertas de madera con asilamiento acústico.<br> - Paredes de ladrillo macizo y pladur, con el paso de instalaciones por la cámara intermedia.<br> - Aire acondicionado individual por habitación, incluidas cocina y cuartos de baño.<br> - Suelo radiante en planta baja y el resto de habitaciones con radiadores.<br> - Calefacción por gas natural.<br> - Agua caliente por gas natural.<br> - Cocina amueblada con muebles de primera calidad y electrodomésticos de primeras marcas, incluyendo botellero y triturador de basura.<br> <br> UBICACIÓN: <br> Centro de Sevilla, junto a C/ Águilas.<br> <br> Para más información puede contactar con nosotros o consultar en nuestra web.',4,2,'37.3876445,-5.9894825',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_feat