 (188,14,NULL,185,106,310000,'San Bernardo-Buhaira-Huerta del Rey','41007','venta','dúplex','Dúplex en venta en San Bernardo-Buhaira-Huerta del Rey','Gilmar Sevilla les ofrece esta exclusiva vivienda ubicada en el barrio de San Bernardo. <br><br>Disponer de esta vivienda les permitirá disfrutar del estilo de vida que le ofrece este magnífico barrio, uno de los más demandados de Sevilla por su tranquilidad, cercanía al centro de Sevilla, su fácil acceso en coche, sus excelentes comunicaciones entre otros con la parada de metro de Nervión, los centros docentes (Centro Porta Coeli, El Gran Pastor, Las Carmelitas, IES Turina, etc), universidad (Campus Universidad de Sevilla Viapol), centros comerciales y supermercados.<br><br>La vivienda forma parte de uno de los edificios de mayor calidad del barrio, y está organizada como dúplex exterior, dispone de una superficie construida de 106 m2 distribuidos en salón, cocina, dos dormitorios y dos baños. Las calidades son de lujo, encontrando suelos de mármol, carpinterías de madera, ventanas climalit, y aire acondicionado centralizado, entre otros.<br>La vivienda es de orientación suroeste por lo que es luminosa. El estado de conservación es excelente.<br><br>No cobramos comisión al comprador<br>En GILMAR te ofrecemos la mejor selección de inmuebles, con equipos profesionales especializados en cada zona que te ofrecen la información y el asesoramiento personalizados antes, durante y después de la operación. Estamos a tu disposición de lunes a viernes de 9:30 h. a 20:00 h. , y sábados de 10:00 h a 14:00 h.<br>Con 36 años de experiencia, Gilmar ocupa un espacio de privilegio en el sector inmobiliario de lujo. Cubrimos todas las necesidades: viviendas, oficinas, locales comerciales, solares, fincas rústicas, terrenos para construir, edificios… Cualquier tipo de operación inmobiliaria.<br>Nuestros clientes reciben el acompañamiento necesario desde el inicio, garantizando su seguridad, eficacia jurídica, y la mejor rentabilidad financiera y fiscal. Con la tranquilidad de trabajar con GILMAR, incluso después de realizar la compraventa.<br>Déjanos ayudarte a encontrar la casa de tus sueños.<br>Conócenos en gilmar. es.',2,2,'37.3815873,-5.9840891',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>106 m² construidos, 85 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur, oeste</li> <li>Construido en 1992</li> <li>Calefacción central</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo exterior con ascensor',NULL,NULL),
