 (191,14,NULL,180,317,1150000,'La Palmera - Manuel Siurot','41001','venta','piso','Piso en venta en La Palmera - Manuel Siurot','housin ofrece esta magnífica vivienda con 3 plazas de garaje, incluidas en el precio, situadas junto a la Avenida de la Palmera y al Porvenir, en uno de los mejores residenciales privados de Sevilla con piscina, pistas de pádel, y pequeño campo de fútbol infantil. Primera planta con ascensor, orientación sur y muy luminoso.<br> <br> La vivienda cuenta con 317 m2, distribuidos en un amplio recibidor, salón comedor con chimenea y salida a la terraza, 7 habitaciones ( 5 habitaciones dobles y 2 habitaciones simples), 4 baños completos y 1 aseo de cortesía. La habitación principal cuenta con baño completo en suite. Armarios empotrados en todas las estancias y en la zona del pasillo cocina office con despensa, lavadero, habitación de servicio con baño completo. Dos puertas de entrada a la vivienda, puerta principal y puerta de servicio. Dispone de 3 plazas de garaje, con acceso directo a la vivienda mediante ascensor, y trastero.<br> <br> CALIDADES: <br> Suelos de mármol.<br> Puerta blindada.<br> Carpintería interior madera lacada en blanco y carpintería exterior Climalit.<br> A/A Frío-Calor.<br> Armarios empotrados.<br> Gas ciudad.<br> Todas las persianas están motorizadas.<br> <br> ZONAS COMUNES: El edificio se encuentra dentro de un residencial privado con 2 conserjes y vigilancia 24 horas. Dispone de piscina comunitaria, pistas de pádel, pequeño campo de fútbol para niños y jardines. Edificio con 2 ascensores y adaptado a personas con movilidad reducida.<br> <br> UBICACIÓN: <br> Junto a Avenida de la Palmera y Porvenir. Colegios cercanos: RR. Calasancias, San Miguel Adoratrices. Hospitales: Quiron Sagrado Corazón, Virgen del Rocío.<br> <br> Para más información puede contactar con nosotros o consultar en nuestra web También podemos atenderle personalmente en nuestras oficinas sitas en Sevilla, en calle Felipe II, nº7 y Virgen de Luján nº49.<