 (192,14,NULL,192,91,260000,'Avenida de Menéndez Pelayo, 19','41002','venta','piso','Piso en venta en avenida de Menéndez Pelayo, 19','ESTE ANUNCIO CONTIENE UN VIDEO MOSTRATIVO DE LA VIVIENDA, NO DEJES DE VERLO.<br><br>Esta vivienda se sitúa en la misma Avenida de Menéndez Pelayo, junto a los Jardines de Murillo, en la zona de la judería, pleno casco antiguo de Sevilla.<br><br>Se encuentra totalmente reformada con calidades muy modernas, aunque el edificio no es antiguo. Posee 3 dormitorios con armarios empotrados, salón-comedor con balcones a la calle, cocina independiente pero con pasaplatos a la zona de comedor, baño con doble ducha y aseo.<br><br>Toda la vivienda posee persianas eléctricas, climatización central frio-calor y luces, todo ello domotizado, pudiendo manejarlo a distancia. Además, las ventanas y cerramientos exteriores son oscilobatientes con doble acristalamiento. La solería es de tarima flotante y porcelánico. <br><br>La cocina está amueblada muy moderna, con todo el mobiliario blanco, ocultando todos los electrodomésticos, que se encuentran integrados. La separa del salón paneles y puerta de cristal, creando espacios más abiertos y luminosos. Dentro de los electrodomésticos que contiene tenemos frigorífico y congelador extra grandes, lavadora, secadora, lavavajillas, horno, microondas o placa vitrocerámica con extracción de humos integrada.<br><br>Los baños están reformados con altas calidades y la ducha es doble, con 2 duchas dentro de la misma cabina. Con lavabos y sanitarios colgantes y espejos retroiluminados.<br><br>Se sitúa en la 2ª planta del edificio, que no cuenta con ascensor, estando formado por únicamente 4 viviendas. En la azotea se puede tender y se ubica un trastero privado para cada vivienda.<br><br>Se ofrece una plaza de aparcamiento opcional a parte, por un precio añadido de 40.000€, ubicándose a 200m de la vivienda.<br><br>ITALYCA INMOBILIARIA NO COBRA COMISIONES AL COMPRADOR.<br><br>Se encuentra a 200m de los Jardines Murillo. A menos de 100 m de un supermercado. El entorno dispone de farmacias, mercado de Abastos y demás servicios necesarios. Está muy cerca de las Setas de la Encarnación, bulevar de ocio, con muchos restaurantes, bares, cafeterías y donde se realizan mercadillos entre otros acontecimientos. A menos de 10 minutos a pie, está la Plaza del Duque con tiendas de moda y el Centro Monumental de la ciudad.<br><br>Tenemos a disposición del consumidor el Documento Informativo Abreviado.',3,2,'37.3868036,-5.9855885',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>91 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Plaza de garaje por 40.000 € adicionales</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación este</li> <li>Construido en 1995</li> <li>Calefacción individual: Eléctrica</li> <li>Certificación energética: <span title="g" class="icon-energy-c-8"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior sin ascensor','opc. 40.000 €',NULL),
 (193,14,NULL,193,172,399000,'Nervión','41019','venta','ático','Ático en venta en Nervión','En Nervión, junto a Eduardo Dato, con todos los servicios y comunicaciones a mano (supermercados, centros comerciales, centro de salud, hospitales, grandes colegios e institutos, farmacias y pequeño comercio en general, autobuses, metro, etc. ) nos encontramos este gran piso, en última planta, de 172 metros construidos, según catastro, y 151 metros útiles, con amplias estancias y reformado.<br> <br> Gran cocina-office con lavadero-tendedero y despensa/trastero amplia, salón-comedor con terraza de 10 metros aprox. , 4 dormitorios dobles y dos baños completos (1 de ellos en habitación tipo suite).<br> <br> En cuanto a calidades, suelos de gres, puertas en madera, ventanas con climalit, mosquiteras y persianas de aluminio, 4 armarios empotrados, 1 baño con bañera y otro con ducha.<br> <br> Urbanización con zonas comunes para el disfrute de los niños, parking en superficie no numerado y edificio con 2 ascensores. En la cuota de comunidad entra el agua fría y caliente.<br> <br> NO deje pasar la oportunidad de vivir en una zona privilegiada de Nervión, junto grandes colegios y zonas comunes para sus hijos.<br> <br> Por mandato expreso del propietario, comercializamos este inmueble en exclusiva, lo que le garantiza el acceso a toda la información, a un servicio de calidad, un trato fácil, sencillo y sin interferencias de terceros. Por este motivo, se ruega no molestar al propietario, a los ocupantes de la propiedad o a los vecinos. Muchas gracias por su comprensión.<br> <br> Precio: 399.000€. No incluidos gastos de notaría, impuestos y posible financiación. Honorarios Profesionales Agencia Inmobiliaria CERO EUROS para Vd. comprador/a.<br> Documento D. I. A. a disposición del consumidor según Decreto 218/2005 Junta de Andalucía.',4,2,'37.3790415,-5.9721274',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>172 m² construidos, 151 m² útiles</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur, oeste</li> <li>Construido en 1970</li> <li>Calefacción individual</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 11ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'11ª planta exterior con ascensor','Garaje incluido',NULL),
 (194,14,NULL,194,196,370000,'Calle Espinosa y Cárcel s/n','41007','venta','piso','Piso en venta en calle Espinosa y Cárcel s/n','Gran vivienda junto al colegio de las Carmelitas(Santa Joaquina de Vedruna). Se trata de una vivienda de 185m2 totalmente exterior, que consta actualmente de 5 dormitorios, gran salón, impresionante hall de entrada, cocina con lavadero, dos baños, estupenda terraza, dos baños, trastero muy grande en azotea, justo encima de la vivienda se ubican también el resto de trasteros, es decir aunque es última planta tiene la construcción de éstos encima, lo que evita estar en contacto directo con la azotea. Además cuenta con aparcamiento en superficie para los propietarios de la urbanización y también con zonas ajardinadas dentro del recinto. La vivienda dispone de múltiples posibilidades, pudiéndose redistribuir y aumentar o disminuir la superficie de aquellas estancias que nos interese para adaptar la vivienda a nuestras necesidades, haciéndola única. Es una vivienda con mucha luz, cuenta con armarios empotrados en 4 de las 5 habitaciones. <br>De la zona que decir, próxima a las universidades, donde se encuentra el tren y el metro, al centro también se puede ir dando un agradable paseo, colegios y guarderías no faltan en sus alrededores, así como tiendas de todo tipo, supermercados, plaza de abastos, etc. Zona muy cómoda para vivir y con buen vecindario. Tener la posibilidad de hacer una vivienda a tu gusto, con amplitud, en uno de los mejores sitios y en una zona tranquila y cómoda, ahora está a tu alcance.',5,2,'37.3820769,-5.9709378',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>196 m² construidos</li> <li>5 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/para reformar</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1967</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (IPE no indicado)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'5ª planta exterior con ascensor','Garaje incluido',NULL),
