 (196,14,NULL,196,173,637000,'Calle Camilo José Cela, 2','41012','venta','piso','Piso en venta en calle Camilo José Cela, 2','housin presenta en exclusiva esta vivienda a ESTRENAR CON PLAZA GARAJE, Y PISCINA. 4 DORMITORIOS, ARMARIOS EMPOTRADOS, VESTIDOR, 2 BAÑOS, ASEO, COCINA DE DISEÑO CON LAVADERO TOTALMENTE EQUIPADA INTEGRADA EN SALÓN Y TERRAZA.<br> <br> Posibilidad de compra de segunda plaza de garaje junto a la plaza de garaje del piso, y amplísimo trastero (16 m²), no incluidos en el precio. Precio de ambos a consultar.<br> <br> Disfruta de una vivienda completamente nueva en Viapol, en calle Camilo José Cela. Fantástica y exclusiva vivienda a estrenar con diseño moderno y funcional, primeras calidades, confort y excelentes acabados.<br> <br> DATOS DE LA VIVIENDA<br> <br> Vivienda exterior de 173 m2 construidos. Orientación norte. Plaza de garaje. La vivienda se distribuye en salón-comedor y cocina de lujo con lavadero y con isla, 4 dormitorios, 3 baños (uno de ellos tipo suite en dormitorio principal), vestidor en el dormitorio principal, lavadero y bonita terraza con acceso desde el salón.<br> <br> CALIDADES<br> <br> - Carpintería exterior de aluminio serie Perimetral GP-90, con rotura de puente térmico, máximo aislamiento en su gama. Bicolor oro en el exterior, blanco en el interior. Persianas motorizadas en cierre de salida a la terraza.<br> <br> - Carpintería interior compuesta por puertas de paso de madera maciza lacada en blanco y herrajes de acero inoxidable.<br> <br> - Suelo laminado AC5 marca Quick Step serie Creo.<br> <br> - Baños revestidos de gres porcelánico rectificado de gran formato marca Keraben y Marazzi.<br> <br> - Instalación eléctrica según REBT. Mecanismos color blanco, marca Panasonic modelo Karre.<br> <br> - Instalación de fontanería con tubería multicapa, grifería de diseño embutida, sanitarios compactos, platos de ducha de diseño con desagüe oculto y muebles de lavabos suspendidos y sobre encimera de roble tipo bol.<br> <br> - Sistema de climatización por conductos en todas las estancias de la vivienda marca Fujitsu.<br> <br> - Cocina de lujo con isla.<br> Mobiliario de cocina de diseño alemana con acabado polímero antihuellas color negro, canteado con cola PUR aportando hidrofugación superior siendo impermeable al agua, parece una pieza única ya que están canteados con láser, tiradores de perfilería oculta, herrajes blum con cierre amortiguado. <br> Electrodomésticos integrados (frigorífico + congelador side by side, lavadora, lavavajillas, horno, microondas y calientaplatos todos marca Smeg).<br> Campana de diseño embutida en techo y placa de inducción marca Faber.<br> Grifería de alto diseño, fregadero y dispensador de jabón integrado marca Plados.<br> Lavadora y secadora marca Siemens. <br> Termo eléctrico de 150 litros.<br> Encimera Neoliht La Bohéme.<br> <br> - Armarios empotrados en todas las habitaciones, lacados en blanco y revestidos en textil en su interior similar a lino habana. Incluye vestidor abierto en el dormitorio principal.<br> <br> ZONAS COMUNES<br> El edificio se encuentra dentro de un residencial privado. Cuenta con ascensor, zonas ajardinadas, piscina y conserje. Seguridad 24 horas. Comunidad 180 €.<br> <br> UBICACIÓN<br> En Calle Camilo José Cela, junto a Avenida de la Buhaira. Cuenta con todo tipo de servicios como centros de enseñanza Colegio Portaceli, Colegio San Bernardo, Instituto Británico, centros universitarios Campus Viapol, centros de salud Vithas Salud y centro de salud Las Palmeritas y de El Porvenir (SAE). Excelentes comunicaciones al centro de Sevilla por la avenida junto Prado de San Sebastián (avda Carlos V) y acceso a SE-30 por avda de la Paz. centro deportivo Lowfit Viapol, centro deportivo Viding Piscina Sevilla. Centro comercial Nervión Plaza.<br> <br> housin Otro concepto inmobiliario.',4,3,'37.380294,-5.9792428',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>173 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Armarios empotrados</li> <li>Orientación norte</li> <li>Construido en 1992</li> <li>Calefacción central</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (160 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 6ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'6ª planta exterior con ascensor','Garaje incluido',NULL),
 (197,14,NULL,197,87,138925,'Avida de las Cicias','41002','venta','piso','Piso en venta en Avenida de las Ciencias','Amplia y muy luminosa, esta vivienda se encuentra junto avenida principal y rodeada de todo tipo de servicios, comercios, colegios, zonas infantiles, zonas verdes.<br> <br> Es exterior y muy luminosa, dispone de 87m2 construídos y útiles 70m2 distribuídos en amplio salón comedor de paso con acceso a terraza con vistas hacia el parque, perfecta como desahogo, muy tranquilo y luminoso.<br> <br> Su cocina es independiente y se encuentra amueblada, en tonos blanco y amarillo, con vitrocerámica y campana decorativa, muy luminosa.<br> <br> Sus tres dormitorios son exteriores y cuentan con armarios empotrados, además cuenta con un cuarto armario en pasillo, aprovechando así el espacio al máximo<br> <br> El inmueble cuenta con dos baños completos, ampos con bañera. Tiene un split de aire acondicionado en salón.<br> <br> Las ventanas son de aluminio lacado en blanco, las puertas de madera y el suelo de terrazo y gres, dispone de ascensor y plaza de garaje para su comodidad, ya que no necesitará buscar aparcamiento al llegar de trabajar, además el recinto cuenta con zonas comunes para poder disfrutar por la tardes y que los más pequeños puedan jugar. Vivienda de VPO.<br> <br> Tendrá a su alcance todo lo que necesita, supermercado Bonsabor, centro Quirón Salud, Mercadona.. . todo a pocos pasos. No dude en visitarlo con nosotros!<br> <br> Financiación hasta 100%, todos los Bancos en una sola visita: consulte sin compromiso nuestras Hipotecas Joven, VPO, Funcionarios, Sin Vinculaciones, Desde e+0,85, Préstamos Puente y Personales, …”.',3,2,'37.3968073,-5.9246158',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>87 m² construidos, 70 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/