 (198,14,NULL,192,102,400000,'Puente y Pellón, 11','41011','venta','ático','Ático en venta en puente y Pellón, 11','ESTE ANUNCIO CONTIENE UN VIDEO MOSTRATIVO DE LA VIVIENDA, NO DEJES DE VERLO.<br><br>Amplio ático de 102 m2, en una sola planta, con 50 m2 de terraza privada, situado en la calle Puente y Pellón, entre la Plaza de la Encarnación y la del Salvador.<br><br>Se encuentra en una casa palacio de los Marqueses de Sortes del siglo XVII, rehabilitada en 2002, con varios patios porticados y muchos elementos arquitectónicos de la casa original, y sumándole muchas calidades modernas de autentico lujo, tales como gimnasio privado o piscina en la cubierta con unas vistas de ensueño. También cuenta con ascensores y garaje subterráneo.<br><br>La vivienda consta de un amplio salón-comedor, cocina, 2 dormitorios, 2 baños completos y una terraza privada de 50 m2 útiles.<br><br>Sus 2 dormitorios amplios son tipo suite, con un baño dentro, cada uno. El salón-comedor es amplio en 2 ambientes y tiene su acceso a la terraza. La cocina es pequeña pero amueblada y con acceso también a la terraza. <br>Aunque está en perfecto estado de conservación y no necesita reformas, también tiene una posibilidad de reforma muy interesante, integrando la cocina en la zona de salón y pasillo, y abriendo un gran cierre de cristal a la terraza, disfrutando así de una zona única, abierta con gran luminosidad e integrando visualmente toda la zona de terraza. (Adjuntamos planos o infografías de esta opción).<br><br>La terraza se encuentra acotada por tabiques que le confiere una privacidad total, de las viviendas de alrededor y cuenta con un toldo nuevo que puede cubrir toda la terraza completa. También posee una caseta como desahogo, donde se sitúa la lavadora y hace las veces de pequeño trastero.<br><br>Dentro de sus calidades podemos destacar la climatización central frio-calor en toda la vivienda, puertas de paso y armarios de madera maciza, ventanas de madera y aluminio con doble acristalamiento, solería de mármol, 3 armarios empotrados vestidos interiormente o termo de gas natural.<br><br>Se ofrece también una plaza de aparcamiento con amplio trastero en el mismo edificio, de forma opcional por 50.000€ más.<br><br>ITALYCA INMOBILIARIA NO COBRA COMISIONES AL COMPRADOR. <br><br>Se encuentra a 50 metros de la Plaza de la Encarnación o a 300 metros de la Plaza de Salvador. A menos de 100 m de un supermercado. El entorno dispone de farmacias, mercado de Abastos y demás servicios necesarios. Está muy cerca de las Setas de la Encarnación, bulevar de ocio, con muchos restaurantes, bares, cafeterías y donde se realizan mercadillos entre otros acontecimientos. A menos de 5 minutos a pie, está la Plaza del Duque con tiendas de moda y el Centro Monumental de la ciudad.<br><br>Tenemos a disposición del consumidor el Documento Informativo Abreviado.',2,2,'37.3916166,-5.9919414',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>102 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje por 50.000 € adicionales</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur, oeste</li> <li>Construido en 2002</li> <li>Calefacción individual: Bomba de frío/calor</li> <li>Certificación energética: <span title="f" class="icon-energy-c-7"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª interior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta interior con ascensor','opc. 50.000 €',NULL),
 (199,14,NULL,192,80,189000,'Calle Escoberos, 11','41004','venta','piso','Piso en venta en calle Escoberos, 11','ESTE ANUNCIO CONTIENE UN VÍDEO MOSTRATIVO DE LA VIVIENDA, NO DEJES DE VISIONARLO.<br><br>Esta vivienda se encuentra situada en la calle Escoberos, perpendicular de la calle Feria, y posee una terraza al exterior, donde poder tomar el aire, incluso con una pequeña mesa y sillas poder tomar un agradable desayuno al fresco.<br><br>En Semana Santa, se puede disfrutar de una gran estampa desde su terraza, con el paso de La Macarena desde la calle Parras, con su imponente lluvia de pétalos a la Virgen.<br><br>Consta de 2 dormitorios, aunque originalmente eran 3, pudiendo volver a la situación originaria, situando un único tabique de separación en el salón.<br>Actualmente posee un salón muy amplio con 2 ambientes claros de estar y comedor, con ventanales hasta el suelo, que le hace ser muy luminoso por su orientación al sur.<br><br>La cocina es independiente con mobiliario nuevo, moderno y con todos sus electrodomésticos nuevos (frigorífico, lavadora, lavavajillas, hornilla de gas, extractor, horno y microondas) y el baño posee bañera y ventana para ventilarlo. Ambas estancias se encuentran totalmente reformadas.<br><br>En cuanto a las reformas realizadas y sus calidades podemos destacar las ventanas y cierres de pvc blanco con grosor especial y doble acristalamiento, las puertas lacadas en blanco modernas, split de aire acondicionado o instalación de gas natural.<br>La solería es original de terrazo en buen estado.<br><br>Posee un trastero individual en la azotea de unos 4 m2 y donde poder almacenar muchas cosas. Además en la azotea se puede tender la ropa. <br><br>ITALYCA INMOBILIARIA NO COBRA COMISIONES AL COMPRADOR.<br><br> El inmueble se encuentra muy cerca de la Iglesia de La Macarena, entre otras. A menos de 100 m de un supermercado. En el entorno dispone de farmacias, mercado de Abastos y demás servicios necesarios. Está muy cerca de La Alameda de Hércules, bulevar de ocio, con muchos restaurantes, bares, cafeterías y donde se realizan mercadillos entre otros acontecimientos. A menos de 10 minutos a pie, está la Plaza del Duque con tiendas de moda y el Centro Monumental de la ciudad. <br><br>Tenemos a disposición del consumidor el Documento Informativo Abreviado.',2,1,'37.4024106,-5.9913879',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>80 m² construidos</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur</li> <li>Construido en 1964</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior sin ascensor',NULL,NULL),
 (200,14,NULL,192,59,139000,'Calle San Luis, 70','41017','venta','piso','Piso en venta en calle San Luis, 70','ESTE ANUNCIO CONTIENE UN VÍDEO MOSTRATIVO DE LA VIVIENDA, NO DEJES DE VISIONARLO<br><br>Piso junto a Calle San Luis, en Callejón Ruiz Gijón, se encuentra en plena ruta del Gótico-Mudejar sevillano, con grandes exponentes a menos de 500 m como lo son la iglesia de Santa Marina o la de San Marcos. Además de estar a menos de 100 m de uno de las mejores iglesias barrocas de Andalucía, La Iglesia de San Luis de Los Franceses.<br><br>Consta de 1 dormitorio con armario empotrado y pequeño vestidor, salón-comedor en 2 ambientes, con posibilidad de tener zona multiusos para comer o trabajar, cocina independiente amueblada y 1 baño completo con ducha. Se sitúa en una planta baja con ascensor y es exterior. <br><br>El apartamento posee licencia de alquiler vacacional pudiéndose explotar como vivienda de 2 dormitorios, tal como se observa en la fotografías que exponemos, sacando una gran rentabilidad por su ubicación tan interesante turísticamente hablando. <br><br>Posee buena distribución y buenas calidades. La soleria es de mármol, ventanas de aluminio lacado en blanco con doble acristalamiento y el portaje es de madera lacada. Está climatizado por splits de aire acondicionado. El edificio en el que se encuentra está en perfecto estado, siendo una edificación moderna y posee azotea transitable.<br><br>ITALYCA INMOBILIARIA NO COBRA COMISIONES AL COMPRADOR. El inmueble se encuentra muy cerca de la Iglesia de Santa Marina o La Macarena, entre otras. A menos de 100 m de un supermercado. En el entorno dispone de farmacias, mercado de Abastos y demás servicios necesarios. Está muy cerca de La Alameda de Hércules, bulevar de ocio, con muchos restaurantes, bares, cafeterías y donde se realizan mercadillos entre otros acontecimientos. A menos de 10 minutos a pie, está la Plaza del Duque con tiendas de moda y el Centro Monumental de la ciudad. <br><br>Tenemos a disposición del consumidor el Documento Informativo Abreviado.',1,1,'37.3994674,-5.9882254',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>59 m² construidos</li> <li>1 habitación</li> <li>1 baño</li> <li>Plaza de garaje por 35.000 € adicionales</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación norte</li> <li>Construido en 2003</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo exterior con ascensor','opc. 35.000 €',NULL),
 (201,14,NULL,201,125,359000,'Calle Marqués de Estella, 13','41016','venta','piso','Piso en venta en calle Marqués de Estella, 13','housin presenta en exclusiva esta vivienda de 125 m² construidos en planta baja en San Bernardo junto al parque de la Buhaira. C/ Marqués de Estella.<br> <br> La vivienda está distribuida en 3 dormitorios, 2 baños completos y amplio salón-comedor. Cocina totalmente equipada con electrodomésticos. Dispone de techos altos. Patio comunitario adjunto. Disopne de un sistema de alarmas perimetral.<br> <br> CALIDADES:<br> - Carpintería interior madera sapeli.<br> - Carpintería exterior: ventanas mayorquinas hierro lacado blanco con doble acristalamiento.<br> - Puerta blindada.<br> - Solería de mármol.<br> - Aire acondicionado bomba de calor en salón y dormitorios.<br> - Alarma anti-robo y rejas de seguridad en todas las ventanas.<br> - Zócalo de azulejos alicatados a media altura.<br> <br> <br> ZONAS COMUNES:<br> Vivienda con patio interior comunitario adjunto a la vivienda. Entrada principal de mármol con cancela de hierro sevillana.<br> <br> UBICACIÓN:<br> Situado en C/ Marqués de Estella, entre la Iglesia de San Bernando y el Parque de la Buhaira.<br> Colegios: Colegio Portaceli, Colegio parroquial San Bernardo, Centro privado Virgen del Refugio.<br> Ocio: Parque Buhaira y La Bernarda.<br> <br> housin OTRO CONCEPTO INMOBILIARIO<br> <br> VENDE * TRANSFORMA * DISFRUTA<br> <br> Para más información puede contactar con nosotros o consultar en nuestra web También podemos atenderle personalmente en nuestras oficinas sitas en Sevilla, en calle Felipe II, nº7 y Virgen de Luján nº49.',3,2,'37.3824572,-5.9812325',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>125 m² construidos, 95 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación oeste</li> <li>Constr