 (202,14,NULL,202,77,99000,'Calle Cueva del Gato','41015','venta','piso','Piso en venta en calle Cueva del Gato','Vivienda de 77 m2 construidos aproximados en 3ª planta exterior con ascensor.<br>Se encuentra en urbanización privada con piscina, pista de tenis y parque infantil.<br>Se distribuye en hall, salón-comedor, dos dormitorios, baño, cocina y terraza.<br>La finca está ubicada en Sevilla, entre los barrios de Santa Clara y Urb. Ciudad Verde.<br><br>Consultar documentación e información adicional y detallada en el apartado legal.<br>Esta propiedad tiene un precio condicionado. La oferta ganadora estará sujeta a aprobación por parte del vendedor, quien dispone de un plazo máximo de 2 días hábiles para emitir una respuesta, siendo vinculante en caso de aceptación. Encontrará más información en nuestros Términos y Condiciones.<br><br>La vivienda está ubicada en Sevilla muy próxima al Parque Tegodubi y al Parque Infanta Elena.<br>Se encuentra a 1,7 km del Corte Inglés Sevilla Este y a 1,4 km del Palacio de Congresos y Exposiciones.<br>En los alrededores de la vivienda podemos encontrar supermercado, farmacia, peluquería, bares y restaurantes, bancos, el Centro de Salud Puerta Este, el Colegio Alemán Alberto Durero, clínica dental, clínica veterinaria, escuela infantil y oficina de correos.<br>Se encuentra bien comunicada por carretera por la A-4, por autobús con las líneas 27, A3, B4 y LE&nbsp; y por tren con la línea C4.<br><br>NO COBRAMOS COMISIÓN AL COMPRADOR<br>Venta a partir de un proceso de ofertas a través de nuestra plataforma online BidX1. com.<br>Dirígete a nuestra web para informarte de las modalidades de venta: a) precio mínimo de venta, el importe indicado es el precio mínimo de venta que la parte vendedora aceptaría para vender la propiedad, o b) precio condicionado, la oferta ganadora estará sujeta a aprobación por parte del Vendedor, quien dispone de un plazo máximo de 2 días hábiles para emitir una respuesta, siendo vinculante en caso de aceptación. Infórmate de las ventajas de nuestro Marketplace inmobiliario en nuestra Web.<br><br>Puede consultar la información relativa a este inmueble, así como el proceso de compra, dándose de alta en la página web de BidX1 o llamándonos al teléfono publicado. Toda la documentación facilitada es a efectos informativos. BidX1 pone a su disposición toda la información y documentación facilitados por la propiedad y/o su representante para que los interesados puedan llevar a cabo un proceso de diligencia debida en relación con el inmueble en venta, con carácter previo a la emisión de una oferta vinculante por dicho inmueble.',2,1,'37.399776,-5.942282',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>77 m² construidos</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Certificación energética del edificio terminado: <span title="e" class="icon-energy-c-6"></span> (105 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Piscina </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor',NULL,NULL),
