 (204,14,NULL,197,195,355000,'Calle Doctor Miguel Ríos Sarmiento','41010','venta','chalet adosado','Chalet adosado en venta en calle Doctor Miguel Ríos Sarmiento','Disfruta de su patio, de su amplitud y luminosidad.<br> <br> Espectacular adosada junto Avenida de las Ciencias con garaje y sótano! <br> <br> Dispone de 194m2 construídos aproximadamente, distribuídos en dos plantas, más sótano de 65m2 y garaje de 51m2, teniendo útiles 106m2 aproximadamente.<br> <br> En planta baja nos encontramos con un gran salón comedor exterior a jardín, muy luminoso y confortable. <br> Amplia cocina independiente amueblada y equipada con electrodomésticos, con mueble de madera lacada en blanco y encimera de granito color negro, con vitrocerámica y campana decorativa, con zona de desayuno y práctico lavadero, exterior a fantástico jardín trasero con toldos, ideal para disfrutar de una agradable comida al aire libre, con zona de césped. <br> <br> Un amplio dormitorio utilizado como sala de estar y un baño completo, con bañera. <br> <br> Una bonita escalera con peldaños de madera y pasamanos lacado en blanco nos conduce a la primera planta, donde nos encontramos con tres amplios dormitorios exteriores, dos de ellos dobles, con baños incorporados, ambos con bañera, uno de ellos exterior, el tercer dormitorio actualmente utilizado como fantástico vestidor. <br> <br> Esta magnifica vivienda también dispone de un fantástico sótano de 65m2 ideal como sala de reunión con amigos, despacho, gimnasio, sala de juegos para los niños, o lo que desee, ya que dispone de metros suficientes para adaptarlo a sus necesidades. <br> <br> Las ventanas son de aluminio, las puertas de sapely y los suelos de mármol y gres. <br> <br> En planta baja dispone de pre instalación de aire acondicionado, en primera planta 3 splits de aire acondicionado frío/calor y cuenta con Plaza de garaje subterránea para su mayor comodidad. <br> <br> Esta gran vivienda hace esquina, es exterior, muy luminosa y soleada, con excelente orientación Suroeste y se encuentra muy bien situada, en urbanización con posibilidad de club social con jardines, piscina y zonas deportivas para disfrutar todo el año, a pocos metros del parque Infanta Elena y junto a Avenida de Las Ciencias, rodeada de comercios, colegios, zonas infantiles. y con fácil acceso desde la misma avenida. <br> <br> Solicite información sin compromiso! <br> <br> Financiación hasta 100%, todos los bancos en una sóla visita: Consulte sin compromiso nuestras Hipotecas Joven, VPO, Funcionarios, Sin Vinculaciones, Desde e 0,85, Préstamos Puentes y Personales.',4,2,'37.3938352,-5.9264768',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Chalet adosado</li> <li>195 m² construidos, 106 m² útiles</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Orientación sur, oeste</li> <li>Construido en 1995</li> <li>No dispone de calefacción</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (123 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (205,14,NULL,194,92,230000,'Calle Cardenal Lluch','41020','venta','piso','Piso en venta en calle Cardenal Lluch','Precioso piso en planta baja en la calle Cardenal Lluch, en la zona más cercana al estadio del Sevilla.<br>Ubicado en un edificio muy moderno, con menos de 13 años de antigüedad, equipado con ascensor, y garaje en sótano. Además, tiene unas zonas comunes muy agradables, con un patio ajardinado y sin barreras arquitectónicas. La vivienda se vende con un trastero amplio en sótano.<br>El piso está perfectamente conservado, para entrar a vivir. Tiene un salón comedor, una cocina perfectamente equipada y en muy buen estado. Tres dormitorios, uno de ellos tipo suite con armario empotrado y baño privado. Finalmente, también dispone de otro baño completo, muy amplio.<br>Como extras, la vivienda dispone de aire acondicionado centralizado, puertas de madera, ventanas con doble aislamiento, suelo de mármol blanco precioso, electrodomésticos de gama alta, armario empotrado en el dormitorio principal y tomas de televisión en las tres habitaciones. El edificio dispone de sistema de calentador de agua por placas solares, individualizado para cada vecino, y con un gran depósito; no obstante, el piso está equipado con un termo de agua de gas natural, si se deseara complementar el suministro.<br>En cuanto a la zona, está situado en la parte más valorada del barrio de Nervión, junto al estadio del Sevilla, el centro comercial Nervión Plaza, y el Corte Inglés.<br>En cuanto a comunicaciones, está a menos de un minuto de la parada de metro, de la parada de autobús, de taxis y de sevici, es decir, la comunicación es inmejorable, culminando con la plaza de garaje en sótano que está incluida en el precio.',3,2,'37.382594,-5.9662076',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>92 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje por 33.000 € adicionales</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (182,11 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo exterior con ascensor','opc. 33.000 €',NULL),
 (206,14,NULL,194,122,250000,'Avenida Alcalde Juan Fernandez s/n','41005','venta','piso','Piso en venta en avenida Alcalde Juan Fernandez s/n','Preciosa y moderna vivienda, muy luminosa y confortable, con orientación sur, en última planta con amplias y estupendas vistas, próxima a Felipe II y reformada en su totalidad en el 2003. Se trata <br>de una vivienda en recinto cerrado donde pueden jugar los niños para la tranquilidad de los padres y que cuenta con zona de aparcamiento en superficie, con una plaza para cada vecino que será fija durante todo un año, transcurrido éste se sortearán y volverá a disponer de plaza en una ubicación diferente dentro del mismo recinto. La vivienda totalmente exterior, es muy agradable y espaciosa, donde se combinan los conceptos abiertos y la privacidad. Al entrar nos da la sensación de profundidad dejando adivinar, pero sin que nada quede al descubierto. Vamos con la distribución: un baño a la entrada junto a la cocina que cuenta con placa de ducha, la cocina con una puerta de entrada desde pasillo y otra que comunica directamente al salón, muy práctico, es muy cuadrada y tiene una gran despensa, te permite mucha movilidad y comer en la misma. El salón que actualmente es de paso cabe la posibilidad de hacerse independiente, si se desea, aunque así queda muy bien, desde él se puede acceder a una sensacional terraza que coge todo el largo del salón, hay quien la incorpora aumentando la superficie. Luego vienen 3 hermosos dormitorios todos con armarios empotrados, el principal con baño incorporado, éste cuenta con bañera y es exterior, el pasillo cuenta con 3 armarios empotrados, todos están vestidos y el color de la madera hace juego con el suelo, también de madera. Todas las habitaciones y el salón disponen de aire acondicionado(split) frío/calor. El portal es muy amplio, sin barreras arquitectónicas, con dos ascensores y cuenta con azotea transitable desde donde se divisa nuestra bonita ciudad. <br>En la zona podemos encontrar todo tipo de colegios, tanto concertados como públicos, muchos comercios de todo tipo, además la conexión con la SE-30 con fácil acceso a ésta te comunica con cualquier punto. Espero te guste tanto como me gusta a mí y que encuentres en esta vivienda un hogar feliz.<br>Ahhh! Todo esto con una comunidad muy económica, no te lo vas a creer, 50 euros.',3,2,'37.3763623,-5.9705642',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>122 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur</li> <li>Construido en 1967</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 12ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'12ª planta exterior con ascensor','Garaje incluido',NULL),
