 (220,14,NULL,220,55,550,'Avenida Alcalde Luis Uruñuela','41005','alquiler','piso','Alquiler de Piso en avenida Alcalde Luis Uruñuela','"APARTAMENTO TOTALMENTE AMUEBLADO Y LISTO PARA ENTRAR*<br><br>Si está interesado en visitar este inmueble, es importante que indique al Asesor Comercial la referencia: 2452-ID.<br><br>Situado en la mejor zona de Sevilla Este, junto al Palacio de Congresos y Exposiciones de Sevilla, dotado de las mayores comodidades, servicio de consejería 24 h. y vigilancia jurada nocturna. Totalmente amueblado y acondicionado. De unos de 55 m2 construidos. Dispone de cocina con barra americana, dormitorio independiente con terraza acristalada y cuarto de baño completo. Suelo de mármol, climatización y armario empotrado, TV. Es muy luminoso y tiene muy buena orientación. Se presenta con lencería de cama y baño. Dispone de amplia plaza de garaje en los sótanos del mismo edificio asignada al inmueble, con acceso directo a la planta del apartamento. Son plazas muy amplias, en las cuales se puede estacionar coche y moto. También dispone de pista de pádel y piscina para su uso exclusivo por los usuarios del edificio. Los gastos de comunidad y plaza de garaje están incluidos en la renta.<br><br> ¡ Quiero informarle que se aceptan contratos de arrendamiento de larga y corta duración, (consulte promociones). Aunque las fotos y videos del inmueble son de archivo, el apartamento está preparado para entrar! Inmueble con una inmejorable relación calidad/precio y excelentes comunicaciones. ¡Visítelo!<br><br>ZONA: Zona consolidada dotada de muchas comodidades y servicios: supermercados muy cerca del edificio, gimnasios, centro comercial con cines y restauración, centros de salud, colegios internacionales (colegio alemán, escuela francesa), pequeños comercios. Además, el inmueble está muy cerca al Parque natural Infanta Elena, ideal para practicar running, pádel, tenis o simplemente para pasear. El entorno del edificio es muy agradable ya que la zona dispone de amplias zonas verdes, amplias calles y avenidas. Sin duda la mejor zona de Sevilla Este con diferencia. <br><br>TRANSPORTE: Fácil acceso a carreteras principales (A-4, A-92) y ronda de circunvalación (SE-30, SE-40). Muy bien comunicado con Aerópolis, Aeropuerto de Sevilla, Universidad Pablo Olavide y estación de trenes de Santa Justa y apeadero de Renfe C4, con comunicación a la estación de San Bernardo, campus universitario de Viapol, campus universitario de Reina mercedes y Hospital Virgen del Rocío. <br>Sevilla Este, también está la dotada de una amplia red de transportes urbanos de autobuses con las líneas 22-Prado de San Sebastián, 27- Plaza del Duque, B4-San Bernardo, LE- Prado de San Sebastián, con acceso al centro de la ciudad. También disponemos de varios puntos de acceso a bicis urbanas Sevici. Y monopatines eléctricos.',1,1,'37.4058634,-5.9329817',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>55 m² construidos, 50 m² útiles</li> <li>1 habitación</li> <li>1 baño</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Amueblado y cocina equipada</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor','Garaje incluido',NULL),
