 (241,4,NULL,241,148,900,'Avenida Alcalde Ramón Sainz de Varanda','50012','alquiler','piso','Alquiler de Piso en avenida Alcalde Ramón Sainz de Varanda','Acogedora vivienda amueblada ubicada en una de las mejores urbanizaciones de la zona ARAGONIA: dotada de piscina, zona de recreo infantil, y zonas verdes. Dispone de conserje y cámaras de seguridad. A 5 minutos andando del Hospital Clínico, y del Hospital Miguel Servet. A 10 minutos andando de la Universidad. Junto al Centro Comercial Aragonia, donde podrás encontrar todo tipo de comercios, supermercado, cines, gimnasio.. . Rodeado de los mejores colegios de la ciudad, centro de salud, terrazas donde poder tomar un aperitivo, zonas verdes.. . ¿Qué más se puede pedir? . Superficie de 86 m2 útiles, distribuidos en: - Amplio y luminoso salón dotado de grandes ventanales, y salida a terraza con vistas al Parque de Al Andalus. - Cocina completamente equipada y con salida a la terraza. - 1 dormitorio tipo suite con armario empotrado (forrado y vestido), y baño con bañera hidromasaje. - 1 dormitorio con armario empotrado, forrado y vestido. - 1 baño con bañera. - Vestíbulo con armario empotrado. Altas calidades: suelos de parquet de roble, puertas de roble, ventanas aluminio climalit oscilobatientes, encimera de granito en cocina, baños en mármol. Calefacción central con contador individual. Gastos de comunidad incluidos. Se incluye plaza de garaje. Si quieres vivir en una zona residencial pero con todos los servicios a tu alcance, no dejes pasar la oportunidad de venir a verlo. Interesados preguntar por José Manuel llamando al teléfono 688 736 503. Tenemos más inmuebles. Llámenos sin compromiso y solicite información sobre la referencia 900790. Este anuncio no es vinculante y puede contener errores; se muestra a título informativo y no contractual. Gracias por su tiempo.',3,2,'41.6399001,-0.9117323',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>95 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Construido en 2003</li> <li>Amueblado y cocina equipada</li> <li>Certificación energética: <span title="g" class="icon-energy-c-8"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
