 (246,4,NULL,246,50,595,'Calle Jesús','50017','alquiler','piso','Alquiler de Piso en calle Jesús','Apartamento en alquiler NUEVO A ESTRENAR, EXTERIOR y SIN AMUEBLAR en Calle Jesús al lado del Balcón de San Lázaro, zona Arrabal-Barrio Jesús. "<br><br>"Finca ubicada en muy buena zona, en barrio en pleno crecimiento con alta demanda de viviendas por su cercanía al centro y la cantidad de comercios y servicios que dispone a su alrededor. A un paso del puente de Piedra y la Plaza del Pilar, y a menos de 10 minutos andando de los puntos más importantes del centro de la capital aragonesa (Paseo Independencia, Plaza de España etc). Al lado de las avenidas principales del barrio del Arrabal y del Barrio Jesús (Avenida Sobrarbe y Avenida Cataluña). Perfecta combinación con las líneas de buses urbanos de Zaragoza, paradas de las líneas 21, 32, 35, 36, 39, Ci1 y Ci2. "<br><br>"El apartamento tiene 50m2 construidos y 45m2 útiles distribuidos en amplio salón con cocina americana totalmente equipada que a su vez dispone de una hermosa terraza, dormitorio y baño con plato de ducha y ventilación natural. Aire acondicionado y calefacción por split inverter en todas las estancias, suelos de parquet, ventanas de máxima calidad lacadas en blanco con cristal doble climalit oscilobatientes con buena cámara aislante, puertas interiores lacadas en blanco y puerta de entrada blindada. Sin amueblar. Tercera planta con ascensor. Buena orientación, muy luminoso y soleado. "<br><br>"Venga a visitarlo, le gustará..',1,1,'41.6594451,-0.8745222',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>50 m² construidos, 45 m² útiles</li> <li>1 habitación</li> <li>1 baño</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Orientación sur, este, oeste</li> <li>Cocina equipada y casa sin amueblar</li> <li>Calefacción individual: Bomba de frío/calor</li> <li>Certificación energética: <span title="a" class="icon-energy-c-2"></span> (IPE no indicado)</li> <li>Acceso adaptado a personas con movilidad reducida</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor',NULL,NULL),
