 (293,13,NULL,293,75,399000,'Calle Tomás Heredia','29017','venta','piso','Piso en venta en calle Tomás Heredia','Gilmar Consulting Inmobiliario vende este apartamento de lujo situado en una de las mejores zonas de la ciudad, en el barrio del Soho, en una de sus calles principales, zona totalmente peatonal, ajena al trafico, y a escasos metros tanto de la Alameda Principal y Centro Histórico como de la zona del Muelle Uno y Plaza de la Marina, todo un capricho para personas que buscan la mejor localización.<br><br>El edificio que data del año 1.900, de corte emblemático, se encuentra en perfecto estado de conservación y cuenta con ascensor.<br><br>La vivienda que tiene una superficie construida de 75 metros cuadrados, a sido rehabilitada por completo, cambiando su configuración original dejando un inmueble totalmente convertido. En la actualidad dispone de un gran salón con 2 bonitos balcones que dan a la calle, se le integra a esta pieza la cocina que esta totalmente amueblada y que dispone de zona de office, cuenta con un gran dormitorio con armarios empotrados, baño completo y por ultimo y como pieza esencial de la vivienda dispone de un precioso patio para el uso y disfrute de momentos especiales.<br><br>Estado de conservación de revista, es un inmueble de lujo con calidades de primera, todo primeras marcas.<br><br>Este inmueble esta muy enfocado para clientes que buscan vivienda para disfrutar como segunda residencia o bien para clientes que buscan altas rentabilidades mediante el alquiler, bien en formato de larga duración o bien mediante el modo turístico. <br><br>En Gilmar trabajamos para ofrecer a nuestros clientes los mejores inmuebles desde hace 37 años. Cubrimos todas las necesidades inmobiliarias: viviendas, oficinas, locales comerciales, solares, fincas rusticas, terrenos para construir.. .<br>Disponemos de más de 30 equipos especializados en distintas zonas al servicio de más de 90.000 clientes nacionales e internacionales, que cuentan con asesoramiento necesario para garantizar su seguridad, eficacia jurídica y la mejor rentabilidad financiero-fiscal.<br>Visita nuestra web y encontraras 4.000 oportunidades más.<br>Gilmar dispone de excelentes oportunidades de inversión en rentabilidad. Consúltanos.',1,1,'36.7150725,-4.4231754',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>75 m² construidos</li> <li>1 habitación</li> <li>1 baño</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur</li> <li>Construido en 1900</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor',NULL,NULL),
 (294,13,NULL,293,233,1200000,'Calle Pacífico','29001','venta','piso','Piso en venta en calle Pacífico','Gilmar Consulting Inmobiliario Málaga vende este fantástico ático situado en la zona con mas recorrido y proyección de la ciudad de Málaga, su nueva Milla de Oro, dentro del Distrito de la Carretera de Cádiz, barrio de Paseo Marítimo Oeste - Pacifico, en la misma playa de la Misericordia, primerísima línea de playa, a escasos 50 metros.<br>Edificio de reciente construcción en perfecto estado de conservación que cuenta con plaza de garaje y cuarto trastero.<br>La vivienda dispone de unos 160 m2 aproximadamente y se distribuye en 3 amplios dormitorios con armarios empotrados, 2 cuartos de baño completos, salón independiente de unos 30 m2 aprox. con acceso a terraza de unos 15 m2, y cocina amueblada con tendedero. Mediante una escalera se accede a la terraza superior donde dispone de otra gran terraza de unos 70 m2 con cenador con todos los servicios de cocina, barbacoa, fregadero, iluminación, etc.<br>Excelente calidades con suelos en mármol, puertas de madera, ventanas de climalit con rotura de puente térmico, aire acondicionado con calor y frio por conducto, etc... Una de las mejores vistas de la cuidad de Málaga con el manto del mar delante.<br><br>En Gilmar trabajamos para ofrecer a nuestros clientes los mejores inmuebles desde hace 37 años. Cubrimos todas las necesidades inmobiliarias: viviendas, oficinas, locales comerciales, solares, fincas rusticas, terrenos para construir.. .<br>Disponemos de más de 30 equipos especializados en distintas zonas al servicio de más de 90.000 clientes nacionales e internacionales, que cuentan con asesoramiento necesario para garantizar su seguridad, eficacia jurídica y la mejor rentabilidad financiero-fiscal.<br>Visita nuestra web y encontraras 4.000 oportunidades más.<br>Gilmar dispone de excelentes oportunidades de inversión en rentabilidad. Consúltanos.',3,2,'36.6914774,-4.4408157',' <div class="details-property-feature-one