 (305,13,NULL,304,78,115000,'Girón - Las Delicias - Pacífico','29018','venta','piso','Piso en venta en Girón - Las Delicias - Pacífico','Piso en VENTA y ALQUILER CON OPCIÓN A COMPRA en Barriada Girón.<br><br>78 metros muy bien distribuidos en cocina abierta, salón comedor con balcón incorporado orientado al Sur, 3 dormitorios (2 de ellos mirando al Sur) baño amplio reformado muy bonito con ducha y ventana.<br><br>Vivienda muy luminosa y para entrar a vivir.<br><br>Lo único que hay que mejorar es la carpintería interior.<br><br>Situada en una barriada muy tranquila, a 7 minutos andando al paseo marítimo, con todo lo que necesite al alcance y numerosos medios de transporte alrededor (autobuses, metro, taxi, tren cercanía)<br><br>CONDICIONES DE ALQUILER CON OPCIÓN A COMPRA:<br><br>120.000€, 2 AÑOS, 500€ consulte condiciones sin compromiso.<br><br>¡Visítalo sin compromiso!<br><br>Somos una agencia especializada en la venta de inmuebles en Málaga con mas de 19 años de experiencia. Además te ayudamos a conseguir financiación, no dudes en consultarnos.<br><br>En cumplimiento del decreto de la junta de Andalucía 2182005 del 11 de octubre, se informa al cliente que los gastos notariales, registrales, itp, intermediación inmobiliaria no están incluidos en el precio<br><br>Estaremos encantados de atenderte personalmente en C/ Héroe de Sostoa, 192 (esquina con Av de la Paloma).<br><br>Horario de atención al cliente:<br>Lunes a viernes de 10:00 a 14:00 y de 17:00 a 20:00 horas.<br>Sábados de 10:00 a 14:00 horas (Con cita previa)<br><br>Si esta vivienda no es lo que estas buscando, contáctanos y nos encargaremos de hacerte una búsqueda totalmente personalizada adaptándonos a tus necesidades sin compromiso.<br><br>wwww. inmobiliarialucia. com<br><br>Lucía Gestión Inmobiliaria S. L.',3,1,'36.7011513,-4.4404457',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>78 m² con