 (306,13,NULL,306,300,560000,'Calle Sendero del Parque','29014','venta','casa o chalet','Casa o chalet independiente en venta en calle Sendero del Parque','Home Group<br><br>Fantástico chalet independiente con terreno de 950 metros cuadrados en Cerrado de Calderón, la casa dispone de 280 metros construidos en dos plantas,<br>Planta Baja: Amplio salón-comedor independiente, cocina office independiente y equipada con lavadero, baño completo, dos salidas al porche y al jardín, una por la cocina y otra por el salón. Dispone también de un aseo exterior y un jardín privado con árboles frutales.<br><br>Primera Planta: 5 dormitorios muy amplios con armarios empotrados, 2 baños completos, una terraza con vistas despejadas a la que se accede desde el dormitorio principal.<br><br>En cuanto a las calidades, la solería es de tarima flotante y mármol oscuro, los cierres son de aluminio. También tiene chimenea en el salón y en el dormitorio principal. Un porche y un gran patio donde podrás disfrutar de la compañía de tus familiares y amigos al aire libre. La casa es muy luminosa y soleada.<br><br>Dispone de un garaje para dos coches.<br><br>Ubicado en la zona de Cerrado de Calderón muy cerca del Liceo Francés, del colegio Cerrado de Calderón. A tres minutos del centro comercial Next donde tendrás farmacia, cafetería, restaurantes, supermercados. Parada de bús línea 33.<br>Muy buena conexión a la autovía AP-7.<br><br>¡No dude en contactar con nosotros para visitarlo sin compromiso!<br><br>Home Group.',5,2,'36.7335248,-4.3814412',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>300 m² construidos, 280 m² útiles</li> <li>5 habitaciones</li> <li>3 baños</li> <li>Parcela de 950 m²</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Certificación energét