 (318,13,NULL,311,64,189500,'Calle Granados','29006','venta','piso','Piso en venta en calle Granados','PLENO CENTRO HISTÓRICO, 3ª PLANTA CON ASCENSOR. En plena Zona 1 del Casco Histórico de Málaga, esta vivienda reúne las condiciones idóneas de ubicación para su 1ª o 2ª residencia en el Centro Histórico de Málaga. Con una superficie de 87 m2 construidos, la vivienda se distribuye en un muy luminoso salón Comedor, 2 Dormitorios, con un gran armario empotrado de cerca de 4 mts. Cocina independiente amueblada y un baño con ducha totalmente actualizado. Realmente muy luminoso y sin ruidos del exterior, perfecto para su proyecto de vida en Málaga. Garaje opcional “para gran vehículo” en el mismo edificio. Zona muy representativa del Casco antiguo de la ciudad, a escasos pasos de la Catedral de Málaga. A 200mts de radio tenemos el Paseo del Parque, el Museo Picasso, la calle Larios, el Museo Thyssen, restaurantes, colegios, etc.. . No dude en llamarnos para mas información o vivistas a la propiedad. Gracias.<br>&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt;&gt; En cumplimiento del Decreto de la Junta de Andalucía 218/2005 del 11 de Octubre, informamos que el Impuesto de Transmisiones Patrimoniales y los gastos de Notaría y Registro regulados por arancel no están incluidos en el precio. Si están incluidos los honorarios profesionales de Agencia. Contamos en nuestro equipo con Abogado (Colegiado 6208), Administrador de Fincas (Colegiado 2307) y Agente de la Propiedad Inmobiliaria (Colegiado 813) que le asesorará en todo el proceso de compra. We Speak English. On Parle FranÇais.',2,1,'36.7245523,-4.4215356',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>64 m² construidos, 60 m² útiles</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Orientación sur, este</li