 (331,13,NULL,37,400,3800,'Calle Poeta Arolas, 12','29002','alquiler','piso','Alquiler de Piso en calle Poeta Arolas, 12','Propify te presenta esta vivienda. Olvídate de las altas comisiones de las agencias inmobiliarias.<br>Impresionante piso sin amueblar, de nueva construcción en una exclusiva urbanización de solo 4 casas. <br><br>El piso, de techos altos y primeras calidades, tiene 2 plantas. En la planta principal cuenta con un amplio hall, que da acceso a un gran salón con salida a una magnífica terraza de 50 m2 con maravillosas vistas al mar, que tiene una gran parte cubierta y otra descubierta, pudiendo salir directamente desde la habitación principal y comedor.<br>Cocina independiente con electrodomésticos.<br>Tres amplios dormitorios cada uno con cuarto de baño privado.<br>Además, en la misma planta cuenta con un gran comedor y un aseo para invitados.<br>En la planta inferior, cuenta con 3 espacios disponibles y un cuarto de baño.<br>Cada una de esas habitaciones se podría utilizar como gimnasio, dormitorios, bodega, trastero interior, cuarto de juegos.. . con un sin fin de utilidades.<br><br>Además, la casa cuenta con tres plazas de garaje, un trastero en el garaje, piscina y un espectacular jardín.<br><br>Aire acondicionado individual en cada una de las estancias, totalmente domotizado.<br><br>IMPORTANTE: SE ALQUILA SIN AMUEBLAR.<br>Primer mes de alquiler: 3,800€<br>Fianza: 7,600€<br>Gastos administrativos: 1,459€ (sin iva)<br>Sin ningún coste o sorpresa adicional<br><br>Sobre Nosotros:<br>Propify es la plataforma qué digitaliza el alquiler entre inquilinos y propietarios ahorrando hasta el 68% de las comisiones de las agencias inmobiliarias.',5,5,'36.72726,-4.39513',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>400 m² construidos</li> <li>5 habitaciones</li> <li>5 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Cocina equipada y casa sin amueblar</li> <li>Calefacción central</li> <li>Certificación energética: <span title="a" class="icon-energy-c-2"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'exterior con ascensor','Garaje incluido',NULL),
