 (356,5,NULL,354,70,650,'Calle Institución Libre de Enseñanza, 1','30001','alquiler','piso','Alquiler de Piso en calle Institución Libre de Enseñanza, 1','Moderna y amplia vivienda de 2 dormitorios ubicada en zona de Juan Carlos I Zig-Zag, a la altura del nuevo Mercadona y la nueva Hacienda, en la calle Institución <br>Libre de Enseñanza. La zona cuenta con numerosas zonas verdes (el edificio se encuentra a pie de un gran jardín) toda clase de servicios, parada de tranvía y buena conexión con nudos de comunicaciones.<br><br>La vivienda es toda exterior lo que la hace muy luminosa y se ha adecuado con un robusto doble acristalamiento.<br><br>La estancia del salón es muy amplia contando con dos zona diferenciadas: zona de relax amueblada con sofá y zona de comedor equipada con mesa y sillas al efecto. Al balcón terraza se accede desde el propio salón, a través de una doble puerta corredera que dota a la estancia de excelente luminosidad y privilegiadas vistas al jardín ubicado inmediato al edificio.<br>Un detalle a destacar es que desde el propio salón se puede acceder al baño mediante puerta corredera, teniendo después, una segunda puerta de acceso al baño desde el dormitorio principal.<br>Éste, el dormitorio contiene cama de matrimonio y armario empotrado (vestido en su interior) y tv fijada a pared. El baño está equipado con lavabo encastrado en mueble, inodoro y bañera.<br><br>La segunda habitación cuenta también con un armario empotrado y es perfecta para instalar en ella un despacho, un vestidor o incluso una sala para deporte.<br>La cocina es muy espaciosa, una agradable ventana cumple la doble función de dotarla de extraordinaria luminosidad y ventilación natural, muy importante en una cocina. Decorada en moderno estilo, dispone de electrodomésticos, todos ellos eléctricos.<br>Destacar en el vestíbulo el aprovechamiento del hueco de escalera con un armario extra que siempre es útil para cualquier utilidad.<br><br>El inmueble tiene instalado aire acondicionado frío y calor centralizado.<br>Están incluidos en el precio la plaza de garaje (amplísima) y trastero.<br>Se solicita 1 mes de fianza. <br>El recibo de comunidad de propietarios se encuentra incluida en el precio.<br>Los servicios de suministros, luz, agua, etc. , serán por cuenta del inquilino.<br>¡Ven a verla, te encantará!<br>HONORARIOS DE AGENCIA NO INCLUIDOS.',2,1,'38.0039866,-1.134668',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>70 m² construidos, 60 m² útiles</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación oeste</li> <li>Amueblado y cocina equipada</li> <li>Se admiten mascotas</li> <li>Calefacción individual: Bomba de frío/calor</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor','Garaje incluido',NULL),
