 (361,5,NULL,361,65,700,'Calle San Antón, 31','30003','alquiler','piso','Alquiler de Piso en calle San Antón, 31','Incluida la Comunidad y el AGUA. Reformado. Edificio con Piscina y Servicio de Portería. Muy tranquilo y accesible al centro andando. Servicios de autobús, supermercados, farmacia,.. . todo a menos de 30 metros. EL PISO: Tarima AC5. Todas las luces son Led integradas en techo. COCINA: encimera de Silestone de 3,5 m y frontal en cristal. Campana integrada de 750 m3, fregador integrado 50x40 plus, grifo Teka, lavavajillas Balay 45 cm en acero, frigorífico Samsung acero, microondas Candy integrado en acero, horno Baly acero con guías telescópicas y mandos escamoteables, vitro Balay de 3 zonas con frontal biselado. Gran despensa (160x60x220). LAVADERO: muy amplio, lavadora 8Kg 1200 rpm, termo eléctrico 80 litros). UN Dormitorio: (armario enorme de 3 módulos, cama 150x190, mesa para trabajar fijada a pared y preparada para cableado, aire acondicionado Fujitsu). SALON: 3 metros de ventanales, mesa extensible hasta desde 0,9 hasta 2 metros, sofá-chaise longe cama con arcón, TV Philips 42", varias mesas en cristal, sillas tower, aire acondicionado fujitsu y librería con puertas cristal Billy), ASEO amplio: plato de ducha Fiori 120x80 (carga mineral, no plástico), con mampara cristal, convector oscilante y mando a distancia, estantería de ordenación, extractor aire, luces led en espejo, lavabo de 80 cm). TERRAZA: 10 m, da a la calle, cerramiento de cristal (cristal simple), suelo de césped artificial de 20 mm. Alquiler declarado. Estaremos siempre pendientes de que te encuentres confortable en el piso, interviniendo rápidamente si algo falla o se deteriora. Piso Asegurado. Alquila particular.',1,1,'37.9915732,-1.1411656',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>65 m² construidos, 60 m² útiles</li> <li>1 habitación</li> <li>1 baño</li> <li>Te