 (384,5,NULL,383,253,395000,'Calle Sierra de Cazorla','30004','venta','casa o chalet','Casa o chalet independiente en venta en calle Sierra de Cazorla','IMAGINA TU NUEVA VIDA. en una espectacular urbanización a un paso de Murcia y junto a los centros comerciales.<br> <br> ¿ Quieres vivir en la zona Norte de Murcia en un entorno tranquilo y vigilado 24 hrs al día?<br> <br> Crea el hogar que siempre has soñado en este fantástico chalet independiente con acabados de lujo en la urbanización <br> <br> Montepinar. Cuenta con suelos de madera, mármol travertino en las escaleras, pintura lisa, calefacción por caldera, A/A por <br> <br> conductos, terraza en planta alta de 60 m2, 4 dormitorios, 3 baños, 1 aseo, cocina amueblada con galería, sótano de 100 m2, <br> <br> garaje y trastero.<br> <br> La vivienda es toda exterior, lo que hace que sea muy luminosa.<br> <br> En el jardín encontramos la piscina, zonas exteriores para aprovechar el fantástico clima de nuestra zona, solo o en la mejor <br> <br> compañía.<br> <br> Visita y conoce en persona todas las virtudes de esta vivienda única, no te dejará indiferente. ¡ Llámanos!<br> <br> Comercializamos este inmueble en exclusiva por mandato expreso del propietario, lo que garantiza un servicio de calidad sin <br> <br> interferencias de terceros. Como comprador, te vamos a ayudar, en caso de interés, en todo el proceso y te vamos a facilitar <br> <br> toda la información y documentación que precises.<br> <br> <br> *Gastos de compra - venta y honorarios de agencia no incluidos en el precio de venta. *.',4,2,'38.0392349,-1.0953956',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>253 m² construidos, 190 m² útiles</li> <li>4 habitaciones</li> <li>4 baños</li> <li>Parcela de 550 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/