 (413,8,NULL,412,113,275000,'Son Espanyolet','07004','venta','piso','Piso en venta en Son Espanyolet','BALEARIC GRUP Piso en la demandada zona Son Damento ( zona colegios ), es un primer piso de 113 metros muy tranquilo con vistas despejadas y muy luminoso, todas las estancias son exteriores.<br>la vivienda consta de:<br>2 habitaciones dobles <br>1 habitación individual. <br>2 baños, uno de ellos en suite principal. <br>Cocina independiente amueblada y equipada con electrodomésticos de alta gama.<br>Lavadero/ coladuría completamente equipada <br>Salón comedor con salida a un balcón<br><br>Acceso para personas con movilidad reducida. <br>Ubicado en una calle sin tránsito, muy tranquila, rodeado de supermercados, restaurantes, transporte público, centros de salud, parques.. .<br><br>Finca de pocos y buenos vecinos, solo dos viviendas por planta, moderna y sólida construcción, cuenta con descalificador de agua.<br>Cada metro ha sido aprovechado al máximo mediante armarios empotrados de alta calidad y gran funcionalidad en toda la vivienda.<br>La finca de pocos vecinos pocos gastos de comunidad <br><br>PARKING EN GARAJE Y TRASTERO INCLUIDO EN EL PRECIO<br><br>FINANCIACION 100% SIN COMISIONES<br>ASESOR FINANCIERO AUTORIZADO ING GRATUITO UNICA INMOBILIARIA EN PALMA AUTORIZADA PARA LA GESTION DE HIPOTECA ING SIN COMISIONES, TASACIONES PROPIAS. <br><br>LLAMA 601174185 VIVIENDA 678450251 TASACION E HIPOTECA[IW].',3,2,'39.5791016,2.627114',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>113 m² construidos, 98 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur, este</li> <li>Construido en 2004</li> <li>Calefacción individual: Eléctrica</li> <li>Certificación energética: <span title="f" class="ico