 (415,8,NULL,415,76,280000,'Avenida Mèxic','07012','venta','piso','Piso en venta en avenida Mèxic','Calidad, confort y sostenibilidad describen esta innovadora vivienda. <br> <br> Descubre con nosotros esta propiedad única en Palma.<br> <br> Ubicada dentro de una excelente promoción de obra nueva en la zona del Nou Llevant, se trata de una de las zonas con más proyección para los próximos años, donde la inversión será garantizada, además de contar con la cercanía del inspirador y fantástico Paseo Marítimo de Palma.<br> <br> Esta vivienda de consta de 67 m2, 2 habitaciones y dos baños. Además, cuenta con una amplia terraza de caso 10 m2, perfecta para desconectar de las obligaciones del día a día. <br> <br> En la comodidad de tu nuevo hogar, contarás con la placidez que ofrece una vivienda creada y diseñada especialmente para adaptarse a un nuevo modo de vida, más sostenible y respetuoso con el medio ambiente.<br> <br> La promoción tiene aerotermia centralizada que permite un alto nivel de eficiencia. Se trata de una energía renovable que destaca por ser uno de los sistemas más eficientes para producir calefacción refrigeración y agua caliente sanitaria en una vivienda. El consumo es muy bajo, y aunque el precio del Kw/h eléctrico es alto, la factura mensual para la calefacción o la climatización se reduce considerablemente respecto al gas.<br> <br> También cuenta con instalación de sistema de ventilación mecánica doble flujo, permitiendo mejorar la calidad del aire interior. En este sistema de ventilación se realizan tanto la aportación como la extracción de aire de manera mecánica y se incorpora al sistema un recuperador de calor que permite ceder parte de la energía contenida en el aire de extracción al de impulsión. De esta manera podemos ahorrar energía térmica tanto en invierno como en verano.<br> <br> Para completar las cualidades de esta vivienda, dispondrás de piscinas comunitarias exteriores en planta cubierta con zona de solárium y tratamiento de electrólisis salina y zonas ajardinadas y juegos de niños.<br> <br> El edificio cuenta con un garaje independizado con acceso de vehículos con<br> puerta automatizada accionable mediante mando a distancia al que podrás acceder al directamente desde el ascensor, a través de vestíbulos de independencia.<br> <br> Por último y cuidando hasta el último de los detalles, el edificio dispone de una previsión de pre-instalación de recarga de vehículos eléctricos según normativas.<br> <br> ¿Deseas más información? No dudes en contactarnos. Como siempre, estaremos encantados de atenderte.',2,2,'39.5650049,2.6643938',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>76 m² construidos, 67 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación sur, este</li> <li>Construido en 2021</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="a" class="icon-energy-c-2"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Bajo exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'Bajo exterior con ascensor',NULL,NULL),
