 (419,8,NULL,419,750,6500000,'Biniacaubell, 10','07001','venta','casa o chalet','Casa o chalet independiente en venta en Biniacaubell, 10','Impresionante villa de nueva construcción de estilo moderno en la urbanización de Son Vida, con bonitas vistas al campo de golf, al castillo de Bellver y al mar. La vivienda cuenta con una zona plana de jardín ideal para familias con niños. <br><br>Espectacular villa en un lugar privilegiado como es el Golf Son Vida, con privacidad total a pocos kilómetros de Palma, puertos, campos de golf, playas y el aeropuerto. Esta villa moderna se va a construir con materiales de alta gama. La propiedad comprende espacios abiertos, techos altos y una perfecta combinación de diseño contemporáneo con elementos tradicionales. Esta propiedad impresionante está distribuida en dos plantas, que se pueden acceder mediante ascensor. En la planta baja está el dormitorio principal con vestidor y baño en suite, así como una salida a la terraza. Además hay 2 dormitorios adicionales con baños en suite, un salón y un aseo. Todas las habitaciones ofrecen salida a la terraza. Se entra a la casa desde la primera planta donde nos encontramos con el salón, la gran cocina, un aseo y otro dormitorio adicional con baño en suite y vestidor. Además cuenta con una piscina interior, sauna, bodega, gimnasio, sala de cine y garaje con espacio para 3 coches. La propiedad está rodeada de un bonito jardín con palmeras y amplias terrazas. Además cuenta con una amplia piscina con cascada. MallorcaSite, su agencia inmobiliaria en Mallorca, le recomienda esta propiedad por estar excelentemente ubicada, en primera línea de golf, por las vistas, por la privacidad, por el estilo de la casa, por estar construida con materiales de alta gama.<br><br>Extras<br>Piscina privada / Jardín / Vistas despejadas / Terraza / Spa / Zona de invitados / con bodega / Gimnasio / Aire acondicionado / calefacción por suelo radiante / chimenea / ventanas con doble cristal / camaras de seguridad / Descalcificador de agua / Garaje / Domotica / apartamento privado / sala de cine / piscina interior / Trastero / Ascensor.',5,2,'39.5952328,2.5819773',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>3 plantas</li> <li>750 m² construidos</li> <li>5 habitaciones</li> <li>7 baños</li> <li>Parcela de 2.120 m²</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur</li> <li>Construido en 2020</li> <li>Calefacción individual</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (420,8,NULL,420,166,998000,'Pere Garau','07004','venta','ático','Ático en venta en Pere Garau','Este excepcional ático de obra nueva a estrenar, ha sido concebido como un lugar moderno y acogedor que permite disfrutar de una vida cómoda en todos y cada uno de sus espacios, tanto interiores como exteriores.<br> <br> Ubicado en pleno centro neurálgico de Palma, este contemporáneo ático forma parte de un innovador complejo residencial de reciente construcción con un edificio donde además de la arquitectura de vanguardia, se pone de relieve la luminosidad, el diseño en cada uno de los ambientes y como factor clave del proyecto, lograr la máxima eficiencia energética. <br> <br> Se encuentra situado en la 6ª planta de la construcción y es uno de los dos únicos que quedan disponibles. Cuenta con una superficie de 166m2 llevados a cabo con las mejores calidades y con una solución estética donde el blanco es el protagonista absoluto creando una atmósfera limpia, moderna y completamente luminosa.<br> <br> Dispone de 27m2 de terrazas techadas y una amplia azotea-solarium de 55m2 con jacuzzi, barbacoa y área de salón-comedor como un paraíso privado donde disfrutar en tumbonas a pleno sol y descansar al aire libre. Ha sido distribuido en 3 dormitorios y 2 baños completos. El dormitorio principal dispone de amplia área de vestidor y baño en suite. La zona abierta de salón-comedor y cocina equipada con muebles diseñados para que queden integrados en el conjunto disfruta de una gran fachada acristalada de suelo a techo que permite que el interior sea inundado por una gran entrada de luz natural y nos da acceso a una amplia terraza.<br> <br> La exclusiva vivienda viene con plaza de garaje y trastero y el complejo en el que se halla dispone de todas las comodidades, con zona wellness, spa, baño turco y gran piscina rodeada de zona de hamacas.<br> <br> El hogar perfecto para disfrutar durante todo el año. <br> <br> <br> CARACTERÍSTICAS:<br> -Aire acondicionado frío/calor, calefacción gas vía radiadores, suelos de gres porcelánico, carpintería exterior con aislamiento acústico y térmico, video portero.<br> -Cocina integrada equipada.<br> -Terrazas, solárium, jacuzzi, lavandería, piscina comunitaria, gimnasio, spa, baño turco.<br> -Hall VIP de entrada a la planta áticos.<br> -Plaza de garaje, trastero.<br> <br> UBICACIÓN:<br> -Zona centro de Palma, rodeado de tiendas, restaurantes, centro comercial y todos los servicios, a 5min. del casco histórico, a 5 min. de la playa.',3,2,'39.5745478,2.6598612',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>166 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Calefacción individual</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 6ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'6ª planta exterior con ascensor','Garaje incluido',NULL),
