 (422,8,NULL,422,184,379000,'Calle de Josep Darder Metge','07013','venta','dúplex','Dúplex en venta en calle de Josep Darder Metge','Piso Dúplex con parking incluido en Josep Darder Metge, Palma de Mallorca<br><br>Vivienda totalmente reformada.<br><br>Fantástico Piso Dúplex en calle Josep Darder Metge, a pocos minutos de la Calle Balmes y calle Aragón, destacando por sus estancias muy amplias y por su gran luminosidad, muy bien comunicado, con todos los servicios a su alcance, es el 5º piso de una finca muy bien conservada con ascensor.<br><br>Esta estupenda propiedad inmobiliaria consta de 140 m2 útiles distribuidos en dos plantas:<br><br>En la planta baja encontramos un espacio abierto de más 60 m2 donde tenemos el salón comedor de 30 m2 con salida al balcón, cocina office de 20 m2 con coladuría y 1 aseo.<br><br>Mediante una escalera, muy amplia, con carácter y cómoda de subir, llegamos a la planta piso, donde están los 4 dormitorios, todos ellos dobles y 2 baños.<br><br>Otras características a destacar: 2 armarios empotrados y 3 armarios hechos a medida, ventanas de PVC con climalit imitación madera, persianas mallorquinas de aluminio, calefacción por radiadores de gas ciudad en toda la casa y 4 splits de aire acondicionado frío/calor (en salón, cocina y 2 dormitorios), gas ciudad, suelo laminado y gres. Fontanería y electricidad renovada. <br><br>Además incluye 1 plaza de PARKING en la misma finca (el ascensor llega al garaje).<br><br>Amplitud, comodidad, luminosidad y listo para entrar a vivir.<br><br>¿Qué más se puede pedir? Ven a visitarlo.<br><br>Ref: P3702.',4,3,'39.5770611,2.6670244',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>184 m² construidos, 173 m² útiles</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación norte, este</li> <li>Construido en 1978</li> <li>Calefacción central: Gas</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'5ª planta exterior con ascensor','Garaje incluido',NULL),
