 (424,8,NULL,412,117,365000,'Les Maravelles','07006','venta','piso','Piso en venta en Les Maravelles','Tercer piso en Residencial, Can pastilla las Maravelles a dos minutos andando de la playa de Palma: ( mejor ver tour virtual)<br><br>El salón-comedor con acceso a una terraza 15 metros aproximadamente te permitirá disfrutar del clima mediterráneo soleado, durante muchos meses al año y con vistas al MAR.<br>De las tres habitaciones, una de ellas es en Suite. Las otras dos comparten otro baño completo. Todas disponen de armarios empotrados totalmente vestidos y distribuidos.<br>La cocina totalmente equipada con muebles altos y bajos también cuenta con vitro cerámica, horno y, campana extractora. Desde la cocina accedes a lavaderia muy amplia.<br><br>Todos los materiales son de altas calidades, igual que el toldo de la terraza que es eléctrico <br>Puerta de seguridad, portería interior en roble, pintura lisa en paredes, tomas de TV y Teléfono en toda la casa, ( incluida la cocina), acristalamiento en barandillas exteriores con vidrios de seguridad, carpintería exterior de aluminio lacado con vidrio climalit, aire acondicionado frío/calor en toda la casa regulado regulado a través de termostato de ambiente en el salón.<br><br>El edificio cuenta con un amplio garaje, con acceso directo.<br>La urbanización dispone de dos piscinas, zona común ajardinada y, zona infantil de juegos.<br><br>FIANCIACION 90% ING<br><br>VER TOU VIRTUAL[IW].',3,2,'39.5272413,2.7337082',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>117 m² construidos, 93 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur, este</li> <li>Construido en 2009</li> <li>Certificación energética: <span title="f" class="icon-energy-c-7"></