 (440,8,NULL,438,888,4400000,'Son Vida','07015','venta','casa o chalet','Casa o chalet en venta en Son Vida','Esta elegante villa mediterránea se encuentra en la codiciada y tranquila zona residencial de Son Vida en una parcela de 6.556m2, que actualmente es una de las parcelas más grandes de Son Vida.<br><br>Una hermosa avenida de palmeras lleva a la increíble propiedad, que está enmarcada por jardines maravillosos.<br><br>La superficie habitable de 740m2 se distribuye en tres niveles:<br><br>La gran entrada principal le lleva al amplio y luminoso salón comedor con chimenea y acceso a las diversas terrazas y magníficos jardines. Detrás del comedor se encuentra la moderna cocina totalmente amueblada y una coladuria con aseo de invitados. Este mismo nivel cuenta con el dormitorio principal con vestidor y baño en suite.<br><br>En el sótano se accede a la elegante zona de bienestar con una larga piscina interior, un jacuzzi y una sauna seca y de vapor, todo con vistas a la maravillosa zona exterior y un amplio acceso a la terraza. Este nivel también cuenta con una bodega con aire acondicionado construida en la roca con un área de degustación tradicional y aislada. Además hay dos dormitorios dobles con baño en suite.<br><br>La planta superior de 64m² está diseñada como oficina y también da acceso a una gran terraza con bonitas vistas sobre Palma y la bahía.<br><br>En la entrada de la propiedad hay una cómoda casa de invitados con un dormitorio con baño en suite, salón y cocina.',5,2,'39.5908953,2.5893498',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet</li> <li>888 m² construidos, 740 m² útiles</li> <li>5 habitaciones</li> <li>5 baños</li> <li>Parcela de 6.556 m²</li> <li>Plaza de garaje incluida en el precio</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
