 (442,8,NULL,442,90,1200,'Sta Catalina - El Jonquet','07011','alquiler','dúplex','Alquiler de Dúplex en Sta Catalina - El Jonquet',NULL,3,1,'39.5713796,2.639822',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>90 m² construidos</li> <li>3 habitaciones</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Orientación sur</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª interior </li> <li> sin ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta interior sin ascensor',NULL,NULL),
 (443,8,NULL,443,280,2100,'Finca rústica  S''Aranjassa - Es Pil.larí','07003','alquiler','finca rústica','Alquiler de Finca rústica en S''Aranjassa - Es Pil.larí','Se alquila 1°piso de una casa rustica de 2 plantas y con 7200 metros de terreno, piscina muy grande y jardines alrededor de toda la casa. Y seguridad presencial ya que es una urbanizacion privada.<br>En la planta baja habita el propietario de esta preciosa rustica.<br>La entrada al 1°piso es independiente con unas escaleras, con lo cual no molestamos a nadien ni para entrar ni para salir.<br>La descripcion de este piso es un recibidor, un salon comedor con salida a una preciosa terraza con unas vistas espectaculares, cocina amueblada y equipada, 1 baño de invitados. El dormitorio principal tiene 20 metros y un baño grande y luego tenemos 3 dormitorios mas, todos con armarios empotrados y aire acondicionado de frio y calor por conductos para todo el piso, con lo cual no hay problema ni de frio en invierno ni de calor en verano.<br>Tambien tenemos television y wifi y netflix.<br>Hay tambien una barbacoa ideal para poder torrar, sobre todo los fines de semana.<br>Los gastos de mantenimiento de piscina jardines y terreno van a cuenta del propietario.<br>El inquilino solo tiene que pagar la electricidad y la parte proporcional una vez al año del ibi.<br>Contrato minimo de 6 meses y si es mas de 1 año se estudiara segun candidatos.<br>Esta rustica esta a tan solo 10 minutos del aeropuerto y a 15 de palma centro.<br>Personas interesadas con trabajo fijo y nominas actuales.',4,2,'39.5396588,2.7737058',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Finca rústica</li> <li>280 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Parcela de 7.200 m²</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur</li> <li>Amueblado y cocina equipada</li> <li>Calefacción central</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
