 (471,9,NULL,471,62,700,'General Vives, 90','35012','alquiler','piso','Alquiler de Piso en General Vives, 90','Fantástico apartamento en el corazón de la ciudad de Las Palmas de Gran Canaria con vistas al mar y al parque de Santa Catalina.<br><br>Ubicado en la 6ª planta del edificio, se distribuye en un dormitorio independiente con baño incorporado, un amplio salón y cocina abierta a la zona de comedor.<br><br>Cuenta con todo lo necesario para entrar a vivir. El salón dispone de chaise longe convertible en cama, televisión de 50” y altavoz para iphone. El baño tiene plato de ducha y armario empotrado. La cocina está equipada con nevera, microondas, placa, extractor y lavavajillas. Además de pequeños electrodomésticos; cafetera, exprimidor, plancha, tostadora y secador de pelo y lavadora en el baño.<br><br>Muy luminoso, con grandes ventanales y espectaculares vistas. La situación es inmejorable ya que la zona cuenta con todos los servicios; supermercados, farmacias, parada de guaguas y taxis, cafeterías y restaurantes.<br><br>Enclavado en el mismo parque de Santa Catalina, a escasos metros tanto de la Playa de las Canteras (el lugar ideal para disfrutar del mar, dar largos paseos, hacer deporte.. . ) como de el Centro Comercial el Muelle, el Acuario Poema del Mar, el Museo Elder y el intercambiador de guaguas (En el intercambiador se concentran las paradas terminales de una gran parte de las líneas de guaguas que circulan por la isla. El núcleo concentra líneas que realizan trayectos urbanos por la ciudad. También acoge las líneas interurbanas con destino al sur de la isla, Playa del Inglés, Maspalomas, Puerto Rico y Mogán, así como destinos intermedios como el aeropuerto, Centro Comercial Las Terrazas, Alcampo, Telde, Vecindario, etc. ) A 10 minutos a pie del Corte Inglés y la zona comercial de Mesa y López.<br><br>Un mes de intermediación inmobiliaria.<br>Un mes de fianza.<br>Gastos de agua y luz aparte.<br>Comunidad incluida.',1,1,'28.1410913,-15.4314053',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>62 m² construidos, 54 m² útiles</li> <li>1 habitación</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Construido en 1976</li> <li>Amueblado y cocina equipada</li> <li>Se admiten mascotas</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 6ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'6ª planta exterior con ascensor',NULL,NULL),
