 (491,9,NULL,491,90,900,'DOCTOR GRAU BASSAS','35016','alquiler','piso','Alquiler de Piso en DOCTOR GRAU BASSAS','Situada a muy pocos metros del paseo de Las Canteras y de su maravillosa y excepcional playa, esta vivienda esta en una de las zonas más demandadas de Las Palmas de Gran Canaria. En su entorno más próximo cuenta con todo tipo de servicios de primera necesidad, supermercados, restauración y ocio (Poema del Mar), colegios, centros comerciales (El Muelle), hospital (Perpetuo Socorro) y próxima a la zona comercial y de ocio de Mesa y López y apenas a unos minutos paseando del centro comercial Las Arenas.<br><br>Su estratégica ubicación posibilita desplazarse caminando a la totalidad del área Canteras-Guanarteme-Mesa y López-Alcaravaneras-Ciudad Jardín. Prácticamente recorrer toda la ciudad caminando. O si lo prefiere, en bicicleta o transporte público. Toda una apuesta por la sostenibilidad.<br><br>Ubicada en un edificio con pocos años de construcción, la vivienda dispone en sus 90 m2 de dos amplias habitaciones exteriores con armarios empotrados, dos baño completo, salón comedor independiente, cocina y solana con todo los electrodomésticos incluye lavavajillas. En cuanto a sus características, disfruta de una elegante luminosidad natural y dispone de preinstalación para aire acondicionado centralizado en la vivienda y ventanas oscilobatientes con acristalamiento optimizado.<br><br>El edificio cuenta con ascensor, placas solares plazas de aparcamiento.<br><br>La presente oferta, formulada con base en los datos ofrecidos por terceros que se presuponen correctos, tiene carácter meramente informativo. La oferta esta sujeta a errores u omisión, cambios de precio, y / o cese de disponibilidad del mercado sin previo aviso. Queda prohibida la reproducción total o parcial de esta publicación sin la autorización expresa de ABMG INVESTMENTS. <br>Precio<br>900 €/mes.',2,2,'28.1396664,-15.4367413',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>90 m² construidos, 80 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación norte, oeste</li> <li>Amueblado y cocina equipada</li> <li>No dispone de calefacción</li> <li>Certificación energética: <span title="g" class="icon-energy-c-8"></span> (5500 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'5ª planta exterior con ascensor',NULL,NULL),
