 (501,9,NULL,501,696,1390000,'Santiago Tejera Ossavarry, 3','35017','venta','chalet adosado','Chalet adosado en venta en Santiago Tejera Ossavarry, 3','Magnífica casa de dos plantas en uno de los mejores barrios costeros de la ciudad de Las Palmas de Gran Canaria. Ubicada a la entrada de la ciudad, en la costa este de la ciudad de Las Palmas de Gran Canaria, está el barrio marinero de San Cristóbal, un punto referente en la capital por la pesca y que también destaca por su aspecto pintoresco, tradicional y sencillo. Un barrio que conserva el sabor de antaño, donde se respira la brisa marina y donde podrá disfrutar del simple amanecer. <br>Justo delante de la vivienda podemos contemplar el imponente Torreón de San Pedro Mártir, popularmente conocido como Castillo de San Cristóbal. Fue construido por el gobernador Diego Melgarejo en 1578, dentro del plan integral de fortificación de la ciudad que emprendió el Rey Felipe II de España.<br>La excelente ubicación en primera línea del paseo marítimo hace que desde sus enormes salones y terrazas dominemos las magníficas vistas al mar. <br>Este edificio construido en 2004 consta de 2 alturas y cuenta con un total de 696 m2 construidos. Se distribuye en dos viviendas independientes y un apartamento. Está levantado sobre una parcela de 524 m2. A la planta baja le corresponden 361 m2 y 335 m2 a la planta alta, contando además con una azotea transitable de unos 250 m2 y un patio interior de unos 197 m2 aproximadamente. <br>El edificio está dotado además de un ascensor y caja de escaleras que comunican con todas las plantas y con la azotea. <br>La planta baja cuenta con acceso directo desde el paseo marítimo, consta de un imponente salón comedor de 73 m2 rodeado de ventanales con vistas directas sobre el mar y el castillo, dotándole de una gran luminosidad. Una cocina amplia con solana, 6 dormitorios, 4 baños, un pequeño gimnasio y un cuarto de lavado. En esta misma planta se encuentra además, el patio central de la casa de unos 197 m2. <br>En la planta alta, al igual que ocurre con la baja, podrá deleitarse y disfrutar con las vistas al mar, al castillo y a la Avenida Marítima desde un gran salón comedor de 57 m2 y una terraza de 25 m2 con acristalamiento plegable, donde se podrá disfrutar tomando el sol. Esta planta consta también de 6 dormitorios, 3 baños, cocina y solana. Además de lo anterior, esta planta dispone de un apartamento con acceso independiente de 41 m2 útiles. Tiene una sala de estar, comedor cocina, un dormitorio grande y un baño y bien pudiera utilizarse como vivienda para el servicio, para las visitas o incluso como apartamento para obtener una rentabilidad. <br>Toda la edificación está construida con las mejores calidades, ventanas oscilo-batientes de seguridad, persianas eléctricas, luces graduables, termos de condensación (energía verde) toldos eléctricos y un largo etc. <br>Existen varios encajes para esta propiedad, pudiendo reconvertirlo en pequeño hotel urbano, albergue o alquiler vacacional. Estos dos últimos sin casi inversión. <br>No lo dude, Llámenos y le asesoraremos sin ningún compromiso.',12,6,'28.082493,-15.4163246',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Chalet adosado</li> <li>2 plantas</li> <li>696 m² construidos</li> <li>12 habitaciones</li> <li>8 baños</li> <li>Parcela de 528 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 2004</li> <li>Certificación energética: <span title="c" class="icon-energy-c-4"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
 (502,9,NULL,501,697,1175000,'Casa del Gallo, 8','35002','venta','casa o chalet','Casa o chalet independiente en venta en Casa del Gallo, 8','Gilmar Real Estate te presenta este magnífico chalet en Tafira.<br>Situada en una zona residencial a pocos minutos del centro de la ciudad y con acceso directo a la circunvalación, muy cerca del campus universitario, del Jardín Botánico Viera y Clavijo y a poca distancia de centros deportivos, de equitación, campo de golf y otros muchos servicios de los alrededores (farmacia, centro veterinario, ferretería, restaurantes, etc.)<br>Sus comunicaciones con la autovía son muy cómodas, llegando al centro de la capital en tan sólo 10 minutos y al aeropuerto, en 16 minutos.<br>Ubicada en una parcela de 1050 m2, accedemos a la misma a través de un bonito jardín muy cuidado, rodeado de un sinfín de plantas y árboles como; palmeras, buganvillas, flamboyán, hibiscos, hortensias (flor de mundo) y estrelitzias, entre otros. La vivienda ha sido diseñada y construida por los actuales propietarios. La edificación ha contado con las previsiones necesarias para la climatología de la zona, siendo los muros de la vivienda de doble tabique con materiales aislantes en su interior, además del doble acristalamiento en las ventanas y puertas de toda la casa. De esta forma, la propiedad queda protegida no sólo del frío, sino también del calor, haciendo de la casa un hogar sumamente confortable.<br>La propiedad se encuentra dividida en 2 alturas y una planta baja destinada a garaje con 264 m2 y capacidad para más de 5 coches. Dispone de una habitación grande, luminosa y con ventanas con maravillosas vistas al jardín. Un baño, estancia con pre-instalación para cocina, una bodega y una habitación sencilla. Asimismo, cuenta también con un montaplatos que une el garaje con las plantas superiores. En él, podemos subir la compra o cualquier otra carga pesada hacia las plantas superiores. <br>Su planta primera cuenta con una superficie de 265 m2, está compuesta de 2 grandes salones con amplias puertas y ventanas dando al jardín, una terraza cubierta de gran tamaño, un despacho, una espaciosa cocina con comedor y despensa, una gran solana, cuarto de plancha, un baño y un aseo para invitados. <br>Se percibe en la vivienda la calidez de la madera de Vitacola, siendo de ésta los suelo, la escalera de acceso al resto de plantas (considerada una copia de la escalera de casa Fataga del Parque Santa Catalina), la cocina, el comedor y las vigas de los techos.<br>Además, las puertas de la vivienda son de Riga lacada en blanco, siendo los herrajes de las mismas de Olaria (fábrica de herrajes de lujo y exclusivos, con edificios tan emblemáticos como la casa Batllo y Milá de Gaudí y el Hotel Gran Palace De Barcelona). <br>Toda la caja de escaleras se inunda de luz a través de una claraboya diseñada por Guzmán, el mismo que diseñó la claraboya del Gobierno de Canarias. <br>La planta alta con una superficie de 165 m2, se distribuye en 4 dormitorios en suite. El dormitorio principal cuenta con un baño completo con bañera de hidromasaje y ducha independiente, además de un vestidor. Tenemos un segundo dormitorio muy espacioso con armarios empotrados y baño completo. El tercer y cuarto dormitorio también bastante amplios, comparten el tercer y último baño de la planta. <br>¡No pierdas la oportunidad de vivir en la zona residencial favorita de la élite de la capital!<br>Llámanos sin compromiso y estaremos encantados de atenderte.".',5,2,'28.0633595,-15.4603423',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>2 plantas</li> <li>697 m² construidos, 566 m² útiles</li> <li>5 habitaciones</li> <li>6 baños</li> <li>Parcela de 1.050 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1988</li> <li>Certificación energética: en trámite</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (503,9,NULL,501,570,4500000,'Chopin, 1','35012','venta','casa o chalet','Casa o chalet independiente en venta en Chopin, 1','Gilmar presenta en esta ocasión esta exclusiva vivienda ubicada en Ciudad Jardín que, con su carácter exclusivamente residencial, es un barrio ubicado en pleno centro de la ciudad, fundamentalmente compuesto por viviendas unifamiliares de una o dos plantas generalmente ajardinadas y con amplias zonas verdes para el esparcimiento entre las que destacan el parque Doramas y el parque Romano. La vivienda se encuentra en alto, sobre un muro de piedra de cuatro metros de altura, lo cual le permite tener desde toda la casa hipnotizantes vistas sobre la ciudad de Las Palmas de Gran Canaria y el puerto marítimo.<br>Su construcción es del año 1996 y en los últimos años ha sido completamente reformada. Se trata de una vivienda muy cómoda, de 570 m2 construidos sobre un terreno de 750 m2, desarrollando toda la zona de día en un mismo nivel. Su luz no pasa desapercibida dado que todas las estancias gozan, gracias a sus techos de más de tres metros de altura, de amplios ventanales que permiten su entrada y esparcimiento. Se accede desde la calle a través de los jardines directamente a la vivienda y a la piscina, que a su vez está comunicada por medio de una elegante escalinata y un porche con la zona noble de la casa. En esta planta se encuentra el salón principal con comedor de eventos y la zona de diario con sala de estar, comedor informal y la cocina, de estilo francés, con acceso propio de servicio. Los detalles de calidad de la casa son innumerables empezando por el suelo de mármol en casi todas las estancias, siendo a medida el de la terraza, el del salón y el del recibidor con el detalle de la estrella de los vientos y de mármol rosado todos los baños. La carpintería exterior es de Technal, de un modelo curvo específico para edificios clásicos y con vidrios de seguridad tanto en sótano como en la planta principal excepto en la cocina, en la cual, para ventilar, se optó por barrotes de seguridad. Destacar que ha sido diseñada contando con la posibilidad de instalar un ascensor cuando se desee. La primera planta, la zona de descanso, a la que se llega acariciando una baranda de hierro diseñada específicamente para esta casa, se dedicó a cuatro amplios dormitorios con baño y armarios empotrados o vestidor en el caso de la master. Coronando la vivienda, un estudio con acceso a la azotea donde las vistas 360º son inmejorables. En planta sótano, con acceso independiente desde el exterior, se ha instalado un despacho, otra estancia con baño que permite ser la habitación de servicio y una habitación multiusos que puede ser tanto una sala de cine como gimnasio o zona de juegos. Por último, el garaje para varios coches, el trastero, la bodega y la sala de máquinas.',5,2,'28.1208154,-15.4320561',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>570 m² construidos</li> <li>5 habitaciones</li> <li>7 baños</li> <li>Parcela de 762 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Construido en 1996</li> <li>No dispone de calefacción</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (504,9,NULL,501,402,1600000,'Carretera de Marzagán, 30','35003','venta','casa o chalet','Casa o chalet independiente en venta en carretera de Marzagán, 30','Gilmar presenta este Chalet unifamiliar ubicado en La Carretera de Marzagán en el tramo más cercano a Tafira. Sus comunicaciones con la autovía son muy cómodas llegando a Las Palmas de Gran Canaria en 12 minutos y al aeropuerto en 18 minutos. <br>Se trata de una vivienda construida por el actual y único propietario con las previsiones necesarias para la climatología de la zona y con las pretensiones de ver crecer aquí a su familia y de ahí que su estado de conservación sea excelente. Si bien se distribuye en tres alturas perfectamente definidas, la zona principal se encuentra toda en una misma planta a ras con el acceso desde la calle. En una planta inferior tenemos totalmente independiente una vivienda compuesta por tres habitaciones y dos baños, con acceso propio desde los jardines a la vez que está comunicada por la escalera interior de la vivienda principal. En el último nivel el ocio, una zona preparada para el disfrute con su barbacoa, barra de bar, billar, zona de tv, etc. Rodean la casa los cerca de 2.800 m2 dedicados a jardín y a plantación de árboles frutales donde abastecen en la actualidad un sinfín de variedades: parra moscatel, guayaba, duraznos, nísperos, aguacates, ciruelas, naranjas, plátanos, papas, un paraíso atendido con el mayor mimo. Por su colocación en la ladera, desde todas las alturas mencionadas se disfruta de una preciosas vistas de la maravillosa cumbre de la isla y justo enfrente la protagonista es la montaña de la Caldera de Bandama.',6,3,'28.054849,-15.4575321',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>3 plantas</li> <li>402 m² construidos</li> <li>6 habitaciones</li> <li>4 baños</li> <li>Parcela de 3.143 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur</li> <li>Construido en 1985</li> <li>No dispone de calefacción</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (505,9,NULL,501,623,1200000,'Casa del Gallo, 1','35007','venta','casa o chalet','Casa o chalet independiente en venta en Casa del Gallo, 1','"Excelente oportunidad para adquirir esta exclusiva casa bicentenaria, una magnifica propiedad con muchísimo encanto.<br>Este emblemático inmueble dio origen a la zona de la casa del gallo y a la calle donde está situada.<br>Ubicada en Tafira, zona residencial por excelencia, a pocos minutos del centro de la ciudad y con acceso directo a la circunvalación, muy cerca del campus universitario, del Jardín Botánico Viera y Clavijo y a poca distancia de centros deportivos, de equitación, campo de golf y otros muchos servicios en los alrededores (farmacia, centro veterinario, ferretería, restaurantes, etc. )<br>La parcela cuenta con 2488 m2, en la cual nos adentramos a través de un maravilloso jardín muy cuidado, rodeado de una extensa vegetación; palmeras, araucarias, pinos, etc.. . Atravesando el mismo, al fondo, nos encontramos con esta imponente mansión.<br>La propiedad está compuesta de tres viviendas independientes;<br>Casa Principal: (consta de dos alturas, cada una de ellas es independiente, aunque se comunican mediante una escalera exterior)<br>La planta baja cuenta con una superficie de 216m2, está compuesta de un gran salón con grandes ventanales dando al jardín, cocina con comedor, 3 dormitorios, 2 baños y un pequeño despacho.<br>La planta alta con una superficie de 275 m2, mantiene la forma original de diseño, conservando ese aire solariego que la hace tan exclusiva. Cuenta con una gran cocina independiente, comedor con balcón, desde el cual dominamos las vistas de todo el jardín y el valle, sala de estar con terraza, imponente salón de grandes dimensiones con techos de madera a dos aguas, además de tres dormitorios de grandes dimensiones y dos baños completos.<br>Por último, la vivienda tiene anexado un acogedor apartamento independiente, con una superficie de 100 m2, actualizado con un diseño que nos recuerda a las típicas casitas ibicencas, dándole un aire fresco y acogedor. Se divide en salón comedor, cocina independiente, habitación con vestidor y baño, además de una gran terraza con fuente de agua. <br>¡No pierdas la oportunidad de vivir en la zona residencial favorita de la elite de la capital!<br>Llámanos sin compromiso y estaremos encantados de atenderte. ".',10,5,'28.06276,-15.4598417',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>2 plantas</li> <li>623 m² construidos</li> <li>10 habitaciones</li> <li>5 baños</li> <li>Parcela de 2.489 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Construido en 1925</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (506,9,NULL,501,320,1390000,'Chopin, 12','35011','venta','casa o chalet','Casa o chalet independiente en venta en Chopin, 12','GILMAR te ofrece una de las pocas oportunidades de adquirir un exclusivo Chalet en la zona residencial de Ciudad Jardín que disfrute de unas fabulosas vistas a la bahía de Alcaravaneras, a la vez que por su ubicación permite la conexión con el centro dando un agradable paseo. Ciudad Jardín, es un barrio ubicado en pleno centro de la ciudad, fundamentalmente compuesto por viviendas unifamiliares de una o dos plantas, generalmente ajardinadas y con amplias zonas verdes para el esparcimiento entre las que destacan el parque Doramas y el parque Romano.<br>Este lujoso chalet, en la reforma integral efectuada en el año 2009, ha sido diseñado para el disfrute. La zona de día se desarrolla toda prácticamente en el mismo nivel, gozando de una comunicación exquisita entre los salones, el comedor y la cocina con la zona de jardín por medio de unas enormes puertas correderas de cristal de seguridad. La cocina, perfectamente equipada con electrodomésticos de gama alta y sistema de aspiradora centralizada, tiene acceso directo desde la zona de servicio, desde el comedor principal y desde el jardín. El jardín, equipado con riego por goteo, está protagonizado por una piscina con cascada y solárium y zona techada de festejos con barbacoa, barra americana y cocina independiente. No le falta detalle para disfrutar cómodamente tanto de festejos familiares como de eventos más formales y elegantes, cuyo cocktail de bienvenida se puede organizar en la terraza superior de la vivienda, a la que se puede acceder cómodamente por el ascensor y disfrutar de las vistas sobre la ciudad de Las Palmas de Gran Canaria y del mar, continuando después en el salón principal y los jardines. El maridaje para los eventos se decidirá entre la amplia oferta de vinos que permite conservar la bodega.<br>En la planta de arriba, a la que se puede acceder bien por una elegante escalera de madera, metal y cristal de las más altas calidades o bien por el ascensor que comunica desde el garaje hasta terraza superior, se encuentran las tres habitaciones y el acceso a la zona de lavandería. La habitación principal está dotada de dos amplios vestidores y un baño de diseño exterior y con vistas. Los otros dos dormitorios disponen cada uno de ellos de una terraza privada y un baño, perfectos para la independencia tanto para los hijos como para recibir invitados.<br>Por último el garaje, con capacidad para cuatro coches y una habitación con posibilidad de organizar como habitación de servicio o como despacho profesional, el cual gracias a la puerta de servicio disfruta una comunicación independiente de la vivienda.',4,2,'28.1207917,-15.4324214',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>3 plantas</li> <li>320 m² construidos</li> <li>4 habitaciones</li> <li>6 baños</li> <li>Parcela de 543 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Certificación energética: en trámite</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Piscina </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
