 (512,9,NULL,512,204,350000,'Triana','35015','venta','piso','Piso en venta en Triana','¿Quieres vivir en un fantástico piso doble con vistas al mar en plena ciudad?<br> <br> Se vende piso doble en Rafael Cabrera. Inmejorable zona con una ubicación excelente, podemos encontrar a un paso la calle Triana, Estación de Guaguas, Teatro, bancos, Supermercados, peluquerías, cafeterías etc. Fácil acceso directo a la autovía. <br> <br> Piso de 203m2 muy luminoso con vistas al mar y a la avenida marítima. Distribuido en 6 habitaciones, 2 salones, 2 baños con plato de ducha, 2 cocinas y solana. Dispone de plaza de garaje y trastero doble. Ubicado en la Cuarta planta de un edificio con ascensor, el cuál cuenta con un portero para tranquilidad y bienestar de todos los vecinos. <br> Si buscas amplitud y comodidad para toda la familia, esta es la oportunidad que estaba esperando, gracias a su amplitud, luminosidad y accesibilidad a cualquier sitio. <br> <br> Podrá pasear por la Avenida Marítima, tomar un café en la plaza del Parque San Telmo e ir de compras a la zona comercial Triana sin necesidad de coger coche.<br> <br> No dude en solicitar su visita, antes de que se le adelanten.<br> <br> Información Adicional: El precio de venta No incluye Gastos de Notaría, Registro, ni impuestos propios de la Transmisión, ni cualquier otro que según ley pueda corresponder al comprador.',6,2,'28.1079448,-15.4136957',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>204 m² construidos, 161 m² útiles</li> <li>6 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Orientación este</li> <li>Construido en 1971</li> <li>No dispone de calefacción</li> <li>Certificación energética: <span title="g" class="icon-energy-c-8"></span> (98 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-