 (513,9,NULL,501,403,1390000,'Calle Pío XII, 48','35007','venta','casa o chalet','Casa o chalet independiente en venta en calle Pío XII, 48','Gilmar pone a su disposición este fabuloso chalet construido sobre una finca de mil metros cuadrados ubicado en Ciudad Jardín, una de las mejores zonas que ofrece la ciudad de Las Palmas de Gran Canaria para vivir. Ciudad Jardín, con su carácter exclusivamente residencial, es un barrio ubicado en pleno centro de la ciudad, fundamentalmente compuesto por viviendas unifamiliares de una o dos plantas generalmente ajardinadas y con amplias zonas verdes para el esparcimiento entre las que destacan el parque Doramas y el parque Romano. Se trata de una vivienda principal de 254 m2 desarrollada toda en una planta y con una distribución excepcional, su forma de ele abraza un jardín íntimo en constante comunicación con el interior de la vivienda desde las principales estancias. Consta de tres habitaciones, tres baños, uno de ellos en suite, un salón principal con comedor comunicado con la cocina y una sala de estar independiente. La cocina tiene acceso de servicio desde el paso lateral de la vivienda. Anexo y separado por zona ajardinada, encontramos una segunda edificación con un despacho y un amplio salón con baño y una pequeña cocina en la planta alta, quedando la planta baja, al servicio del aparcamiento de varios coches y un cuarto de lavado.',4,2,'28.1272007,-15.432824',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>1 planta</li> <li>403 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Parcela de 1.024 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1970</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (514,9,NULL,501,380,850000,'indepdite    Tafira','35015','venta','casa o chalet','Casa o chalet independiente en venta en Tafira','Gilmar pone a su disposición, en este Chalet unifamiliar construido en una finca de 5.000 m2 en el espacio natural protegido de Bandama, frente a la Caldera, una experiencia de paz, campo, lujo y comodidad, ya que sus cerca de 400 m2 de vivienda se desarrollan casi en su totalidad en una única planta, con una comunicación constante con los jardines adoquinados y vestidos con cantería de Arucas. Se trata de un hogar listo para entrar a vivir. El entorno de la finca es agrícola compuesto de viñedos y árboles frutales. Un maravilloso ambiente rural excelentemente conectado con la autopista que nos permite llegar a la ciudad en 12 minutos y al aeropuerto internacional en 17 minutos. Campo de Golf de Bandama a 1,5 kms y el del Cortijo a 8 kms. A pocos metros parada de transporte público y varios centros escolares como el Colegio Hispano Inglés y el Colegio Americano. Sus cuatro dormitorios, tres baños, salón comedor comunicado con una moderna cocina, sala de estar, son algunos de los espacios aunque sin duda el protagonismo le pertenece a un precioso porche con espacio suficiente para albergar una cómoda sala de estar de exterior y un comedor, que podrá ser abastecido tanto desde la cocina como desde la zona de barbacoa. Pérgolas y terrazas, cuarto de aperos, estanque aljibe, perrera son otras de las construcciones de la finca así como un almacén de 130 m2 cuya versatilidad puede satisfacer a deportistas, artistas e incluso coleccionistas de coches.',5,2,'28.045318,-15.4576758',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>2 plantas</li> <li>380 m² construidos</li> <li>5 habitaciones</li> <li>3 baños</li> <li>Parcela de 5.000 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1960</li> <li>No dispone de calefacción</li> <li>Certificación energética: en trámite</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (515,9,NULL,501,174,440000,'Plaza del Fuero Real, 11','35010','venta','piso','Piso en venta en plaza del Fuero Real, 11','Gilmar vende exclusivo piso en primera línea de La Avenida Marítima, un vecindario muy próspero donde además, se sitúan muchas de las más altas rentas de la ciudad de Las Palmas de Gran Canaria. Esta magnífica vivienda está ubicada en el emblemático edificio Granca, junto a la espectacular fuente luminosa. <br>El edificio está dotado de un lujoso hall de entrada con amplias zonas comunes como salones, salas de reuniones o eventos, un gran gimnasio dotado con todo tipo de material deportivo y zona de duchas independientes, así como 4 ascensores y un montacargas. Cuenta además, con servicio de portería las 24 horas, video vigilancia y recogida de basura.<br><br>La vivienda, que se encuentra lista para entrar a vivir, dispone de grandes y luminosas estancias, un gran salón con vistas directas al mar, una espaciosa cocina con office y solana, cuatro dormitorios dotados con armarios empotrados y el principal, de tipo suite. Cuenta además con dos baños, aseo, 2 amplias plazas de garaje y un trastero. Una vivienda dotada de todo lo necesario para ti y tu familia. Disfruta de las increíbles vistas directas sobre el mar, La Avenida Marítima y el Puerto de la Luz en un entorno envidiable del centro de la capital grancanaria.<br><br>La zona incluye todos los servicios que se puedan necesitar, restauración, supermercados, edificios institucionales, colegios, farmacias y un largo etcétera.<br><br>No lo dudes, esta es tu casa. Consulta más información.',4,4,'28.1134403,-15.4185837',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>174 m² construidos</li> <li>4 habitaciones</li> <li>4 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Constr