 (521,9,NULL,501,311,635000,'Santa Teresa, 29','35001','venta','casa o chalet','Casa o chalet independiente en venta en Santa Teresa, 29','En una de las mejores zonas de Tafira, a 1 minuto caminando del Oakley Collegue, a 2 minutos tanto de paradas de taxi como de autobús y muy bien comunicado con la universidad y con la GC-4, se encuentra este Chalet independiente en perfecto estado de conservación. <br>Son los propietarios actuales quienes, con el mimo que uno le pone a su nuevo hogar, construyeron esta vivienda con toda minucia de detalles. Su tejado a dos aguas crea una acogedora buhardilla, coronada con un esqueleto de madera de primeras calidades, en donde se encuentra una cálida sala de estar con chimenea y un amplio despacho. Caracteriza el acceso principal de la vivienda un luminoso espacio distribuidor que comunica con una escalera abierta la zona noble con las zonas de servicio y de ocio. El Chalet cuenta con tres habitaciones principales con dos baños en la misma planta y en otro nivel una habitación de servicio con un baño completo, cuarto de plancha, sala de sauna y aparcamiento con almacenaje y espacio para tres coches. Finalmente, una gran sala de estar en la planta baja comunicada con un porche, zona de barbacoa y cocina/bodega completan una fabulosa zona de disfrute. <br>La propiedad estaría abierta a estudiar un contrato de alquiler con opción a compra hasta la transmisión definitiva del inmueble cuyas condiciones habría que pactar entre las partes. ¡No pierdas la oportunidad de ver est fabulosa propiedad y ven a visitarla!',5,2,'28.0540585,-15.4638875',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>3 plantas</li> <li>311 m² construidos</li> <li>5 habitaciones</li> <li>4 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 1999</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (522,9,NULL,501,273,450000,'Pancho Guerra, 22','35017','venta','chalet pareado','Chalet pareado en venta en Pancho Guerra, 22',NULL,4,2,'28.1105733,-15.4262048',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Chalet pareado</li> <li>2 plantas</li> <li>273 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación este</li> <li>Construido en 1985</li> <li>No dispone de calefacción</li> <li>Certificación energética: en trámite</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (523,9,NULL,501,263,275000,'Calle Segovia, 7','35009','venta','chalet adosado','Chalet adosado en venta en calle Segovia, 7','Gilmar Real Estate presenta este amplio chalet adosado situado en la urbanización Santa Margarita, una zona residencial inmejorable y especialmente tranquila en Marzagán, Las Palmas de Gran Canaria.<br>La vivienda cuenta con 263 m2 construidos sobre una parcela de 278, divididos en dos plantas más azotea y se distribuye de la siguiente manera:<br>En la planta baja se encuentra el porche de entrada que da acceso tanto a la vivienda como al garaje. En éste, existe espacio suficiente para aparcar un coche. Asimismo, el amplio garaje con capacidad para un segundo coche y una moto, alberga una zona de lavado y espacio de almacenaje, ideal para guardar en él todo tipo de enseres personales. Desde este espacio se encuentra otro acceso directo a la vivienda. <br><br>Accediendo a la vivienda desde el porche, en la planta baja nos encontramos con un salón con chimenea, dos habitaciones, dos baños, un espacio reservado para una bodega, la cocina y un patio central donde poder celebrar eventos familiares. <br>En la segunda planta se encuentran dos dormitorios, uno de ellos bastante amplio que comunica hacia una buhardilla y otro que si bien, en la actualidad está sin uso, podría destinarse como segundo dormitorio, despacho, sala de juegos o gimnasio. <br><br>Por último cabe destacar su gran azotea, una zona de acceso desde la primera planta. En este espacio destaca principalmente la zona de barbacoa, lugar donde disfrutar con la familia y amigos de placenteras jornadas de ocio y descanso. <br><br>Como puedes comprobar, una magnífica propiedad dotada de todo lo necesario y con una situación privilegiada, tanto por su cercanía al centro de la ciudad de Las Palmas de G. C. , como para el Aeropuerto o zona sur de la isla.<br><br>No dejes escapar esta oportunidad.',3,1,'28.0383688,-15.429528',' <div class="details-property-feature-one"> <h2 class="txt-medium