 (525,9,NULL,524,250,495000,'Calle Presidente Alvear, 18','35019','venta','piso','Piso en venta en calle Presidente Alvear, 18','En pleno centro neurálgico de la zona de Mesa y López, en Las Palmas de Gran Canaria, disponemos de este MAGNÍFICO PISO de excelentes calidades con plaza de garaje incluida. Hablamos de un piso comprendido por la unión de dos viviendas al mismo nivel, con ascensor en la misma planta y acceso directo a la misma. Su gran amplitud mantiene la zona de estar separada del área de descanso, que nos concede esos momentos de tranquilidad y sosiego, con la posibilidad de que una parte de la familia pueda disfrutar de un ambiente distendido y la otra estar descansando en sus dormitorios. <br> <br> Se encuentra casi en última planta del edificio hacia dos calles, lo que nos proporciona una buena ventilación y entrada de luz natural para una mayor luminosidad en todo nuestro hogar. Espacios diáfanos, desde que entras en la vivienda, cocina amplísima con comedor independiente. Dos salones, de extremadas dimensiones sin ningún tipo de columna o interferencia. Salón de jóvenes, en la actualidad, que puede destinarse a otros usos en el futuro, dormitorios amplios con ventanas al exterior y materiales de calidad. <br> <br> Este confortable inmueble se sitúa a escasos metros de la Playa de Las Canteras, rodeado de una amplia gama de servicios y actividades de ocio para toda la familia. Independencia, serenidad, cercanía, … ¿A qué esperas?',5,3,'28.1352448,-15.4302726',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>250 m² construidos, 240 m² útiles</li> <li>5 habitaciones</li> <li>3 baños</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Orientación norte, sur</li> <li>Construido en 2004</li> <li>No dispone de calefacción</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 6ª </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'6ª planta con ascensor','Garaje incluido',NULL),
 (526,9,NULL,524,350,645000,'Calle León y Castillo, 306','35016','venta','piso','Piso en venta en calle León y Castillo, 306','En la ciudad de Las Palmas de Gran Canaria, con los mejores accesos desde la Avenida Marítima, se encuentra esta excelente vivienda, semi reformada y con una amplia superficie de 350 m2 construidos y 2 plazas de garaje. <br> <br> Su situación privilegiada, su luminosidad y sus despejadas vistas hacia la ciudad, el mar y el Puerto le aportan una distinción especial. Situada muy próxima a la Playa de las Alcaravaneras, el Real Club Náutico, el Muelle Deportivo y la zona comercial de Mesa y López. <br> <br> Esta vivienda está situada en una 3ª planta, primera residencial del emblemático edificio Torre Las Palmas. Tiene una amplia y variada distribución de espacios, consta de: 5 habitaciones o dormitorios, de los cuales 3 tienen baño en-suite; un lujoso salón, una amplia sala-comedor, un baño independiente en el pasillo, una espaciosa cocina, con una buena solana, una gran despensa, y un práctico aseo de planta.<br> <br> Tras recorrer unas zonas comunes muy bien equipadas, se puede acceder a la vivienda por 2 entradas distintas. La entrada principal, mediante ascensor a planta con acceso directo, ya que sólo hay un propietario por planta, donde una vez dentro la casa nos da la bienvenida con un amplio recibidor. Y la entrada secundaria, mediante otros 2 ascensores comunicados a su vez con la escalera del edificio, donde entramos por la zona de cocina y servicios.<br> <br> La propiedad cuenta también con 2 cómodas plazas de garaje y cuarto trastero, situados a en el sótano del inmueble. <br> <br> Todas las ventanas exteriores son de la mayor calidad, acústica y energética; y la mayor parte de las estancias cuenta con una robusta carpintería de madera en blanco o natural, en puertas y armarios empotrados para optimizar el espacio. Además de un entarimado precioso en buena parte de las estancias.<br> <br> Entra a vivir en esta vivienda y haz realidad tus mejores ideas de decoración sobre un espacio completamente diáfano y listo para ser descubierto, creando un hogar a tu medida.<br> <br> Pregúntame sin compromiso por la promoción vinculada a esta propiedad para la reserva! Oportunidad única.',6,4,'28.1280557,-15.4298488',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>350 m² construidos</li> <li>6 habitaciones</li> <li>4 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>No dispone de calefacción</li> <li>Certificación energética: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta con ascensor','Garaje incluido',NULL),
