 (529,9,NULL,524,520,1200000,'Paseo San Antonio','35004','venta','casa o chalet','Casa o chalet independiente en venta en paseo San Antonio','¿Te imaginas viviendo en un lujoso chalet, en pleno centro de Las Palmas de Gran Canaria, con todas las comodidades a tu alcance y unas vistas de ensueño? <br> <br> Te presentamos esta moderna propiedad situada en una de las zonas más exclusivas de la capital. Esta impresionante vivienda se encuentra en el Paseo de San Antonio, por encima de Paseo de Chil, con todos los servicios necesarios a tu alcance.<br> <br> Se trata de una vivienda con más de 500 m2, distribuidos en tres plantas unidas por un cómodo ascensor. Al mismo tiempo, alberga unas terrazas de 93 metros con unas vistas impresionantes al mar. Un espacio perfecto donde poder disfrutar de una cena o del primer sorbo de café o té por la mañana. <br> <br> Cuenta con espacios amplios, zonas recreativas pensadas para desconectar de la rutina o el trabajo, y una magnífica combinación de elementos decorativos, revestimientos vanguardistas, así como maderas exquisitas que al mismo tiempo le dan un toque hogareño.<br> <br> Toda la casa dispone de tecnología punta que te proporcionará la más absoluta comodidad y tranquilidad: persianas eléctricas, puertas automáticas, sistema de alarma completo, calefacción, Internet en toda la casa, lo último en cámaras de vigilancia, extractor que renueva el aire y pantallas de televisor con las que no te hará falta ir al cine!. <br> La propiedad disfruta de las más altas calidades; como sus paredes revestidas con un diseño exquisito e innovador, respirándose modernidad en todas sus estancias.<br> <br> La planta sótano se puede considerar un apartamento independiente de 178 m2 con amplia cocina, gimnasio, una habitación con baño completo y otro más. <br> <br> Una de las zonas más importantes de una vivienda suele ser el salón. En este espacio compartes momentos en familia, lees tu libro favorito o desconectas viendo una película o una serie que tengas pendiente. Este impresionante chalet dispone de dos salones espaciosos, confortables y luminosos, capaces de trasladarte al mejor momento del día. <br> <br> En su espectacular cocina prepararás tus mejores recetas. Un espacio abierto y amplío que incluye dos frigoríficos, dos hornos, un microondas, vitro cerámica con hasta seis fogones y un sinfín de electrodoméstico que hará que tu experiencia culinaria sea perfecta. <br> <br> Se compone de 6 habitaciones amplias y luminosas, todas con aire acondicionado e hilo difusión musical para que puedas relajarte y desconectar en cualquier rincón de tu hogar. <br> Cabe destacar dentro de ellas, la impresionante suite principal con salón, terraza, amplísimo baño, zona de ducha para cuatro personas, que hará que te traslades a una suite de los hoteles más lujososo y exquisitos.<br> Todas las habitaciones disponen de roperos empotrados modernos y bien equipados. <br> Finalmente, la propiedad tiene 6 baños y un aseo con mobiliario vanguardista que te brindará el confort y la tranquilidad que necesitas para tí, tus invitados y tu familia.<br> <br> <br> ¿Vas a perder esta grandísima oportunidad? <br> <br> PLANTA BAJA<br> •Dos plazas de garajes <br> •Una habitación con baño y ducha. <br> •Una cocina abierta. <br> •Un gimnasio<br> •Un despacho<br> •Un almacén<br> •Un baño <br> PLANTA PRINCIPAL<br> •Terraza con césped artificial. <br> •Dos salones abiertos.<br> •Sala Tv.<br> •Comedor.<br> •Cocina abierta con dos frigoríficos y dos hornos, microondas y cafetera. <br> •Una habitación. <br> •Un baño. <br> •Una lavandería.<br> PLANTA ALTA<br> •4 habitaciones (2 con baño completo con ducha al interior y 1 con baño sin ducha).<br> •1 suite con baño completo.<br> EXTRAS<br> •Ascensor interno que conecta las tres plantas.<br> •Puertas automáticas comando a distancia.<br> •Cameras en toda la casa para grabar el interior.<br> •Sistema alarma completo. <br> •Calefacción agua en las tres plantas independientes. <br> •Fontanería y electricidad a norma y nueva.<br> •Persianas eléctricas. <br> •Fibra internet y WIFI en toda la casa.',6,3,'28.1100541,-15.4227295',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>520 m² construidos, 499 m² útiles</li> <li>6 habitaciones</li> <li>7 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Construido en 1993</li> <li>No dispone de calefacción</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (52 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
 (530,9,NULL,530,80,196500,'LEÓN Y CASTILLO','35002','venta','piso','Piso en venta en LEÓN Y CASTILLO','ESPECTACULAR BAJADA DE PRECIO!<br> <br> MAGNIFICO PISO A LA VENTA!<br><br>Quiere vivir en el centro de la ciudad y gozar de unas vistas espectaculares a la bahía y la playa de Alcaravaneras? A dos minutos a pié de la zona comercial de Mesa y Lopez, muelle deportivo, y muy cerca de la playa de Las Canteras sin necesidad de utilizar vehículo, le ofrecemos esta magnífica vivienda, situada en un edificio emblemático de la ciudad. Situada en una octava planta, por su situación goza de una luminosidad extraordinaria, así como una tranquilidad absoluta, gracias a sus ventanas tipo “climalit”. <br><br>Se trata de una vivienda remodelada por completo, lista para entrar a vivir, distribuida en 3 dormitorios, hall, salón, cocina y baño. Además cuenta con un balcón donde podemos disfrutar tanto de las vistas a la playa de Alcaravaneras, la bahía y todo el muelle, como a la montaña. El piso del salón, las habitaciones y el pasillo es de parquet, dando una gran elegancia a la vivienda. <br><br>Tanto el baño como la cocina se reformaron para dotar a la vivienda de mayor amplitud y comodidad, con puertas de corredera, evitando así tropiezos innecesarios. En la cocina encontramos un amplio "office" utilizado como despensa. La iluminación es toda con bombillos leds. El piso se encuentra listo para entrar, salvo reformas a gusto del comprador. El edificio cuenta con servicio de portería y zonas comunes bastante cuidadas. Se trata de una comunidad muy tranquila. Cuenta además con rampas de acceso a personas con movilidad reducida.<br><br>No deje pasar la oportunidad de vivir en el centro de la ciudad, rodeado de todos los servicios, bancos, colegios, centro de salud, paradas de guaguas, etc.. . a un paso de la playa y disfrutar de unas vistas maravillosas de la montaña. Llame ahora e infórmese sin compromiso. Le asesoramos con la financiación. Llame y le informamos.<br><br>Información: El precio de venta no incluye impuestos propios de la transmisión, gastos de notaría, registro ni cualquier otro que según la ley corresponda al comprador. Los datos expuestos son meramente orientativos y se encuentran sujetos a errores u omisiones involuntarias.',3,1,'28.1329638,-15.4310671',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>80 m² construidos</li> <li>3 habitaciones</li> <li>1 baño</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Orientación este</li> <li>Certificación energética: en trámite</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 8ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'8ª planta exterior con ascensor',NULL,NULL),
 (531,11,NULL,531,90,645000,'Don Diego López Haroko Kale Nagusia','48005','venta','piso','Piso en venta en Don Diego López Haroko Kale Nagusia','EXCLUSIVO PISO EN EL ENSANCHE DE BILBAO.<br>Frente al Palacio de Diputación, en plena Gran Via de Bilbao, una avenida a la que se asoman algunos de los edificios residenciales, comerciales, institucionales y empresariales más importantes de la Villa.<br><br>Vivienda situada en un edificio emblemático, con estructura de hormigón, portal con cobertura de marmol en paredes y escaleras, ascensor de gran capacidad a cota 0 y zonas comunes con estética exclusiva.<br><br>A través de su recibidor de entrada accedemos a su gran salón comedor, de grandes dimensiones, con techos altos y molduras originales. Tambien tenemos acceso a su cocina, actualizada, con calidades de alta gama, revestimiento de granito y completamente equipada.<br><br>La vivienda resulta muy acogedora, gracias a su perfecta distribución en donde se han aprovechado todos los espacios, reduciendo al máximo la zona de pasillos y creando una zona privada perfectamente separada de las zonas mas sociales.<br><br>En este sentido nos encontramos con dos habitaciones con grandes armarios empotrados, la principal tipo suite con baño completo incorporado. Otro baño completa el espacio privado, este con una ducha, siendo ambos espacios zonas tratadas con calidades de gama alta.<br><br>Entre las calidades de la vivienda: suelos de tarima con maderas nobles de gran calidad, ventanas climalit de doble acristalamiento, persianas eléctricas, calefacción y agua caliente central con contador individual, cuidada iluminación y calidades altas en todos sus espacios.<br><br>Una vivienda exclusiva, en una zona exclusiva.<br><br>En Erro Home, contamos con protocolos que garantizan tu seguridad para visitar nuestras viviendas.<br><br>Pregunta a nuestros agentes por la condiciones de financiación.',2,2,'43.2639721,-2.9333833',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>90 m² construidos, 85 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span> (176 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'5ª planta exterior con ascensor',NULL,NULL),
