 (533,11,NULL,533,84,560000,'Calle Gardoki Kardenalaren, 6 A','48008','venta','piso','Piso en venta en calle Gardoki Kardenalaren, 6 A','&nbsp;¿Te gustaría vivir en una de las zonas más exclusivas de Bilbao? Esta es una de las casas de la que te sentirás orgulloso.<br> <br> Te presento ésta maravillosa vivienda en una de las mejores y más céntricas zonas de Bilbao, a escasos metros&nbsp;de La Gran Vía y el Corte Inglés. Muy bien comunicada con metro, autobuses y tranvía y con todo tipo de servicios y comercios disponibles. &nbsp;<br> <br> Distribuida&nbsp;en&nbsp;hall de entrada con gabanero, 2&nbsp;habitaciones con armarios empotrados y salida a terraza, un bonito salón comedor con salida a terraza, cocina nueva totalmente equipada con salida a terraza&nbsp;y&nbsp;dos baños&nbsp;con plato de ducha, 1 de ellos incorporado en el dormitorio principal. Tanto cocina como baños reformados hace menos de 1 año.<br> <br> Materiales de primera calidad. ya que las ventanas son de aluminio Technal con doble acristalamiento y&nbsp;aislamiento térmico y acústico, persianas eléctricas, suelos Pergo laminados&nbsp;y puertas&nbsp;de roble macizo.<br> <br> La calefacción y el agua caliente son de gas individual con caldera comunitaria, también dispone de aire acondicionado con bomba de calor y frio, alarma y sistema de domótica,<br> <br> A pesar de ser un piso interior, da a un amplísimo patio de manzana con vistas, &nbsp;y gracias a su&nbsp;altura, hace que sea&nbsp;un piso muy luminoso y soleado<br> <br> Edificio de hormigón de reciente construcción ya que se edificó hace 10&nbsp;años. Ascensor&nbsp;adaptado&nbsp;para sillas de ruedas y coches de niños ya que no tiene ninguna barrera arquitectónica. &nbsp;También dispone de conserje<br> <br> No te vuelvas loco intentando buscar aparcamiento, ya que también incluye una parcela de garaje con acceso directo y un trastero para que puedas guardar tus bicicletas.<br> <br> ¡No pierdas esta oportunidad de vivir en una de las mejores zonas, más cómodas y con más encanto y ven a verlo! Solicítanos más información sin compromiso. También puedes visitar nuestra web:<br>.',2,2,'43.2612723,-2.9312907',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>84 m² construidos, 66 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 2010</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética del edificio terminado: <span title="e" class="icon-energy-c-6"></span> (137,1 kWh/m² año)</li> <li>Acceso adaptado a personas con movilidad reducida</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 6ª interior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'6ª planta interior con ascensor','Garaje incluido',NULL),
 (534,11,NULL,534,87,435000,'Calle Posta, 12','48011','venta','piso','Piso en venta en calle Posta, 12','Te presento éste precioso piso totalmente reformado con 3 balcones al exterior y parcela de garaje. En la calle Correo, en pleno corazón del Casco Viejo de Bilbao. A menos de 2 minutos del metro, paradas de autobuses, tranvia, del Arenal, Plaza Nueva, Arriaga y de todos los servicios que te ofrece el Casco Viejo.<br> <br> Distribuido en hall de entrada con dos armarios empotrados, salón comedor, &nbsp; 2 dormitorios amplios cada uno de ellos con&nbsp; un balcón, cocina totalmente equipada abierta con puerta de cristal hacia el salón y dos baños (uno de ellos amplio con plato de ducha y otro incorporado en el dormitorio principal con bañera).<br> <br> La vivienda está en muy estado de conservación y&nbsp; con materiales de primera calidad. Las puertas son&nbsp; lacadas en blanco, suelo de tarima&nbsp; de elondo y las ventanas con doble acristalamiento. Tiene calefacción de gas individual<br> <br> El edificio es de madera con ascensor a cota cero, con portal con doble puerta. La ite ya pasada, tejado, fachada y escalera en muy buen estado.<br> <br> Dispone también de una parcela de garaje de concesión en el parking del Arenal incluida en el precio.<br> <br> Es una buena oportunidad para mudarte a una de&nbsp; las zonas con más solera de Bilbao. No dudes en visitarlo. Llámame y concertamos una cita.',2,2,'43.2587012,-2.923565',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>87 m² construidos, 78 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Construido en 1900</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética del edificio terminado: <span title="e" class="icon-e