 (538,11,NULL,538,88,249500,'La Peña','48002','venta','piso','Piso en venta en La Peña','Piso en La Peña en Venta, &nbsp;Zona Centro, 88&nbsp;m², &nbsp;edificio con estructura de hormigón construido en el 2000 y&nbsp;ascensor a cota cero. &nbsp;.<br> <br> El inmueble en venta &nbsp;incluye plaza de garaje y trastero de 7 mts. &nbsp;&nbsp;<br> <br> La vivienda objeto de venta se encuentra en el centro de La Peña, soleada, luminosa y su distribución interior es la detalla a continuación,<br> <br> Salón&nbsp;- Amplio, exterior con gran ventanal.<br> <br> Dormitorio Principal -&nbsp;Amplio. exterior con ventana a la calle y con baño incorporado.<br> <br> Segundo Dormitorio&nbsp;- Tambien, exterior con balcón a la calle y&nbsp;armario empotrado.<br> <br> Tercer Dormitorio - Interior con ventana a patio y&nbsp;con armario empotrado.<br> <br> Cocina&nbsp;- Está completamente equipada con lavadora, nevera, horno, &nbsp;vitro-cerámcia&nbsp;y lavavajillas, dispone de ventana a patio.<br> <br> Baños -&nbsp; De origen, los dos con bañera. Uno en la habitación principal.<br> <br> El inmueble se completa con calefacción y agua caliente individual de gas, &nbsp;suelos de madera, puertas de madera, paredes pintadas&nbsp;&nbsp;y ventanas de&nbsp;madera con doble acristalamiento. &nbsp;<br> <br> Ubicado a 15 minutos andando del&nbsp;Casco Viejo y&nbsp;Atxuri, &nbsp;muy bien comunicado a metro, tren, tranvía y líneas de autobuses.<br> <br> El Casco Viejo es el barrio más antiguo y el núcleo originario de la ciudad de Bilbao. Destaca, asimismo, &nbsp;por ser uno de los principales núcleos comerciales, de ocio y turismo de la villa de Bilbao. &nbsp;<br> <br> Sumergirse&nbsp;por las estrechas calles del casco es toda una delicia. Pasear por el centro histórico es algo obligatorio en una visita a la ciudad. Calles y callejuelas&nbsp;adoquinadas, que formaron el origen de la villa y que ahora mantienen esa arquitectura tan característica con sus magníficos edificios de madera en los que destacan los miradores&nbsp;acristalados&nbsp;y balcones.<br> <br> En sus calles&nbsp;peatonales, los comercios clásicos se alternan con los más innovadores y con abundantes bares y restaurantes en los que degustar lo mejor de la gastronomía vasca. Sin olvidar que, en sus rincones, encontraremos las iglesias y los monumentos más antiguos de la ciudad: la Catedral de&nbsp;Santiago, &nbsp;la Iglesia de San Antón&nbsp;o el Museo Arqueológico.<br> <br> Para más información, &nbsp;ponte&nbsp;en contacto o solicita visita, a través de&nbsp;nuestra&nbsp;página web.',3,2,'43.2421664,-2.9267275',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>88 m² construidos, 80 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur, este</li> <li>Construido en 2000</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética del edificio terminado: <span title="g" class="icon-energy-c-8"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor','Garaje incluido',NULL),
 (539,11,NULL,538,58,240000,'Bilbao la Vieja','48015','venta','piso','Piso en venta en Bilbao la Vieja','Piso en Venta en Bilbao La Vieja, Zona Pza. Tres Pilares, 51&nbsp;metros², totalmente reformado, &nbsp;edificio de hormigón&nbsp;con una antigüedad de 40 años y tejado rehabilitado hace 9 años. Ascensor. Del portal al ascensor hay 6 escaleras.<br> <br> Este piso&nbsp;en venta destaca por ser luminoso y encontrarse a escasos 300 metros del Casco Viejo.<br> <br> El inmueble objeto de venta ha sido completamente reformado con materiales de alta calidad y, su distribución interior es la detallada a continuaciónm,<br> <br> Salón - Exterior, luminoso con mirador a la calle.<br> <br> Dormitorio Principal - Ubicado junto al salón, es también exterior con ventana a la calle.<br> <br> Segundo Dormitorio - Colindante con la cocina, tiene una ventana a 1,50 mts de altura aprox. para ventilar.<br> <br> Cocina- Reformada en su totalidad, es tipo "americana" y está completamente equipada con lavadora, nevera, horno, lavavajillas y vitro-cerámica.<br> <br> Baño - Reformado con ducha<br> <br> El inmeuble se completa con suelo de madera de elondo, paredes pintadas en liso, ventanas de madera con crista climalit y puertas lacadas en color blanco. El agua caliente y la calefacción son eléctricas.<br> <br> El Casco Viejo es el barrio más antiguo y el núcleo originario de la ciudad de Bilbao. Destaca, asimismo, &nbsp;por ser uno de los principales núcleos comerciales, de ocio y turismo de la villa de Bilbao. Sumergirse por las estrechas calles del casco es toda una delicia. Pasear por el centro histórico es algo obligatorio en una visita a la ciudad. Calles y callejuelas adoquinadas, que formaron el origen de la villa y que ahora mantienen esa arquitectura tan característica con sus magníficos edificios de madera en los que destacan los miradores acristalados y balcones. En sus calles peatonales, los comercios clásicos se alternan con los más innovadores y con abundantes bares y restaurantes en los que degustar lo mejor de la gastronomía vasca. Sin olvidar que, en sus rincones, encontraremos las iglesias y los monumentos más antiguos de la ciudad: la Catedral de Santiado, &nbsp;la Iglesia de San Antón&nbsp;o el Museo Arqueológico.<br> <br> <br> Para más información, ponte en contacto o solicita visita, a través de&nbsp;nuestra&nbsp;pagina web<br> <br> &nbsp;.',2,1,'43.2545376,-2.923748',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>58 m² construidos, 51 m² útiles</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Construido en 1978</li> <li>Calefacción individual: Eléctrica</li> <li>Certificación energética del edificio terminado: <span title="g" class="icon-energy-c-8"></span> (446 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor',NULL,NULL),
 (540,11,NULL,540,172,700000,'Albia','48012','venta','dúplex','Dúplex en venta en Albia','Piso-Duplex en venta en Abando, zona Uribitarte, Isozaki. Tasado en 810.000€ por tasadora oficial. Nuevo a estrenar, totalmente exterior y calidades de lujo. &nbsp;Garaje y trastero directo opcional (varias opciones y precios). Edificio construido en el 2009, con ascensor a cota cero, &nbsp;video-portero, personal de seguridad las 24 horas, cámaras de seguridad y conserje. &nbsp;Cuenta con 122 metros cuadrados útiles, distribuidos en 2 plantas. 4ª planta: hall de entrada, amplio salón-comedor y cocina-office, totalmente exterior, con acceso a balcón exterior, con vistas a la ría desde el salón y la cocina, 1 aseo de cortesía y galería. 3ª planta: hall-distribuidor de los 3 dormitorios exteriores con armarios empotrados&nbsp;y 2 baños (1 en suite con bañera de hidromasaje y otro con ducha) y balcón exterior con acceso desde&nbsp;2 de los dormitorios. Opción de parcela&nbsp;de garaje doble para dos coches de 24,30 m2 con un trastero anejo de 6,80 m2 y de parcela&nbsp;de garaje individual&nbsp;de 13,60 m2.<br> <br> El piso en venta en&nbsp;Isozaki, está&nbsp;diseñado a capricho con materiales de altísima calidad, armarios empotrados cerezo vestidos, paredes lisas pintadas, puertas macizas de cerezo, suelos de tarima ancha de elondo, revestimientos cerámicos de cocina y baños de primera calidad, persianas motorizadas, sistema de domótica, A/A por conductos y calefacción central de uso individual (bomba de calor), carpintería exterior con rotura de puente térmico con triple cristal climalit, domótica: alarmas de agua, gas, incendio (cocina y baños).<br> <br> La zona de&nbsp;Abando&nbsp;del Paseo&nbsp;Uribitarte, &nbsp;bordeando&nbsp;la ría de Bilbao, &nbsp;es una de las zonas más cotizadas de Bilbao en lo que a viviendas se refiere, tranquila, modernizada y muy bien comunicada, &nbsp;con gran&nbsp;cercanía del centro, así como&nbsp;a&nbsp;las comunicaciones por tren, &nbsp;metro, &n