 (550,11,NULL,538,127,358000,'Casco Viejo','48008','venta','piso','Piso en venta en Casco Viejo','Piso&nbsp;en el Casco Viejo en Venta, &nbsp;Zona Santa María, &nbsp;110&nbsp;metros² útiles, &nbsp;edificio con estructura de madera&nbsp;y&nbsp;fachada&nbsp;raseada. &nbsp;<br> <br> La cubierta se ha hecho nueva hace 8 años y, la fachada lateral se ha impermeabilizado con sate hace 5 años.<br> <br> El inmueble objeto de venta se encuentra junto a la Ribera, ha sido completamente reformado, y su&nbsp;distribución interior es la detallada a continuación:<br> <br> Salón -&nbsp;Muy espacioso, con la zona del salón y del comedor bien diferenciadas. Dispone de balcón a la calle.<br> <br> Dormitorio Principal&nbsp;- Ubicado junto al salón es también exterior con balcón a la calle. Cuenta con vestidor que se independiza de la habitación por medio de una puerta. El baño ha sido completamente reformado, con ducha.<br> <br> Segundo Dormitorio&nbsp;- Es exterior, está contiguo a la habitación principal y al salón, tiene mirador integrado.<br> <br> Tercer Dormitorio -&nbsp;&nbsp;Tiene armario empotrado de pared a pared y ventana a cárcava. &nbsp;<br> <br> Cocina&nbsp;-&nbsp; Independiente, está&nbsp;completamente equipada con lavadora, nevera, horno, lavavajillas y&nbsp;vitro-cerámica. Tiene ventana a cárcava<br> <br> Baños - Hay un baño completo con bañera junto a la tercera habitación. En la habitación principal hay un baño que se ha reformado recientemente, con ducha.<br> <br> El inmueble se completa con suelo de madera&nbsp;de elondo, ventanas de PVC climalit, paredes&nbsp;pintadas en liso, &nbsp;puertas lacadas en color blanco. El agua caliente y la calefacción de gas natural individual. &nbsp;<br> <br> El Casco Viejo es el barrio más antiguo y el núcleo originario de la ciudad de Bilbao. Destaca, asimismo, &nbsp;por ser uno de los principales núcleos comerciales, de ocio y turismo de la villa de Bilbao. Sumergirse por las estrechas calles del casco es toda una delicia. Pasear por el centro histórico es algo obligatorio en una visita a la ciudad. Calles y callejuelas&nbsp;adoquinadas, que formaron el origen de la villa y que ahora mantienen esa arquitectura tan característica con sus magníficos edificios de madera en los que destacan los miradores&nbsp;acristalados&nbsp;y balcones. En sus calles&nbsp;peatonales, los comercios clásicos se alternan con los más innovadores y con abundantes bares y restaurantes en los que degustar lo mejor de la gastronomía vasca. Sin olvidar&nbsp;que, en sus rincones, encontraremos las iglesias y los monumentos más antiguos de la ciudad: la&nbsp;Catedral de Santiago, la Iglesia de San Antón o el Museo Arqueológico.<br> <br> Para más información, &nbsp;ponte&nbsp;en contacto o solicita visita, a través de&nbsp;nuestra&nbsp;página web.',3,2,'43.2569014,-2.9281712',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>127 m² construidos, 110 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación oeste</li> <li>Construido en 1940</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética del edificio terminado: <span title="e" class="icon-energy-c-6"></span> (129 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> sin ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior sin ascensor',NULL,NULL),
