 (555,11,NULL,531,175,250000,'Calle Fray Juan','48013','venta','piso','Piso en venta en calle Fray Juan','Gran piso en el Centro de Zorroza. En la calle principal, con todos los servicios en la puerta de casa: comercio, centro deportivo, centro de salud, colegios, transporte.<br><br>En un edificio de estructura de hormigón equipado con ascensor y acceso a personas de movilidad reducida mediante elevador. Sin derramas pendientes.<br><br>El inmueble se encuentra dividida en dos propiedades con entradas independientes, generando por un lado una vivienda muy amplia de 3 habitaciones y por el otro un apartamento completamente equipado.<br><br>Describimos la vivienda: dispone en sus 100 m2 de 3 habitaciones, la principal incorpora un baño amplio, todas con amplias ventanas y muy tranquilas por dar a un gran patio manzana, muy luminoso. Además la vivienda dispone de otro baño con amplia ducha, un gran salón comedor con salida a terraza, una amplia cocina, tambien con salida a terraza y un gran cuarto destinado a almacenaje y cuarto de planchado de unos 12m2. Todo ello disptribuido a través de un amplio pasillo con un hall de entrada tambien de buenas dimensiones.<br><br>Por otro lado describios el apartamento: En sus 55m2 cuenta con una cocina completamente equipada, zona de comedor abierta a gran espacio destinado a salón y una habitación amplia. Dispone de un baño completo con ducha. <br><br>Entre el equipamiento de ambas: calefacción y agua caliente de gas natural con contador individual y ventanas de PVC (excepto en salón y cocina). <br><br>Además cuenta tambien con un trastero bajo cubierta de unos 10m2.<br><br>Es una oportunidad de conseguir dos viviendas al precio de una y sacarle toda la rentabilidad que ello te pueda ofrecer.',4,3,'43.2778146,-2.9719214',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>175 m² construidos, 155 m² útiles</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Orientación norte, este</li> <li>Construido en 1975</li> <li>Certificación energética: en trámite</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta con ascensor',NULL,NULL),
 (556,11,NULL,538,190,475000,'Calle Posta','48014','venta','piso','Piso en venta en calle Posta','Piso en Venta en el Casco Viejo, Zona Calle Principal, 175&nbsp;metros², edificio emblemático construido en estructura de&nbsp;madera con una antigüedad centenaria y&nbsp;fachada&nbsp;raseada.<br> <br> El edificio ha sido rehabilitado en su totalidad hace 4 años: tejado, fachada, portal, escaleras y patios. Especial mención merecen los miradores que mantienen las tallas de acuerdo al estilo tradicional.<br> <br> El ascensor en el portal es a "Cota Cero" y, en los pisos, para "entre plantas"<br> <br> Esta vivienda destaca por su tamaño y&nbsp;su magnífica ubicación en una de las principales calles del Casco Viejo; la distribución interior del inmueble es la detallada a continuación:<br> <br> Salón - Muy amplio, con zona de comedor y chimenea - Está ubicado al fondo de la vivienda, con balcón a patio de manzana<br> <br> Dormitorio Principal -&nbsp; Es exterior, doble con mirador y chimenea.<br> <br> Segundo Dormitorio - Contiguo a la habitación principal, es también exterior con balcón a la calle.<br> <br> Tercer y Cuarto&nbsp;Dormitorio - Ambos son contiguos, con ventana a patio.<br> <br> Quinto Dormitorio - Está junto al salón, con ventana a patio.<br> <br> Cocina - Ubicada junto al salón, es independiente con ventana a patio y está completamente equipada con nevera, horno, lavadora, nevera y vitro-cerámica.<br> <br> Baños - Dos baños completos. El primer baño dispone de bañera&nbsp;- El segundo baño es muy completo con dos lavabos, dos inodoros independientes y ducha. Ambos baños tienen ventana a patio.<br> <br> El piso se completa con suelos de roble y pinotea, calefacción y agua caliente son de gas individual, puertas originales lacadas en&nbsp;color blanco, y paredes pintadas en blanco con gotelé. Las ventanas son de madera con cristal sencillo.<br> <br> Su ubicación es excelente dado que se encuentra junto a la Catedral de Santiago y El Arenal, dos de las zonas más emblemáticas del Casco Viejo a la vez que muy&nbsp;bien comunicado y cercano a la parada de&nbsp;metro de la plaza&nbsp;Unamuno, líneas de autobuses, linea de tren&nbsp;Euskotren&nbsp;y cercano la estación de&nbsp;Abando&nbsp;de&nbsp;Renfe, y tranvía.<br> <br> El piso en venta esta ubicado en el&nbsp;Casco Viejo, que&nbsp;es el barrio más antiguo y el núcleo originario de la ciudad de Bilbao. Destaca, asimismo,&nbsp;por ser uno de los principales núcleos comerciales, de ocio y turismo de la villa de Bilbao. Sumergirse por las estrechas calles del casco es toda una delicia. Pasear por el&nbsp;centro histórico&nbsp;es algo obligatorio en una visita a la ciudad. Calles y callejuelas adoquinadas, que formaron el origen de la villa y que ahora mantienen esa arquitectura tan característica con sus magníficos edificios de madera en los que destacan los miradores acristalados y balcones. En sus calles peatonales, los comercios clásicos se alternan con los más innovadores y con abundantes bares y restaurantes en los que degustar lo mejor de la gastronomía vasca. Sin olvidar que, en sus rincones, encontraremos las iglesias y los monumentos más antiguos de la ciudad: la Catedral de Santiago, la Iglesia de San Antón&nbsp;o el Museo Arqueológico. &nbsp;<br> <br> Para más información, &nbsp;visita&nbsp;nuestra&nbsp;pagina web<br> <br> &nbsp;.',5,2,'43.2600456,-2.9223168',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>190 m² construidos, 175 m² útiles</li> <li>5 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación oeste</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética del edificio terminado: <span title="e" class="icon-energy-c-6"></span> (170,4 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor',NULL,NULL),
