 (558,11,NULL,548,282,450000,'Calle Masustegi, 19','48014','venta','piso','Piso en venta en calle Masustegi, 19','A 5 minutos del Casco Viejo, de todos sus comercios, servicios y vida cultural y social. En una zona tranquila y residencial. Se trata de un inmueble de 282 metros construidos a todo lujo y detalle. Espacios abiertos y en perfecta combinación. Está distribuido en un amplio recibidor que se une al salón, de frente, y a comedor, a mano izquierda. Del recibidor, se accede a las 3 habitaciones y al baño para visitas e invitados. La habitación principal, es completamente exterior, tiene un espacioso baño con jacuzzi, también exterior, un vestidor y la posibilidad de añadir unos 20 metros más como vestidor adicional, gimnasio o estudio. Otra de las habitación se emplea actualmente como despacho y sala de lectura con un amplio ventanal. La tercera habitación es espaciosa, con cama doble, vestidor y acceso al propio al baño de visitas, sin ser tipo suite. La cocina es independiente, amplia con mucho espacio de almacenaje y encimera. Todos los electrodomésticos son de alta gama y tiene un amplio ventanal con vistas a la calle. Cuenta con algunas paredes de cristal para integrarla dentro del resto de espacios de la casa. Desde la zona del comedor se puede acceder a un amplio trastero dentro del inmueble. Hay dos accesos, uno desde el portal principal y otro particular del inmueble que da directamente a la calle. Todos los materiales son de alta gama, diseño original y con mucho juego entre espacios.',3,2,'43.2570866,-2.9137979',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>282 m² construidos, 272 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Trastero</li> <li>Certificación energética del edificio terminado: <span title="f" class="icon-energy-c-7"></span> (203 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior',NULL,NULL),
 (559,11,NULL,559,73,245000,'Calle Auntzetxeta','48009','venta','piso','Piso en venta en calle Auntzetxeta','Piso en venta en Basurto -Auntzetxeta&nbsp;totalmente reformado&nbsp;y listo&nbsp;para entrar a vivir. Goza de gran altura, completamente exterior con mucha luz y tiene una muy cómoda ubicación dentro de la zona (primera línea, sin subir cuestas). En edificio construido en 2003, cuenta con ascensor a cota 0 (capacidad para 8 personas), videoportero e incluye garaje y trastero de acceso directo.<br> <br> La vivienda tiene 73 metros cuadrados que se distribuyen de la siguiente manera:<br> <br> Salón-comedor amplio con gran ventanal. Muy luminoso.<br> <br> Tiene recibidor.<br> <br> Cocina equipada con acceso a balcón cerrado. El balcón, como se ve en las fotos es amplio y es ideal para office y almacenaje.<br> <br> Dos habitaciones. Ambas exteriores. La principal dispone de vestidor y baño propio. Segunda habitación con armario empotrado.<br> <br> Dos baños. Uno en la habitación principal, con ducha. Segundo baño con bañera.<br> <br> El piso se encuentra en perfectas condiciones, con todo para poder vivir de inmediato. Las ventanas son nuevas de Pvc Climalit, suelos de madera en muy buen estado, así como las puertas. Las paredes son lisas.<br> <br> La casa tiene calefacción y agua caliente de gas individual. Se pagan 120 euros&nbsp;en gastos de comunidad, en el que se incluye el consumo de agua y recogida de basuras.<br> <br> Además se incluye una parcela de garaje para coche grande y un camarote. Ambos con acceso directo desde el mismo edificio.<br> <br> La vivienda está en Basurto, en Auntzetxeta, en un entorno muy tranquilo, lleno de zonas verdes, parques infantiles, el ambiente ideal para familias con niños (numerosas en la zona). Además se encuentra a pocos minutos caminando del centro de Basurto, con el Ambulatorio y Hospital a poca distancia y todos los innumerables servicios y transportes públicos de los que goza este núcelo de la Villa de Bilbao.<br> <br> Visita nuestra página web.',2,2,'43.2568702,-2.9549265',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>73 m² construidos</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación norte, oeste</li> <li>Construido en 2003</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética del edificio terminado: <span title="e" class="icon-energy-c-6"></span> (180 kWh/m² año)</li> <li>Vivienda apta para su uso por personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor','Garaje incluido',NULL),
 (560,11,NULL,560,69,119900,'Calle Hernani, 19','48013','venta','piso','Piso en venta en calle Hernani, 19','EXCLUSIVA&nbsp; &nbsp; &nbsp; E&amp;F ASESORES, gestiona en exclusiva la venta de un coqueto apartamento de 69,15 mts. catastrales&nbsp; para reformar y dejar a capricho en la calle Hernani en Bilbao La Vieja. Vivienda emblemática de techos bajos y vigas caravista con diferentes&nbsp;posiblidades de distribución.<br> <br> Se distribuye en amplio pasillo, gran salón comedor con salida a terraza y con vistas al monte, una dormitorio alcoba (con posibilidad de sacar un segundo), amplia cocina equipada con combi, lavadora, microondas, horno, vitrocerámica; &nbsp; con despensa y zona de office&nbsp;y un baño completo con plato de ducha. &nbsp;<br> <br> Dispone de suelos de tarima, ventanas de PVC, ventanas correderas de aluminio, &nbsp;puertas de madera y agua caliente eléctrico (toma de gas en tejado).<br> <br> El piso es muy luminoso y soleado, dando parte al exterior y parte a una patio manzana muy amplio y rehabilitado.<br> <br> Inmueble estructura de madera, tiene pasada la ITE en 2015. Con unos gastos de comunidad de 30 euros.<br> <br> Ubicado cerca de muelle Marzana, con locales de ocio con vistas a la ría.<br> <br> El inmueble se encuentra rodeado de todo tipo de servicios, en el mismo corazón de Bilbao, a pocos metros del Casco Viejo y de BILBOROCK, con lineas de autobús, tranvía, tren y a pocos minutos de boca de metro.<br> <br> No dejes pasar esta oportunidad. Llama y lo visitaremos.',1,1,'43.2563702,-2.9288908',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>69 m² construidos</li> <li>1 habitación</li> <li>1 baño</li> <li>Terraza</li> <li>Segunda mano/para reformar</li> <li>Orientación norte, sur</li> <li>Construido en 1910</li> <li>No dispone de calefacción</li> <li>Certificación energética del edificio terminado: <span title="f" class="