 (589,11,NULL,575,178,1100,'Zona Indautxu','48005','alquiler','piso','Alquiler de Piso en Zona Indautxu','INMOBILIARIA IRIZAR ALQUILA, Piso exterior reformado en INDAUTXU con terraza y balcón, piso alto, se alquila semiamueblado, distribuido en hall, salón comedor, 2 habitaciones, la habitación principal con vestidor y terraza, la segunda habitacion tambien con balcón, cocina muy amplia equipada y, baño con ducha amplia, agua caliente y calefacción de gas natrual, ascensor cota cero.<br> <br> En la Gran Vía don diego López de&nbsp;Haro&nbsp;se encuentran los edificios significativos del patrimonio monumental El centro de Bilbao cuenta con interesantes zonas de gran interés cultural, social y comercial de Bilbao, además del ParqueE de Doña Casilda y El Palacio Euskalduna.<br> <br> En&nbsp;Indautxu&nbsp;se encuentra el centro cultural y deportivo “Azkuna&nbsp;Zentroa” “ La Alhóndiga” donde se pueden realizar y disfrutar distintas actividades. Junto a la cercana plaza de&nbsp;Indautxu&nbsp;se congregan una serie de calles comerciales y hosteleras con una oferta variada y diversa. Además cuenta con la “Estación Intermodal Bilbao”, &nbsp; que cuenta con una zona comercial, otra Deportiva, así como un Hotel y Residencia de Estudiantes y, “El Estadio de San Mamés”.<br> <br> Gracias al metro, el tranvía y a los servicios de&nbsp;bilbobus, moverse por el centro de Bilbao resulta fácil y cómodo.',4,1,'43.2637465,-2.9403597',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>75 m² construidos, 70 m² útiles</li> <li>2 habitaciones</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética del edificio terminado: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edi