 (600,6,NULL,600,72,900,'Calle de Pizarro','36215','alquiler','piso','Alquiler de Piso en calle de Pizarro','En la calle Pizarro disponemos de esta fantástica vivienda de 131 m2 construidos, con primeras calidades y A ESTRENAR!<br><br>La vivienda se distribuye de la siguiente forma:<br><br>Recibidor con armario empotrado, amplio salón de unos 23.9 m2 con acceso a una terraza de unos 18,5 m2. A través de un pequeño pasillo llegamos al distribuidor. Desde éste, podemos acceder a los tres dormitorios (todos ellos con armarios empotrados, teniendo el principal tres armarios), baño de uso común y a la cocina totalmente equipada y con electrodomésticos de primeras marcas (placa de inducción, lavavajillas, lavadora, horno, frigorífico). El segundo baño es en suite (dormitorio principal) y ambos baños tienen ventana a patio de luces.<br><br>La calefacción y el agua caliente son de gas ciudad con contador individual.<br><br>Los gastos de comunidad y el seguro de alquiler están incluidos en el precio.<br><br>La vivienda no dispone de garaje pero existe la posibilidad de adquirir plaza en la zona en régimen de alquiler (en torno a 100-110€ IVA incluido).<br><br>Se aceptan mascotas siempre que no molesten a la comunidad y tendrán que ser aceptadas previamente por los propietarios. La tenencia de animales domésticos supondrá una fianza a mayores equivalente a un mes de renta.<br><br>Como garantía se requiere el mes de fianza para la Xunta.<br><br>Para más información, visitas y reservas contacta con nosotros en el teléfono 986 228 918 o envíanos un correo electrónico a info @distrito85. es <br><br>Otras ofertas inmobiliarias en nuestra página web www. distrito85. es.',4,2,'42.2301374,-8.7096929',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>131 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Segunda mano/buen estado</li> <li>Construido en 1960</li> <li>Cocina equipada y casa sin amueblar</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 5ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,NULL,NULL),
