 (621,6,NULL,617,98,177000,'As Travesas - Balaídos','36206','venta','ático','Ático en venta en As Travesas - Balaídos','Vivienda reformada en Castelao, enfrente del parque de la Bouza, de 82 m2 construidos, aproximadamente 74 m2 útiles, rodeada de zonas verdes.<br><br>Se encuentra ubicada a escasos metros del ambulatorio de Coia, a 5 minutos a pie del supermercado alcampo, y cercano al Estadio de Balaidos, nos encontramos con una vivienda situada con varios servicios cercanos como podemos observar.<br><br>Se trata de una sexta altura, en este caso la ultima del edificio, el cual esta al día de derramas, tanto de la fachada, bajantes, tejado y barreras arquitectónicas.<br><br>La distribución de esta vivienda se caracteriza por la zona de día y zona de noche, nada mas entrar en la vivienda tenemos el hall de entrada con acceso directo a un salón comedor con cocina americana equipada con todos los electrodomésticos.<br>Disponemos de tres dormitorios amplios, el principal con armario empotrado, baño común con plato de ducha y zona de lavandería.<br><br>*La vivienda dispone de parking público justo en la entrada al edificio para su uso y disfrute, no siendo este propiedad de la comunidad.<br><br>**La habitación principal ha sido decorada para el reportaje fotográfico.<br><br>***La tercera habitación se compone de un armario hecho a medida, el cual no consta en el reportaje fotográfico.<br><br>Consúltenos sin compromiso.<br><br>Sólo estamos haciendo lo que lleváis tiempo pidiendo.<br>Si quieres comprar o vender, grupogalo. es<br>Encuentra más en.',3,1,'42.2152602,-8.7464301',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>98 m² construidos, 82 m² útiles</li> <li>3 habitaciones</li> <li>1 baño</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación oeste</li> <li>Construido en 1983</li> <li>Calefacción central</li