 (625,6,NULL,619,350,635000,'Calle Arquitectos Castro e Alonso, 1','36203','venta','chalet adosado','Chalet adosado en venta en calle Arquitectos Castro e Alonso, 1','Chalet 350 m² en Vigo, Pontevedra En la mejor urbanización de Bouzas entre la playa y la ciudad, encontramos este magnifico adosado, distribuido de la siguiente forma:<br> En la primera, tras acceder por la puerta principal con pequeño porche y jardín, nos situamos en el hall desde el que se abre la vista al espacioso salón, dos puertas dan acceso a la cocina y aseo de cortesía, garaje y encontramos las escaleras de acceso a primera planta y semi-sótano.<br><br>El salón con dos ambientes diferenciados se une al jardín a través de un porche que los propietarios han ampliado, para conseguir, una zona de estar, comedor y espacio de trabajo muy acogedores tanto en invierno como en verano. <br><br>La cocina es moderna y cálida con electrodomésticos de alta gama y muebles a medida.<br><br>En la primera planta el distribuidor da acceso a tres dormitorios con armarios empotrados, uno de ellos suite con un amplisimo vestidor, y un baño completo.<br><br>El bajo cubierta es un amplio espacio con zonas de descanso, ocio y estudio, don de se podrian hacer otros dos amplios dormitorios y un baño.<br><br>En el semí-sótano se ubica un amplisimo salón, cuarto de servico, de lavandería, y espacio para la caldera y trastero.<br><br>La calefacción y acs es individual a gasoil.<br><br>En el año 2008 la vivienda se remodelo totalmente. Más recientemente fueron obras en el exterior (tejado) y por parte de la comunidad en aceras y asfaltado.<br><br>La urbanización en la que se encuentra este magnífico adosado se caracteriza por el estado impecable de los porches ajardinados, las instalaciones comunes (espacio social, cancha de tenis y piscina) y el ambiente familiar que se respira en ella.<br><br>Está en Alcabre, una pequeña parroquia litoral densamente poblada, cerca del centro de Bouzas con todos los servicios y espacios de ocio que ofrece, y muy cerca de pequeñas playas además de la de Samil, que le confieren una magnífica calidad de vida. <br><br>Desde la urbanización se accede rapidamente a la circunvalación para conectar con la autovía y autopista. Muy cerca de la ciudad de Vigo, también es posible llegar a diferentes zonas de ésta con transporte urbano fregular y frecuente.<br>Le informaremos personalmente en nuetro lounge de c/ Pintor Laxeiro nº 9 Vigo.',4,2,'42.2219193,-8.7555997',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Chalet adosado</li> <li>4 plantas</li> <li>350 m² construidos</li> <li>4 habitaciones</li> <li>3 baños</li> <li>Parcela de 200 m²</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="d" class="icon-energy-c-5"></span> (IPE no indicado)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Piscina </li> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
