 (629,6,NULL,619,114,325000,'Calle do Ecuador','36211','venta','piso','Piso en venta en calle do Ecuador','Piso 114 m² en Vigo, Pontevedra RESIDENCIAL ECUADOR 73<br><br>Edificio regio de de 1962 proyectado por el prestigioso Arquitecto Antonio Cominges.<br><br>Calidades de alto standing, para uno de los edificios de referencia en la ciudad de Vigo.<br><br>Amplias viviendas de tres dormitorios.<br><br>Todas las viviendas cuentan con:<br><br>Cocina:<br>Frente de cocina amueblado con muebles altos y bajos de alta calidad fabricados con materiales hidrófugos y herrajes de acero inoxidable de máxima calidad de fabricación alemana.<br>Encimera de Silestone o similar, con fregadero sobre encimera y grifo montando.<br>Electrodomésticos: horno, placa de inducción, campana extractora, frigorífico y lavavajillas de la marca Siemens.<br><br>Cuartos de baño:<br>Inodoros con tanque empotrado de primera calidad marca Roca.<br>Griferías montando en lavabos y termostáticas en duchas, cromadas en baño general y lavados negro mate en baño principal.<br>Platos de ducha de gran formato de perl bajo y mamparas de primera calidad.<br><br>Carpintería interior:<br>Puerta de entrada a viviendas blindada con cerradura de seguridad lacada en blanco.<br>Puertas interiores acabado en lacado blanco con herrajes y manillas en acero inoxidable mate.<br>Vidrieras en cocinas hacia salón.<br>Armarios empotrados fabricados a medida con puertas lacadas en blanco e interiores en melanina.<br><br>Instalación de calefacción y agua caliente sanitaria.<br>Producción de ACS y calefacción mediante caldera de condensación a gas de máxima eciencia marca FERROLI.<br>Apoyo en la producción de ACS y calefacción mediante instalación solar ubicada en cubierta.<br><br>Ecuador 73 va a ser una promoción de viviendas únicas, tanto por la calidad, como por la singularidad del inmueble.<br><br>Con privilegiada ubicación, entre la nueva transformación de la ciudad, pocas ubicaciones podrán ofrecerle tanto.<br><br>La calidad y belleza de la arquitectura clásica se fusionará con la construcción y nuevas técnicas para crear una pieza de arte y tecnología.<br><br>Acabados de alta calidad y la más alta tecnología constructiva.<br><br>Información personalizada en nuestro bureau en Calle Pintor Laxeiro nº 9, Vigo.',3,3,'42.2315211,-8.7149869',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>114 m² construidos, 95 m² útiles</li> <li>3 habitaciones</li> <li>3 baños</li> <li>Balcón</li> <li>Plaza de garaje por 20.000 € adicionales</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Calefacción individual</li> <li>Certificación energética: <span title="b" class="icon-energy-c-3"></span> (IPE no indicado)</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 1ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'1ª planta exterior con ascensor','opc. 20.000 €',NULL),
