 (633,6,NULL,628,116,238000,'Calle Ecuador','36205','venta','piso','Piso en venta en calle Ecuador','Cómodo y moderno piso, al que se le ha realizado una completa reforma integral, y que está situado en la céntrica calle Ecuador, en el entorno del Corte Inglés, una zona ideal para vivir por la comodidad que ofrece al tener todos los servicios cerca. <br>La vivienda, un piso 7º de un edificio de pocos vecinos, tiene una superficie de 107m² que se distribuyen en amplio salón comedor con orientación a la calle Ecuador, tres dormitorios y dos baños, (la habitación principal con baño en suite) y una estupenda cocina muy soleada, moderna y funcional. Aunque todos los dormitorios cuentan con armarios empotrados, la vivienda dispone además de un amplio armario empotrado en el pasillo con gran capacidad de almacenaje. <br>Al tratarse de una séptima planta la vivienda disfruta de mucha luz, especialmente la parte sur a la que está orientada la cocina y el dormitorio principal. Los otros dos dormitorios están orientados a dos patios de luces también luminosos dada la altura del piso. <br>La calefacción y el agua caliente son de gas natural. Suelos de parquet en toda la vivienda. <br>Dispone de un pequeño trastero exterior en la misma planta. <br>Gastos de comunidad: 60€/mes. <br>Edificio con rampa de acceso en el portal hasta el ascensor (el ascensor no llega hasta la séptima planta, pero existe estudio y presupuesto para acometer esta obra y subir el ascensor hasta la misma planta). <br>La vivienda no dispone de plaza de garaje pero existe la posibilidad de alquilar en garaje cercano.<br>Edificio sin derramas pendientes.<br>Más información en inmobiliarianuevoestilovigo. com.',3,2,'42.2337043,-8.7239843',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>116 m² construidos, 107 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: en trámite</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 7ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'7ª planta exterior con ascensor',NULL,NULL),
 (634,6,NULL,634,100,320000,'Calle México, 37','36205','venta','piso','Piso en venta en calle México, 37','Oportunidad única: piso con techos altos dividido en 2 apartamentos independientes, ya amueblados y listos para alquiler independiente, con licencia para alquiler vacacional, situado en el centro de Vigo, al lado de El Corte Ingles, a cinco minutos andando de la Plaza de España y a otros 5 minutos de la estación de tren. Una de las ubicaciones más céntricas de Vigo.<br><br>Las puertas tienen cerradura por código y el portal de entrada apertura por aplicación móvil.<br><br>Puedes alquilar los dos, vivir en uno y alquilar el otro,.. . tu decides. <br><br>Haz números: tienes la posibilidad de que te pague la hipoteca y a mayores también puedes ganar dinero.<br> <br>El piso de 100 m2 está dividido en 2 apartamentos independientes de 50 m2 cada uno muy bien distribuidos.<br>Está totalmente reformado y amueblado, con acabados de primera calidad, y listo para entrar a vivir.<br><br>En cada uno de los apartamentos, tenemos:<br><br>Una habitación de matrimonio.<br>Un baño totalmente amueblado con plato de ducha.<br>Una cocina americana <br>Un salón con sofá-cama para dos personas. <br><br>Cuenta con agua caliente sanitaria por termo eléctrico, calefacción individual eléctrica, ventanas de madera originales con cristales climalit, carpintería interior en madera, instalaciones de fontanería y electricidad reformadas, suelos de tarima flotante en todas las estancias. <br>Techos altos de 3 metros, que le dan luminosidad y espacio a la estancia. Ascensor nuevo. <br><br>Sin duda en una ubicación sin igual.<br>Todos los servicios a la mano; zona comercial, supermercados, farmacias, gimnasios, restaurantes, cafés, paradas de autobús y taxis, centro de salud, colegios, parque infantil y zonas verdes.<br>A 200 metros del futuro centro comercial Vialia, donde se concentrarán la estación del AVE y la estación de autobuses.<br><br>A 200 metros de la futura Ciudad de la Justicia y cerca de las rampas de Gran Vía ya casi terminadas. <br> todo esto hará que esta zona se revalorice aproximadamente en un 30%, ¿aun te lo tienes que pensar!<br><br>Un piso con múltiples opciones, actualmente se esta trabajando como vivienda vacacional y generando unos ingresos de 20 000€ al año aproximadamente. <br><br>Llámame y consúlteme lo que necesite sin compromiso. Organizaré una visita y no dudarás en que esta es tu inversión".',2,2,'42.23175,-8.7161974',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>100 m² construidos, 96 m² útiles</li> <li>2 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Orientación oeste</li> <li>Construido en 1951</li> <li>Calefacción individual: Eléctrica</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 4ª exterior </li> <li> con ascensor </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'4ª planta exterior con ascensor',NULL,NULL),
