 (637,6,NULL,628,320,1998000,'Arquitecto Antonio Cominges','36212','venta','casa o chalet','Casa o chalet independiente en venta en Arquitecto Antonio Cominges','Original y único chalet situado en primera línea de mar, con acceso directo a la playa, en Cabo Estai, una de las zonas más exclusivas del sur de Galicia.<br><br>En una parcela ajardinada de 1.250 m², encontramos la vivienda principal que cuenta con una superficie de 320 m² dividida en dos alturas. A través del porche cerrado accedemos a la planta baja que es donde se ubican casi todas las estancias de la casa, lo que le aporta mucha comodidad, distribuida en dos amplios salones, divididos en dos ambientes desde los que se disfrutan las impresionantes vistas al mar, un despacho anexo (originalmente dormitorio), una gran cocina con despensa, y lavandería con su baño con entrada independiente para esta zona, dos buenos dormitorios con dos baños en suite completan esta planta. Desde el distribuidor de la entrada principal y a través de unas escaleras accedemos a la planta superior donde encontramos otro dormitorio, un baño completo con ducha y otra estancia actualmente utilizada como vestidor. Todos los dormitorios cuentan con amplios armarios empotrados.<br><br>La propiedad dispone además de una casa de invitados en la misma parcela, perfectamente acondicionada y con una superficie de 114 m², que se distribuye en un salón con cocina americana, dos dormitorios y un baño completo.<br><br>Calefacción y agua caliente de gasoil.<br><br>Garaje independiente subterráneo de 186 m² con acceso desde el exterior, con capacidad para tres coches que cuenta también con una sala de almacenaje.<br><br>Esta propiedad está ubicada en la urbanización de residencias de lujo de Canido, en el municipio de Vigo, a tan sólo 10 km del centro de la ciudad, un entorno idílico para vivir, con sus tranquilas playas, su Club Marítimo y su zona residencial de viviendas unifamiliares, con seguridad privada 24 horas y servicio de autobús urbano, que la convierten en un enclave perfecto para residir durante todo el año.<br><br>Más información en inmobiliarianuevoestilovigo. com.',6,3,'42.1893954,-8.8052146',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>2 plantas</li> <li>320 m² construidos</li> <li>6 habitaciones</li> <li>5 baños</li> <li>Parcela de 1.250 m²</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Calefacción individual</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
