 (642,6,NULL,640,501,375000,'Castrelos - Sárdoma','36205','venta','casa o chalet','Casa o chalet en venta en Castrelos - Sárdoma','Se vende en exclusiva este gran chalet con parcela de 1034 m2 con espacio para piscina y zona de barbacoa, ubicado en la zona de Castrelos, situado por encima del parque. Se encuentra rodeado de bonitas y lujosas viviendas. Dispone de vistas despejadas e incluso se puede ver la ría de Vigo y las Islas Cíes desde las plantas superiores. Consta de 3 plantas de unos 110m2 cada una y un espacio destinado a plazas de aparcamiento y almacenaje de 126m2. Además dispone de un cenador con cocina exterior y barbacoa. <br>En la planta baja encontramos un gran salón, espaciosa cocina (para reformar), baño completo y aparcamiento. La primera planta está dividida en 3 dormitorios amplios (uno de ellos de 21m2 con salida a gran terraza), un baño completo y una pequeña estancia interior. En la segunda planta podemos ver otros cuatro dormitorios muy espaciosos y con vistas y un baño completo. Cuenta con calefacción por caldera de Gasoil y suelos de parquet. Como se puede apreciar en las fotografías, es necesaria una mejora. El jardín de unos 1000m2 de superficie consta de 2 entradas, una para automóviles (Este) y una peatonal (Oeste). Sin duda muy buena opción familiar por su ubicación e integración en el núcleo urbano. Próximo a paradas de autobús y conexiones.',6,3,'42.2131268,-8.7231021',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet</li> <li>501 m² construidos, 425 m² útiles</li> <li>6 habitaciones</li> <li>4 baños</li> <li>Parcela de 1.034 m²</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/para reformar</li> <li>Armarios empotrados</li> <li>Orientación este</li> <li>Construido en 1978</li> <li>Calefacción individual</li> <li>Certificación energética: en trámite</li> </ul> </div> </d