 (676,12,NULL,676,153,299000,'Campo Grande - Arco Ladrillo','47010','venta','piso','Piso en venta en Campo Grande - Arco Ladrillo','En venta por tan solo 299.000€ o alquiler en 900€ más comunidad incluyendo el 30% del consumo de calefacción. La vivienda de tus sueños, diseñada por una arquitecto de interiores, céntrica, junto a las estaciones, este fabuloso piso de 108 m2 útiles reformado íntegramente se distribuye en hall que da acceso a la zona de estar-cocina-comedor, amplias estancias comunicadas entre sí pero con independencia, la zona de estar cuenta con un amplio ventanal mirador por lo que la luz inunda hasta el último rincón. Del pasillo una puerta corredera da paso a la zona de descanso con tres dormitorios muy espaciosos, el principal dispone de un gran armario empotrado y baño con dos senos, un segundo baño da servicio a la vivienda. Y por último dos trasteros, uno en el sótano y otro en el ático, que te permitirán tener la casa mas desahogada y siempre recogida. En la vivienda prima la calidez, la elegancia, la claridad, el buen gusto, las excepcionales vistas, seguro que te enamora tanto la casa como su ubicación, a escasos metros del Campo Grande y de la Plaza Zorrilla. ¿Te interesa? Solicita una visita ahora a través del 983.29. 22.88 o rellena el formulario que encontrarás aquí debajo. Ponte en contacto con nosotros y te proporcionaremos toda la información que necesites sobre esta y otras ofertas de pisos en venta en Valladolid y alrededores.',3,2,'41.6413393,-4.7286514',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>153 m² construidos, 109 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación oeste</li> <li>Construido en 1962</li> <li>Calefacción central</li> <li>Certificación energética: <span title="e" class="icon-energy-c-6"></span>