 (690,12,NULL,690,142,850,'Calle Padre Francisco Suárez','47006','alquiler','piso','Alquiler de Piso en calle Padre Francisco Suárez','Piso en alquiler junto al paseo zorrilla, muy próximo al campo grande, plaza zorrilla.<br>Amplio piso luminoso, con vistas espectaculares al río pisuerga<br>zona céntrica, comercial y bien comunicada con el resto de la ciudad.<br>Zona campo grande con colegios, centros médicos y espaciosas avenidas.<br>115 metros útiles de vivienda distribuídos en:<br>tres habitaciones con armarios a medida, una de ellas con galería cubierta.<br>Salón de 33 metros independiente y luminoso y amplia galería cubierta con preciosas vistas al río pisuerga.<br>Cuenta con calefacción de gas natural.<br>Cocina totalmente equipada con todos los electrodomésticos.<br>Dos cuartos de baño uno con ducha y otro con bañera.<br>Garaje en el mismo edificio con acceso directo en ascensor sin escaleras.<br>Portero.<br>Dos entradas a la vivienda por hall y cocina.<br>Caracteristicas de la vivienda:<br>suelos de madera.<br>Ventanas de climalit con persianas automáticas.<br>Puertas de madera.<br>Armarios empotrados.<br>Amueblado.<br>Exterior con fantásticas vistas al río pisuerga.<br>Finca en perfecto estado con 2 ascensores y un tercero únicamente para acceder al garaje.<br>Portal sin barreras arquitectónicas, amplio y con rampa.<br>Si buscan amplio piso con garaje en el mismo edificio estaremos encantados de enseñarselo.<br>Inmobiliaria torrecilla 983045850.',4,2,'41.644752,-4.7339587',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>130 m² construidos, 115 m² útiles</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: en trámite