 (713,10,NULL,709,100,800,'Montecerrao','33008','alquiler','piso','Alquiler de Piso en Montecerrao','Espectacular piso en alquiler amueblado de super lujo, en la preciosa Zona de Montecerrao.<br><br>ATENTOS ESTUDIANTES Y/O MIR!<br><br>Dispone de tres habitaciones, con tres armarios empotrados, uno situado en dos dormitorios y el tercero en el pasillo; con un gusto exquisito en su decoración. Dos baños, uno suite con ducha – mampara y otro con bañera – mampara. Cocina equipada al completo con electrodomésticos, de alta gama. Despensa de seis mts. , cuadrados. Terraza abierta de más de once mts. El Salón-Comedor es simplemente precioso, de lo mas calientin y acogedor. Incluye Trastero. Plaza de garaje opcional por 50€.<br><br>COMPLETAMENTE EXTERIOR! ORIENTACIÓN SUR.<br><br>Ventanas de PVC en el exterior y madera en el interior, con doble acristalamiento. Pavimento de tarima flotante y material porcelánico. Servicios individuales de gas para calefacción y agua caliente, con mínimo de agua fría incluido en la comunidad.<br><br>SE ENTREGA COMPLETAMENTE EQUIPADO PARA ESTUDIANTES Y/O MIR!<br><br>Zonas verdes en la urbanización y cancha de paddle.<br><br>Caminando al campus del Cristo 4 minutos, al Seminario y Escuela de Magisterio Padre Ossó 18 minutos y al campus de Llamaquique unos 15 minutos. A unos metros del propio portal, parada de autobús, hacia todas las zonas de nuestra hermosa capital.<br><br>Un autentico piso en alquiler de alto standing en la hermosa Zona de Montecerrao.',3,2,'43.3523224,-5.8692112',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>100 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje por 50 €/mes adicionales</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual</li>