 (723,10,NULL,716,90,600,'SAN PEDRO DE NAVES','33011','alquiler','casa o chalet','Alquiler de Casa o chalet independiente en SAN PEDRO DE NAVES','Zona san pedro de naves // la carcoba // san esteban de las cruces <br>casa de pueblo independiente con finca cerrada //entrada compartida <br>600 solo la vivienda //700 vivienda y dos anexos <br>SOLO CALEFACION DE CHIMENEA O ELECTRICA. <br><br>horario comercial de lunes a viernes de 09.30-19.00 <br>consulta visitas fuera del horario comercial <br><br>importante la entrada de la vivienda es con acesso a otra de las fincas: entrada compartida.<br>Los anexos de vivienda se pueden alquilar por separado <br><br>casa de dos plantas:<br><br>- en la primera planta dispone de cocina con vitro <br>salón con chimenea <br>despensa <br>y baño completo con bañera <br>El televisor, horno y lavadora son nueves de noviembre del 2020<br><br>- en la segunda planta:<br>tres dormitorios: uno con cama de matrimonio, otro con dos camas y el tercero con cama individual <br>En esa planta hay un descansillo con acesso al desvan <br><br>finca cerrada de unos 900 metros, con portilla de acceso<br><br>calefacción de chimenea, ventanas de pvc de climalit, suelos de gress <br><br>admite mascotas fuera de la vivienda <br><br> <br>requisitos: mes agencia + mes fianza + mes renta <br><br>ubicación: situada en san esteban de la cruces, zona san pedro de naves, zona rural, con impresionantes vistas de la naturaleza y total tranquilidad.<br><br>Consultar a traves de nuestra pagina web, correo electronico, wasap y telefono.',3,1,'43.3335553,-5.7900604',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet independiente</li> <li>2 plantas</li> <li>90 m² construidos, 80 m² útiles</li> <li>3 habitaciones</li> <li>1 baño</li> <li>Parcela de 900 m²</li> <li>Segunda mano/buen estado</li> <li>Orientación sur</li> <li>Se admiten mascotas</li> <