 (754,10,NULL,715,147,520000,'Viaducto del Ingeniero Marquina','33006','venta','dúplex','Dúplex en venta en Viaducto del Ingeniero Marquina','Piso dúplex en venta en zona centro de Oviedo (Asturias, España). <br> <br>PRECIO: 520.000 €. <br>Superficie construida: 147 m². <br>3 habitaciones y 3 baños. <br>4ª y 5ª planta exterior. <br>3 plazas de garaje y trastero incluidos.<br><br>Piso dúplex en venta situado en la calle Ingeniero Marquina, junto a la Escuela de Minas y a escasos metros de la calle Uría y estación de Renfe, en pleno centro de Oviedo. La vivienda está ubicada en un edificio construido en 2001, sin barreras arquitectónicas y que cuenta con ascensor.<br>Se trata de dos pisos, situados en la 4ª y 5ª planta, que se han unido y reformado integralmente. <br>La planta 4ª tiene una superficie construida de 76 m² distribuidos en salón, comedor, cocina amueblada y equipada, cuarto de lavadora/secadora y un aseo.<br>La planta 5ª dispone de una superficie construida de 71 m² en los que tenemos distribuidor, tres habitaciones (el dormitorio principal con baño incorporado) y dos baños completos. <br>Este exclusivo dúplex se encuentra en perfecto estado y dispone de calefacción individual de gas ciudad, suelos de mármol y de parquet, armarios empotrados, ventanas de doble acristalamiento, puerta de seguridad, videoportero, etc. Orientación noroeste.<br>Gastos de comunidad: 340 € al mes.<br><br>Sellmi | Inmobiliaria | Real Estate. <br>Encuentra más en.',3,3,'43.3660745,-5.8535297',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>147 m² construidos</li> <li>3 habitaciones</li> <li>3 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación norte, oeste</li> <li>Construido en 2001</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: <s