 (756,10,NULL,744,305,475000,'Calle Peña Santa de Enol, 39','33008','venta','casa o chalet','Casa o chalet en venta en calle Peña Santa de Enol, 39','Chalet individual en una de las mejores zonas residenciales de oviedo.&nbsp;a 150 metros del colegio auseva, a 350 metros de la estacíon de tren, clínica asturias y a 5 minutos andando del centro de oviedo.<br>Es una casa de muy buena construcción.<br>Puedes ver un plano con cada planta, cotas, medidas parcela y dos vídeos al final de las fotos para verlo todo con mas detalle.&nbsp;de 305 metros construidos y &nbsp;288 metros útiles.<br>Muy bien distribuida, con huecos grande y como mucha luz.<br>La planta sótano tiene 95 metros ùtiles, distribuida en zona de taller, bodega, despensa, habitación, zona de lavadora con acceso desde el exterior e interior y garaje de 39 metros útiles para 3 coches.<br>La planta baja tiene 103 metros útiles,distribuida enporche de 7 metros, un hall, un salón - comedor de 45 metros con chimenea con acceso a una terraza de 14 metros con orientación suroeste, otro comedor que puede ser una habitación o despacho, una cocina totalmente equipada, un baño con ventana y una habitacíon.&nbsp;la primera planta tiene 90 metros construidos,distribuidos en tres grandes habitaciones, dos de ellas tienen baño con ventana dentro de la habitación.<br>Uno de los baños tiene dos puertas donde se puede acceder por la habitación y por el pasillo dando servicio a la tercera habitación.<br>Una de las habitaciones tiene un gran vestidor y otra tiene acceso a un terraza de 12 metros con fantásticas vista de oviedo y orientada al suroeste.<br>Desde el extrior y al lado de &nbsp;la puerta de entrada tienes el acceso a una zona de parking -patio de 150 metros aproximadamente donde se puede utilizar para dejar los coches cuando vengan los amigos, para que jueguen los niños, para poner una canasta de baloncesto, etc etc.<br>La casa &nbsp;tiene un jardín de 250 metros aproximadamente para disfrutar haciendo un pequeño huerto, disfrutar de una buena barbacoa, poner un piscina en verano para que disfruten los niños y mayores, etc.<br>La calefacción y agua caliente es de gas ciudad con caldera individual.<br>El tejado se reformó hace 20 años.<br>Con todos los servicios cerca: mercadona a pocos metros, colegio auseva, colegio santa maría del naranco (antiguo ursulinas), colegio público san pedro de los arcos y pista finlandesa para caminar o correr &nbsp;respirando aire puro en plena naturaleza.<br>Si buscas un chalet individual &nbsp;para reformar a tu gusto a 5 minutos andando del &nbsp;centro de oviedo...<br>No busques más.<br>Ya lo has encontrado!llámanos sin compromiso o mándanos un whatsapp para cualquier duda.<br>Tlf -whatsapp 637 41 68 69&nbsp;&nbsp;&nbsp;.',5,2,'43.3660762,-5.8604646',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li> Casa o chalet</li> <li>305 m² construidos, 288 m² útiles</li> <li>5 habitaciones</li> <li>3 baños</li> <li>Parcela de 547 m²</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/para reformar</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación sur, este, oeste</li> <li>Construido en 1963</li> <li>Certificación energética del edificio terminado: <span title="g" class="icon-energy-c-8"></span> (450,9 kWh/m² año)</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Jardín </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,NULL,'Garaje incluido',NULL),
