 (787,7,NULL,783,262,319000,'Calle Coronel Aureliano Buendía, 31','10004','venta','dúplex','Dúplex en venta en calle Coronel Aureliano Buendía, 31','Ático dúplex en venta en Cáceres, una vivienda acogedora, amplia, bien distribuida, diseño exclusivo, muy luminosa, en definitiva un hogar con muchísimo encanto. Situada en la prestigiosa Urbanización Macondo. Elegido y comprado en planos por ser el más privilegiado de todos los del Conjunto Residencial. Adquirirlo en planos permitió cambiar y mejorar de forma muy significativa las calidades de los materiales e instalaciones que ya tenía aprobado el Proyecto de Obra. Se hizo una gran inversión de futuro en materiales de alta gama, dotándola de ampliaciones de instalaciones eléctricas y telecomunicaciones para disfrutar de todas las comodidades de una vivienda exclusiva y de alto standing. La vivienda dispone de 151,36m2 más 2 terrazas, una junto al salón de 25,40 m2 y otra terraza solárium en planta Ático de 85,54 m2 que suman 262,30 m2. Consta de: Salón comedor muy amplio y con una terraza de 25,40 m2. Cocina de diseño y alta gama, totalmente equipada: electrodomésticos, televisión, despensa y lavadero. 4 habitaciones y 6 armarios empotrados íntegramente vestidos por la prestigiosa firma Nova-Armarios. 2 baños completos con muebles de Porcelanosa, uno con bañera hidromasaje y otro con ducha, ambos con columna de ducha termostática con rociador efecto lluvia. Calefacción individual de gas natural. AA. CC. frío calor por conductos en toda la vivienda y con sistema AIR ZONE (lo que permite que cada estancia de la casa puede tener la temperatura que se desee). Los 4 dormitorios, cocina y salón están dotados de tomas de TV, teléfono e Internet. Suelo de madera de roble en toda la casa y escaleras, excepto cocina y baños. Barandilla de Cristal y Acero. Plaza de garaje de casi 17 m2 y trastero de casi 15 m2, con estanterías. Zonas comunes con más de 3.500 m2 con jardines, parque infantil, mini golf, pista de pádel y piscina que se unen para ofrecer ocio, bienestar y calidad de vida.',4,2,'39.4703718,-6.4041366',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>262 m² construidos</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Construido en 2009</li> <li>Calefacción individual</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor','Garaje incluido',NULL),
