 (789,7,NULL,789,120,228800,'Calle María Auxiliadora, 3','10003','venta','piso','Piso en venta en calle María Auxiliadora, 3','POR EL ALTO PORCENTAJE DE VIVIENDAS VENDIDAS, ROGAMOS CONSULTE DISPONIBILIDAD.<br><br>El Edificio El Rodeo- Progemisa disfruta de una ubicación privilegiada, céntrica y tranquila, a 150 m. de la calle Antonio Hurtado y a 5 minutos a pie de la calle Cruz y Cánovas. En la zona alta de El Rodeo disfruta de unas espectaculares vistas sobre el Santuario de la Montaña y el parque, que cuenta con más de 8.000 plantas de 127 especies distintas, un estanque con fuente central, pista de patinaje y parques infantiles.<br><br>PROGEMISA proyecta en El Rodeo un edificio singular. Es el resultado de nuestra reflexión sobre el concepto del lujo en la promoción residencial. Mayores espacios, cuidado diseño, exigencia en la calidad y un privilegiado entorno, son las condiciones que convierten la experiencia del hogar en un verdadero punto y aparte en nuestra vida diaria.<br><br>Viviendas de 1,2, 3,4 y 5 dormitorios, magníficos áticos-dúplex, espaciosas, luminosas, bien orientadas, con materiales de primera calidad dan forma a hogares de ensueño. Hogares dotados con las últimas tendencias en domótica y de una alta eficiencia energética. La urbanización contará con piscina, zonas de juegos infantiles y control de acceso lo que ofrecerá la tranquilidad, privacidad y seguridad tan valorados por un cliente exigente.<br><br>Cada familia es diferente, y conscientes de ello, contemplamos distintas posibilidades de personalizar las viviendas que las permitan transformase en hogares únicos.',3,2,'39.4663895,-6.3742744',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>120 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Promoción de obra nueva</li> <li>Certificación energética de proyecto: no indicado</li> </ul> </div> </div> <div class="det