 (793,7,NULL,792,132,210900,'Ronda de San Francisco s/n','10002','venta','piso','Piso en venta en ronda de San Francisco s/n','En la Ronda de San Francisco comienza PROGEMISA una nueva Promoción de 112 viviendas ubicadas en una urbanización cerrada compuesta por 3 bloques, una dotación excelente con piscina, gran jardín, zona de juego de niños, pista de padel, pabellón de usos múltiples, etc. que suponen el perfecto club privado en tu propio residencial… <br> <br>Viviendas con jardín privado en planta baja, áticos con magníficas terrazas y 3 o 4 dormitorios y viviendas de 3 dormitorios con un mínimo de 100 m2 útiles gozando todas de estupendas terrazas de 9 a 15 m2.<br> <br>Las amplias viviendas se caracterizan por una distribución vanguardista y unas calidades muy cuidadas, por supuesto acogidas al nuevo Código Técnico de la Construcción que las dota de unos aislamientos térmicos y acústicos de primer nivel.<br> <br>Puertas macizas DM lacadas en blanco o terminadas en roble, rotura de puente térmico en toda la carpintería exterior con doble acristalamiento de 20 mm, agua caliente por energía solar, alarma, primeras calidades en alicatados y sanitarios, amplias plazas de garajes y trasteros incluidos en el precio y toda la garantía de calidad de PROGEMISA. Todas las cantidades entregadas por los clientes se garantizan con aval bancario.<br> <br>La terminación y entrega de las viviendas en su 1ª fase se realizará en enero 2020.',3,2,'39.4643959,-6.3668993',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>132 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Plaza de garaje incluida en el precio</li> <li>Promoción de obra nueva</li> <li>Trastero</li> <li>Certificación energética de proyecto: no indicado</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="deta