 (802,7,NULL,802,165,600,'Calle Madame Curie','10004','alquiler','dúplex','Alquiler de Dúplex en calle Madame Curie','INMOBILIARIA CÁCERES OS PRESENTA: <br> <br>SOLAMENTE ALQUILER CON OPCIÓN A COMPRA. Abstenerse llamar quien no cumpla estas condiciones.<br><br>CONDICIONES:<br>ALQUILER MENSUAL 600€UROS<br>PRIMA INICIAL 20.000€UROS<br>PLAZO PARA COMPRA 2 AÑOS: <br>PRIMER AÑO SE DESCUENTA 100%<br>SEGUNDO AÑO SE DESCUENTA 80%<br>PRECIO VENTA 195.000€UROS.<br><br>Inmejorable ático dúplex en Residencial Infanta Isabel con todas las comodidades posibles. <br><br>La planta principal cuenta con hall de entrada espacioso, amplio salón de más de 25 metros con mucha luminosidad con mirador, dos dormitorios; el principal con terracita exterior y otro de 12 metros, pasillo cuadricular con armario empotrado en madera de roble, cuarto de baño completo con bañera, cocina totalmente equipada seminueva y terraza lavadero. <br><br>La primera planta dispone de dos dormitorios, uno de ellos con función de despacho con terraza acristalada y otro con terraza abierta con refuerzo de seguridad y altura para niños, baño completo con plato de ducha; también cuenta con plaza de garaje y trastero en el mismo edificio. <br><br>De único propietario, destacan como mejoras en la vivienda la calefacción por gas natural, aire acondicionado por conductos en las dos plantas, armarios empotrados a medida, suelo de tarima, pintura lisa, ventanas climalit con doble acristalamiento de gran protección y aislamiento, en algunas estancias oscilobatientes, toldos de regulación automática con salida y puesta de sol, carpintería de roble, puerta blindada… <br> <br>No tiene nada que ver con su construcción de origen, no se ha escatimado en las mejoras. Para entrar a vivir. Posibilidad de construir piscina en el residencial. Gran relación calidad precio en relación a otros inmuebles de las mismas características. Año de construcción 2009.<br><br>COCINA EQUIPADA, VIVIENDA SIN AMUEBLAR.',4,2,'39.4827612,-6.3750934',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>165 m² construidos</li> <li>4 habitaciones</li> <li>2 baños</li> <li>Terraza</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación este, oeste</li> <li>Construido en 2009</li> <li>Cocina equipada y casa sin amueblar</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: en trámite</li> <li>Acceso adaptado a personas con movilidad reducida</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 3ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'3ª planta exterior con ascensor','Garaje incluido',NULL),
 (803,7,NULL,802,136,550,'Roso de Luna','10005','alquiler','dúplex','Alquiler de Dúplex en Roso de Luna','INMOBILIARIA CÁCERES OS PRESENTA: <br><br>SOLAMENTE ALQUILER CON OPCIÓN A COMPRA. Abstenerse llamar quien no cumpla estas condiciones.<br><br>CONDICIONES:<br>ALQUILER MENSUAL 550€UROS<br>PRIMA INICIAL 16.000€UROS<br>PLAZO PARA COMPRA 3 AÑOS: <br>DEDUCIONES A NEGOCIAR<br>PRECIO VENTA 159.000€UROS.<br><br>Exclusivo dúplex de 96 metros cuadrados en el entorno de la Plaza Marrón, ubicado perfectamente para prescindir del coche, ofreciendo todos los servicios esenciales en la zona.<br><br>La urbanización privada cuenta con patio comunitario, amplio y con bancos y zonas verdes.<br><br>La planta principal de la vivienda se distribuye en luminoso y amplio salón con tres balcones y orientación oeste, buen aislamiento térmico y acústico, baño completo con bañera, cocina equipada con todos los electrodomésticos incluido lavavajillas, y dormitorio doble con armario empotrado revestido de pared a pared. <br><br>La planta primera cuenta con dos estancias comunicadas entre sí pero con distintas puertas para acceder y puerta corredera para independizarlas; pueden dar servicio de dormitorios dobles, salón o despacho, una de ellas con baño completo con plato de ducha y pequeño vestidor, aparte de contar con seis armarios empotrados aprovechando el hueco abohardillado. <br><br>También cuenta con plaza de garaje de fácil maniobrabilidad y amplio trastero de 15 metros. <br><br>Destaca la calefacción por gas natural, splits en todas las estancias de la vivienda, gotelé, suelos de gres, ventanas climalit, blindada, finca con ascensor… Comunidad de 55 €uros e Ibi de 350€. <br> <br>Date el gusto de vivir en una zona privilegiada!',3,2,'39.4711037,-6.3733284',' <div class="details-property-feature-one"> <h2 class="txt-medium txt-bold mb-small">Características básicas</h2> <div class="details-property_features"> <ul> <li>136 m² construidos</li> <li>3 habitaciones</li> <li>2 baños</li> <li>Balcón</li> <li>Plaza de garaje incluida en el precio</li> <li>Segunda mano/buen estado</li> <li>Armarios empotrados</li> <li>Trastero</li> <li>Orientación norte, oeste</li> <li>Construido en 1992</li> <li>Amueblado y cocina equipada</li> <li>Calefacción individual: Gas natural</li> <li>Certificación energética: en trámite</li> </ul> </div> </div> <div class="details-property-feature-two"> <h2 class="txt-medium txt-bold mb-small">Edificio</h2> <div class="details-property_features"> <ul> <li> Planta 2ª exterior </li> <li> con ascensor </li> </ul> </div> <h2 class="txt-medium txt-bold mb-small">Equipamiento</h2> <div class="details-property_features"> <ul> <li> Aire acondicionado </li> <li> Zonas verdes </li> </ul> </div> </div> <div class="details-property-feature-three"> </div> ',NULL,'2ª planta exterior con ascensor','Garaje incluido',NULL),
