BEGIN TRANSACTION;
DROP TABLE IF EXISTS "usuario";
CREATE TABLE IF NOT EXISTS "usuario" (
	"id"	INTEGER NOT NULL,
	"email"	VARCHAR(180) NOT NULL,
	"roles"	CLOB NOT NULL,
	"password"	VARCHAR(255) NOT NULL,
	"nombre"	VARCHAR(15) DEFAULT NULL,
	"apellidos"	VARCHAR(25) DEFAULT NULL,
	"fecha_nac"	DATE DEFAULT NULL,
	"imagen_usu"	VARCHAR(50) DEFAULT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "ciudad";
CREATE TABLE IF NOT EXISTS "ciudad" (
	"id"	INTEGER NOT NULL,
	"nombre_ciudad"	VARCHAR(25) NOT NULL COLLATE BINARY,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "propietario";
CREATE TABLE IF NOT EXISTS "propietario" (
	"id"	INTEGER NOT NULL,
	"nombre"	VARCHAR(50) DEFAULT NULL,
	"email_prop"	VARCHAR(100) DEFAULT NULL,
	"telefono"	INTEGER DEFAULT NULL,
	"tipo_propietario"	VARCHAR(50) DEFAULT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "fotos";
CREATE TABLE IF NOT EXISTS "fotos" (
	"id"	INTEGER NOT NULL,
	"id_casa_id"	INTEGER NOT NULL,
	"ruta"	VARCHAR(255) DEFAULT NULL,
	"principal"	INTEGER DEFAULT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("id_casa_id") REFERENCES "casa"("id") ON DELETE CASCADE
);
DROP TABLE IF EXISTS "casa";
CREATE TABLE IF NOT EXISTS "casa" (
	"id"	INTEGER NOT NULL,
	"id_ciu_id"	INTEGER NOT NULL,
	"id_usu_id"	INTEGER DEFAULT NULL,
	"id_prop_id"	INTEGER DEFAULT NULL,
	"m2"	INTEGER DEFAULT NULL,
	"precio"	INTEGER DEFAULT NULL,
	"direccion"	VARCHAR(100) NOT NULL COLLATE BINARY,
	"cp"	VARCHAR(5) DEFAULT NULL COLLATE BINARY,
	"tipo_venta"	VARCHAR(8) DEFAULT NULL COLLATE BINARY,
	"tipo_casa"	VARCHAR(25) DEFAULT NULL COLLATE BINARY,
	"titulo"	VARCHAR(100) DEFAULT NULL COLLATE BINARY,
	"descripcion"	CLOB DEFAULT NULL COLLATE BINARY,
	"habitaciones"	INTEGER DEFAULT NULL,
	"banos"	INTEGER DEFAULT NULL,
	"coordenadas"	VARCHAR(30) DEFAULT NULL COLLATE BINARY,
	"especificaciones"	CLOB DEFAULT NULL COLLATE BINARY,
	"prioridad"	INTEGER DEFAULT NULL,
	"extra1"	VARCHAR(50) DEFAULT NULL COLLATE BINARY,
	"extra2"	VARCHAR(50) DEFAULT NULL COLLATE BINARY,
	"activo"	INTEGER DEFAULT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	CONSTRAINT "FK_7F655D1D2E56CD" FOREIGN KEY("id_prop_id") REFERENCES "propietario"("id") NOT DEFERRABLE INITIALLY IMMEDIATE,
	FOREIGN KEY("id_usu_id") REFERENCES "usuario"("id") ON DELETE SET NULL,
	CONSTRAINT "FK_7F655D1D4856300A" FOREIGN KEY("id_ciu_id") REFERENCES "ciudad"("id") NOT DEFERRABLE INITIALLY IMMEDIATE
);
DROP INDEX IF EXISTS "UNIQ_2265B05DE7927C74";
CREATE UNIQUE INDEX IF NOT EXISTS "UNIQ_2265B05DE7927C74" ON "usuario" (
	"email"
);
DROP INDEX IF EXISTS "UNIQ_8E86059E43721488";
CREATE UNIQUE INDEX IF NOT EXISTS "UNIQ_8E86059E43721488" ON "ciudad" (
	"nombre_ciudad"
);
DROP INDEX IF EXISTS "IDX_CB8405C79EEFEAD2";
CREATE INDEX IF NOT EXISTS "IDX_CB8405C79EEFEAD2" ON "fotos" (
	"id_casa_id"
);
DROP INDEX IF EXISTS "IDX_7F655D1D4856300A";
CREATE INDEX IF NOT EXISTS "IDX_7F655D1D4856300A" ON "casa" (
	"id_ciu_id"
);
DROP INDEX IF EXISTS "IDX_7F655D1DB7895EAF";
CREATE INDEX IF NOT EXISTS "IDX_7F655D1DB7895EAF" ON "casa" (
	"id_usu_id"
);
DROP INDEX IF EXISTS "IDX_7F655D1D2E56CD";
CREATE INDEX IF NOT EXISTS "IDX_7F655D1D2E56CD" ON "casa" (
	"id_prop_id"
);
COMMIT;
